\u0939\\u0940\\u0902 \\u0915\\u0940 \\u0917\\u0908 \\u0925\\u0940\\u0964<\\/p>\\r\\n\\t<\\/li>\\r\\n\\t<li>\\r\\n\\t<p><strong>\\u090f\\u091c\\u0947\\u0902\\u091f \\u0915\\u0947 \\u0915\\u0930\\u094d\\u0924\\u0935\\u094d\\u092f:<\\/strong> \\u090f\\u091c\\u0947\\u0902\\u091f \\u0915\\u094b \\u0905\\u092a\\u0928\\u0947 \\u092e\\u0941\\u0916\\u094d\\u092f \\u0915\\u0947 \\u092a\\u094d\\u0930\\u0924\\u093f \\u0915\\u0941\\u091b \\u0915\\u0930\\u094d\\u0924\\u0935\\u094d\\u092f \\u0939\\u094b\\u0924\\u0947 \\u0939\\u0948\\u0902, \\u091c\\u093f\\u0938\\u092e\\u0947\\u0902 \\u0935\\u092b\\u093e\\u0926\\u093e\\u0930\\u0940 \\u0915\\u093e \\u0915\\u0930\\u094d\\u0924\\u0935\\u094d\\u092f (\\u0915\\u0947\\u0935\\u0932 \\u092e\\u0941\\u0916\\u094d\\u092f \\u0915\\u0947 \\u0939\\u093f\\u0924 \\u092e\\u0947\\u0902 \\u0915\\u093e\\u0930\\u094d\\u0930\\u0935\\u093e\\u0908 \\u0915\\u0930\\u0928\\u093e), \\u0906\\u091c\\u094d\\u091e\\u093e \\u0915\\u093e \\u0915\\u0930\\u094d\\u0924\\u0935\\u094d\\u092f (\\u092e\\u0941\\u0916\\u094d\\u092f \\u0915\\u0940 \\u0928\\u093f\\u0930\\u094d\\u0926\\u0947\\u0936\\u094b\\u0902 \\u0915\\u093e \\u092a\\u093e\\u0932\\u0928 \\u0915\\u0930\\u0928\\u093e), \\u0926\\u0947\\u0916\\u092d\\u093e\\u0932 \\u0915\\u093e \\u0915\\u0930\\u094d\\u0924\\u0935\\u094d\\u092f (\\u092f\\u094b\\u0917\\u094d\\u092f \\u0926\\u0947\\u0916\\u092d\\u093e\\u0932 \\u0914\\u0930 \\u0915\\u094c\\u0936\\u0932 \\u0915\\u093e \\u0905\\u092d\\u094d\\u092f\\u093e\\u0938 \\u0915\\u0930\\u0928\\u093e) \\u0914\\u0930 \\u092e\\u0941\\u0916\\u094d\\u092f \\u0915\\u0947 \\u092a\\u0915\\u094d\\u0937 \\u092e\\u0947\\u0902 \\u0938\\u094c\\u0926\\u094b\\u0902 \\u092f\\u093e \\u0928\\u093f\\u0927\\u093f\\u092f\\u094b\\u0902 \\u0915\\u094b \\u0938\\u0902\\u092d\\u093e\\u0932\\u0928\\u0947 \\u0915\\u093e \\u0915\\u0930\\u094d\\u0924\\u0935\\u094d\\u092f \\u0936\\u093e\\u092e\\u093f\\u0932 \\u0939\\u0948\\u0902\\u0964<\\/p>\\r\\n\\t<\\/li>\\r\\n\\t<li>\\r\\n\\t<p><strong>\\u092e\\u0941\\u09