\u0644\\u0625\\u062c\\u0631\\u0627\\u0621 \\u063a\\u064a\\u0631 \\u0627\\u0644\\u0645\\u0635\\u0631\\u062d \\u0628\\u0647\\u060c \\u0648\\u0627\\u0644\\u0630\\u064a \\u064a\\u0639\\u0631\\u0641 \\u0628\\u0627\\u0644\\u062a\\u0635\\u062f\\u064a\\u0642. \\u0641\\u064a \\u0645\\u062b\\u0644 \\u0647\\u0630\\u0647 \\u0627\\u0644\\u062d\\u0627\\u0644\\u0627\\u062a\\u060c \\u064a\\u0635\\u0628\\u062d \\u0627\\u0644\\u0645\\u0648\\u0643\\u0644 \\u0645\\u0644\\u0632\\u0645\\u0627\\u064b \\u0628\\u0623\\u0641\\u0639\\u0627\\u0644 \\u0627\\u0644\\u0648\\u0643\\u064a\\u0644 \\u0643\\u0645\\u0627 \\u0644\\u0648 \\u0643\\u0627\\u0646\\u062a \\u0645\\u0635\\u0631\\u062d\\u0627\\u064b \\u0628\\u0647\\u0627 \\u0645\\u0646 \\u0627\\u0644\\u0628\\u062f\\u0627\\u064a\\u0629.<\\/p>\\r\\n\\t<\\/li>\\r\\n<\\/ol>\\r\\n<p>\\u0644\\u062f\\u0649 \\u0642\\u0627\\u0646\\u0648\\u0646 \\u0627\\u0644\\u0648\\u0643\\u0627\\u0644\\u0629 \\u062a\\u0623\\u062b\\u064a\\u0631 \\u0643\\u0628\\u064a\\u0631 \\u0641\\u064a \\u0645\\u062c\\u0627\\u0644\\u0627\\u062a \\u0645\\u062e\\u062a\\u0644\\u0641\\u0629\\u060c \\u0628\\u0645\\u0627 \\u0641\\u064a \\u0630\\u0644\\u0643 \\u0627\\u0644\\u0645\\u0639\\u0627\\u0645\\u0644\\u0627\\u062a \\u0627\\u0644\\u062a\\u062c\\u0627\\u0631\\u064a\\u0629\\u060c \\u0648\\u0627\\u0644\\u0639\\u0644\\u0627\\u0642\\u0627\\u062a \\u0627\\u0644\\u0648\\u0638\\u064a\\u0641\\u064a\\u0629\\u060c \\u0648\\u0627\\u0644\\u0639\\u0642\\u0627\\u0631\\u0627\\u062a\\u060c \\u0648\\u0623\\u0643\\u062b\\u0631 \\u0645\\u0646 \\u0630\\u0644\\u0643. \\u0625\\u0646\\u0647 \\u064a\\u0633\\u0627\\u0639\\u062f \\u0641\\u064a \\u062a\\u062d\\u062f\\u064a\\u062f \\u0627\\u0644\\u062d\\u0642\\u0648\\u0642 \\u0648\\u0627\\u0644\\u0645\\u0633\\u0624\\u0648\\u0644\\u064a\\u0627\\u062a \\u0644\\u0644\\u0637\\u0631\\u0641\\u064a\\u0646 \\u0641\\u064a \\u0639\\u0644\\u0627\\u0642\\u0629 \\u0627\\u0644\\u0645\\u0648\\u0643\\u0644 \\u0648\\u0627\\u0644\\u0648\\u0643\\u064a\\u0644\\u060c \\u0648\\u064a\\u06