                'description' => '{"en":"Analyzing the motion, forces, and torques of robot manipulators and mobile platforms. Kinematics involves studying the motion without considering the forces involved, while dynamics involves studying the forces and torques required to produce the motion.","hi":"\\u0930\\u094b\\u092c\\u094b\\u091f \\u0915\\u093f\\u0928\\u0947\\u092e\\u0947\\u091f\\u093f\\u0915\\u094d\\u0938 \\u0914\\u0930 \\u0917\\u0924\\u093f\\u0915\\u0940 \\u092e\\u0948\\u0915\\u0947\\u0928\\u093f\\u0915\\u0932 \\u0907\\u0902\\u091c\\u0940\\u0928\\u093f\\u092f\\u0930\\u093f\\u0902\\u0917 \\u0915\\u0947 \\u0936\\u093e\\u0916\\u093e\\u090f\\u0902 \\u0939\\u0948\\u0902 \\u091c\\u094b \\u0930\\u094b\\u092c\\u094b\\u091f\\u094b\\u0902 \\u0915\\u0947 \\u0917\\u0924\\u093f\\u0935\\u093f\\u0927\\u093f \\u0914\\u0930 \\u092c\\u0932\\u094b\\u0902 \\u0915\\u0947 \\u092a\\u094d\\u0930\\u092d\\u093e\\u0935 \\u0915\\u093e \\u0905\\u0927\\u094d\\u092f\\u092f\\u0928 \\u0915\\u0930\\u0924\\u0940 \\u0939\\u0948\\u0902\\u0964 \\u0915\\u093f\\u0928\\u0947\\u092e\\u0947\\u091f\\u093f\\u0915\\u094d\\u0938 \\u0930\\u094b\\u092c\\u094b\\u091f\\u094b\\u0902 \\u0915\\u0940 \\u0917\\u0924\\u093f \\u0914\\u0930 \\u0926\\u093f\\u0936\\u093e \\u0915\\u093e \\u0905\\u0927\\u094d\\u092f\\u092f\\u0928 \\u0915\\u0930\\u0924\\u0940 \\u0939\\u0948 \\u0914\\u0930 \\u0909\\u0928\\u0915\\u0947 \\u092e\\u093e\\u0930\\u094d\\u0917 \\u0915\\u093e \\u0921\\u093f\\u091c\\u093c\\u093e\\u0907\\u0928 \\u0915\\u0930\\u0924\\u0940 \\u0939\\u0948, \\u091c\\u092c\\u0915\\u093f \\u0917\\u0924\\u093f\\u0915\\u0940 \\u0930\\u094b\\u092c\\u094b\\u091f\\u094b\\u0902 \\u092a\\u0930 \\u092a\\u094d\\u0930\\u092d\\u093e\\u0935 \\u0921\\u093e\\u0932\\u0928\\u0947 \\u0935\\u093e\\u0932\\u0947 \\u092c\\u0932\\u094b\\u0902, \\u092e\\u094b\\u092e\\u0947\\u0902\\u091f \\u0914\\u0930 \\u0915\\u0902\\u092a\\u0928 \\u0915\\u093e \\u0935\\u093f\\u0936\\u094d\\u0932\\u0947\\u0937\\u0923 \\u0915\\u0930\\u0924\\u0940 \\u0939\\u09