            array (
                'id' => 11,
                'name' => '{"en":"Telecommunications Law","hi":"\\u0926\\u0942\\u0930\\u0938\\u0902\\u091a\\u093e\\u0930 \\u0915\\u093e\\u0928\\u0942\\u0928","ar":"\\u0642\\u0627\\u0646\\u0648\\u0646 \\u0627\\u0644\\u0627\\u062a\\u0635\\u0627\\u0644\\u0627\\u062a"}',
                'description' => '{"en":"<p>Telecommunications law refers to the legal framework and regulations that govern the provision of telecommunications services and the use of telecommunications networks. Telecommunications law encompasses a wide range of issues, including telecommunications infrastructure, licensing, competition, consumer protection, privacy, and more. It is designed to ensure fair competition, promote efficient use of resources, protect consumer rights, and facilitate the development of communication technologies.<\\/p>","hi":"<p>\\u0926\\u0942\\u0930\\u0938\\u0902\\u091a\\u093e\\u0930 \\u0915\\u093e\\u0928\\u0942\\u0928 \\u0909\\u092a\\u092f\\u094b\\u0917 \\u0914\\u0930 \\u0926\\u0942\\u0930\\u0938\\u0902\\u091a\\u093e\\u0930 \\u0928\\u0947\\u091f\\u0935\\u0930\\u094d\\u0915\\u094b\\u0902 \\u0915\\u0940 \\u092a\\u094d\\u0930\\u0926\\u093e\\u0928 \\u0915\\u0940 \\u092a\\u094d\\u0930\\u0915\\u094d\\u0930\\u093f\\u092f\\u093e \\u0915\\u094b \\u0928\\u093f\\u092f\\u0902\\u0924\\u094d\\u0930\\u093f\\u0924 \\u0915\\u0930\\u0928\\u0947 \\u0935\\u093e\\u0932\\u0947 \\u0915\\u093e\\u0928\\u0942\\u0928\\u0940 \\u0922\\u093e\\u0902\\u091a\\u0947 \\u0914\\u0930 \\u0935\\u093f\\u0927\\u093f\\u092f\\u094b\\u0902 \\u0915\\u093e \\u0938\\u0902\\u0926\\u0930\\u094d\\u092d \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948\\u0964 \\u0926\\u0942\\u0930\\u0938\\u0902\\u091a\\u093e\\u0930 \\u0915\\u093e\\u0928\\u0942\\u0928 \\u0935\\u093f\\u092d\\u093f\\u0928\\u094d\\u0928 \\u092e\\u0941\\u0926\\u094d\\u0926\\u094b\\u0902 \\u0915\\u094b \\u0936\\u093e\\u092e\\u093f\\u0932 \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948, \\u091c\\u0948\\u0938\\u0947 \\u0915\\u0940 \\u0926\\u0942\\u0930\\u0938\\u0902\\u091a\\u093e\\u0930 \\u092c\\u0941\\u0928\\u093f\\u092f\\u093e\\u0926\\u0940 \\u0922\\u093e\\u0902\\u091a\\u093e, \\u0932\\u093e\\u0907\\u0938\\u0947\\u0902\\u0938 \\u092a\\u094d\\u0930\\u093e\\u092a\\u094d\\u0924\\u093f, \\u092a\\u094d\\u0930\\u0924\\u093f\\u0938\\u094d\\u092a\\u0930\\u094d\\u0927\\u093e, \\u0909\\u092a\\u092d\\u094b\\u0915\\u094d\\u0924\\u093e \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e, \\u0917\\u094b\\u092a\\u0928\\u0940\\u092f\\u0924\\u093e, \\u0914\\u0930 \\u0905\\u0928\\u094d\\u092f\\u0964 \\u0907\\u0938\\u0915\\u093e \\u0909\\u0926\\u094d\\u0926\\u0947\\u0936\\u094d\\u092f \\u092f\\u094b\\u091c\\u0928\\u093e \\u092c\\u0928\\u093e\\u0928\\u093e \\u0939\\u0948 \\u0924\\u093e\\u0915\\u093f \\u0928\\u093f\\u0937\\u094d\\u092a\\u0915\\u094d\\u0937 \\u092a\\u094d\\u0930\\u0924\\u093f\\u0938\\u094d\\u092a\\u0930\\u094d\\u0927\\u093e \\u0938\\u0941\\u0928\\u093f\\u0936\\u094d\\u091a\\u093f\\u0924 \\u0939\\u094b, \\u0938\\u0902\\u0938\\u093e\\u0927\\u0928\\u094b\\u0902 \\u0915\\u093e \\u0915\\u0941\\u0936\\u0932 \\u0909\\u092a\\u092f\\u094b\\u0917 \\u0939\\u094b, \\u0909\\u092a\\u092d\\u094b\\u0915\\u094d\\u0924\\u093e \\u0915\\u0947 \\u0905\\u0927\\u093f\\u0915\\u093e\\u0930\\u094b\\u0902 \\u0915\\u0940 \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e \\u0939\\u094b, \\u0914\\u0930 \\u0938\\u0902\\u091a\\u093e\\u0930 \\u092a\\u094d\\u0930\\u094c\\u0926\\u094d\\u092f\\u094b\\u0917\\u093f\\u0915\\u093f\\u092f\\u094b\\u0902 \\u0915\\u0947 \\u0935\\u093f\\u0915\\u093e\\u0938 \\u0915\\u094b \\u0938\\u0941\\u0917\\u092e \\u092c\\u0928\\u093e\\u092f\\u093e \\u091c\\u093e \\u0938\\u0915\\u0947\\u0964<\\/p>","ar":"<p>\\u0642\\u0627\\u0646\\u0648\\u0646 \\u0627\\u0644\\u0627\\u062a\\u0635\\u0627\\u0644\\u0627\\u062a \\u064a\\u0634\\u064a\\u0631 \\u0625\\u0644\\u0649 \\u0627\\u0644\\u0625\\u0637\\u0627\\u0631 \\u0627\\u0644\\u0642\\u0627\\u0646\\u0648\\u0646\\u064a \\u0648\\u0627\\u0644\\u0644\\u0648\\u0627\\u0626\\u062d \\u0627\\u0644\\u062a\\u064a \\u062a\\u062d\\u0643\\u0645 \\u062a\\u0648\\u0641\\u064a\\u0631 \\u062e\\u062f\\u0645\\u0627\\u062a \\u0627\\u0644\\u0627\\u062a\\u0635\\u0627\\u0644\\u0627\\u062a \\u0648\\u0627\\u0633\\u062a\\u062e\\u062f\\u0627\\u0645 \\u0634\\u0628\\u0643\\u0627\\u062a \\u0627\\u0644\\u06