                'description' => '{"en":"Designing the control algorithms and feedback mechanisms that regulate the motion, stability, and performance of robots. Control systems engineering involves concepts such as PID control, state estimation, and adaptive control","hi":"\\u0928\\u093f\\u092f\\u0902\\u0924\\u094d\\u0930\\u0923 \\u092a\\u094d\\u0930\\u0923\\u093e\\u0932\\u0940 \\u090f\\u0915 \\u092a\\u094d\\u0930\\u094c\\u0926\\u094d\\u092f\\u094b\\u0917\\u093f\\u0915\\u0940 \\u0939\\u0948 \\u091c\\u094b \\u0917\\u0924\\u093f\\u0936\\u0940\\u0932 \\u092a\\u094d\\u0930\\u0923\\u093e\\u0932\\u093f\\u092f\\u094b\\u0902 \\u0915\\u094b \\u0928\\u093f\\u092f\\u0902\\u0924\\u094d\\u0930\\u093f\\u0924 \\u0915\\u0930\\u0928\\u0947 \\u0915\\u093e \\u0909\\u0926\\u094d\\u0926\\u0947\\u0936\\u094d\\u092f \\u0930\\u0916\\u0924\\u0940 \\u0939\\u0948, \\u091c\\u093f\\u0938\\u0947 \\u0917\\u0923\\u093f\\u0924\\u0940\\u092f \\u0928\\u093f\\u092f\\u092e\\u094b\\u0902 \\u0914\\u0930 \\u0938\\u093f\\u0926\\u094d\\u0927\\u093e\\u0902\\u0924\\u094b\\u0902 \\u0915\\u093e \\u0905\\u0928\\u0941\\u092a\\u093e\\u0932\\u0928 \\u0915\\u0930\\u0915\\u0947 \\u0935\\u093f\\u0938\\u094d\\u0924\\u093e\\u0930 \\u0938\\u0947 \\u0938\\u0902\\u091a\\u093e\\u0932\\u093f\\u0924 \\u0915\\u093f\\u092f\\u093e \\u091c\\u093e\\u0924\\u093e \\u0939\\u0948\\u0964 \\u0928\\u093f\\u092f\\u0902\\u0924\\u094d\\u0930\\u0923 \\u092a\\u094d\\u0930\\u0923\\u093e\\u0932\\u0940 \\u0915\\u0908 \\u0935\\u093f\\u092d\\u093f\\u0928\\u094d\\u0928 \\u0915\\u094d\\u0937\\u0947\\u0924\\u094d\\u0930\\u094b\\u0902 \\u092e\\u0947\\u0902 \\u0909\\u092a\\u092f\\u094b\\u0917 \\u0915\\u0940 \\u091c\\u093e\\u0924\\u0940 \\u0939\\u0948 \\u091c\\u0948\\u0938\\u0947 \\u0915\\u093f \\u0935\\u093f\\u092e\\u093e\\u0928, \\u0914\\u0926\\u094d\\u092f\\u094b\\u0917\\u093f\\u0915, \\u0917\\u093e\\u0921\\u093c\\u093f\\u092f\\u094b\\u0902, \\u0914\\u0930 \\u0930\\u094b\\u092c\\u094b\\u091f\\u093f\\u0915\\u094d\\u0938\\u0964","ar":"\\u0646\\u0638\\