                'name' => '{"en":"Financial Regulation","hi":"\\u0935\\u093f\\u0924\\u094d\\u0924\\u0940\\u092f \\u0935\\u093f\\u0928\\u093f\\u092f\\u092e\\u0928","ar":"\\u0627\\u0644\\u0644\\u0627\\u0626\\u062d\\u0629 \\u0627\\u0644\\u0645\\u0627\\u0644\\u064a\\u0629"}',
                'description' => '{"en":"<p>Financial regulation refers to the framework of laws, rules, and oversight mechanisms established by government authorities to ensure the stability, integrity, transparency, and fair operation of financial markets and institutions. Financial regulation aims to protect investors, consumers, and the broader economy from risks associated with financial activities, while also promoting healthy competition and preventing fraud, misconduct, and systemic crises.<\\/p>","hi":"<p>\\u0935\\u093f\\u0924\\u094d\\u0924\\u0940\\u092f \\u0935\\u093f\\u0928\\u093f\\u092f\\u092e\\u0928 \\u0938\\u0930\\u0915\\u093e\\u0930\\u0940 \\u0905\\u0927\\u093f\\u0915\\u093e\\u0930\\u093f\\u092f\\u094b\\u0902 \\u0926\\u094d\\u0935\\u093e\\u0930\\u093e \\u0938\\u094d\\u0925\\u093e\\u092a\\u093f\\u0924 \\u0915\\u093e\\u0928\\u0942\\u0928\\u094b\\u0902, \\u0928\\u093f\\u092f\\u092e\\u094b\\u0902 \\u0914\\u0930 \\u0928\\u093f\\u0917\\u0930\\u093e\\u0928\\u0940 \\u092f\\u093e\\u0902\\u0924\\u094d\\u0930\\u093f\\u0915\\u093f\\u092f\\u094b\\u0902 \\u0915\\u0947 \\u0922\\u093e\\u0902\\u091a\\u0947 \\u0915\\u093e \\u0938\\u0902\\u0926\\u0930\\u094d\\u092d \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948 \\u091c\\u093f\\u0928\\u0915\\u093e \\u0909\\u0926\\u094d\\u0926\\u0947\\u0936\\u094d\\u092f \\u0935\\u093f\\u0924\\u094d\\u0924\\u0940\\u092f \\u092c\\u093e\\u091c\\u093e\\u0930\\u094b\\u0902 \\u0914\\u0930 \\u0938\\u0902\\u0938\\u094d\\u0925\\u093e\\u0928\\u094b\\u0902 \\u0915\\u0940 \\u0938\\u094d\\u0925\\u093f\\u0930\\u0924\\u093e, \\u0908\\u092e\\u093e\\u0928\\u0926\\u093e\\u0930\\u0940, \\u092a\\u093e\\u0930\\u0926\\u0930\\u094d\\u0936\\u093f\\u0924\\u093e, \\u0914\\u0930 \\u0909\\u091a\\u093f\\u0924 \\u0938\\u0902\\u091a\\u093e\\u0932\\u0928 \\u0938\\u0941\\u0928\\u093f\\u0936\\u094d\\u091a\\u093f\\u0924 \\u0915\\u0930\\u0928\\u093e \\u0939\\u0948\\u0964 \\u0935\\u093f\\u0924\\u094d\\u0924\\u0940\\u092f \\u0928\\u093f\\u092f\\u093e\\u092e\\u0928 \\u0915\\u093