                'name' => '{"en":"Special Education Law","hi":"\\u0935\\u093f\\u0936\\u0947\\u0937 \\u0936\\u093f\\u0915\\u094d\\u0937\\u093e \\u0915\\u093e\\u0928\\u0942\\u0928","ar":"\\u0642\\u0627\\u0646\\u0648\\u0646 \\u0627\\u0644\\u062a\\u0639\\u0644\\u064a\\u0645 \\u0627\\u0644\\u062e\\u0627\\u0635"}',
                'description' => '{"en":"<p>Special education law encompasses the legal framework and regulations governing the rights, services, and accommodations provided to students with disabilities in educational settings. It ensures that students with disabilities have equal access to a quality education and the necessary support to succeed academically and socially. Special education law is primarily governed by federal laws and regulations, with some variations at the state level. Here are key aspects and components of special education law:<\\/p>","hi":"<p>\\u0935\\u093f\\u0936\\u0947\\u0937 \\u0936\\u093f\\u0915\\u094d\\u0937\\u093e \\u0915\\u093e\\u0928\\u0942\\u0928 \\u0935\\u093f\\u0926\\u094d\\u092f\\u093e\\u0932\\u092f\\u0940 \\u092a\\u0930\\u093f\\u0926\\u0943\\u0936\\u094d\\u092f\\u094b\\u0902 \\u092e\\u0947\\u0902 \\u0935\\u093f\\u0915\\u0932\\u093e\\u0902\\u0917 \\u091b\\u093e\\u0924\\u094d\\u0930\\u094b\\u0902 \\u0915\\u094b \\u092a\\u094d\\u0930\\u0926\\u0924\\u094d\\u0924 \\u0905\\u0927\\u093f\\u0915\\u093e\\u0930, \\u0938\\u0947\\u0935\\u093e\\u090f\\u0902 \\u0914\\u0930 \\u0906\\u0930\\u093e\\u092e\\u0917\\u093e\\u0939\\u094b\\u0902 \\u0915\\u094b \\u0928\\u093f\\u092f\\u0902\\u0924\\u094d\\u0930\\u093f\\u0924 \\u0915\\u0930\\u0928\\u0947 \\u0935\\u093e\\u0932\\u0947 \\u0915\\u093e\\u0928\\u0942\\u0928\\u0940 \\u0922\\u093e\\u0902\\u091a\\u093e \\u0914\\u0930 \\u0935\\u093f\\u0928\\u093f\\u092f\\u092e\\u0928 \\u0915\\u094b \\u0938\\u092e\\u093e\\u0939\\u093f\\u0924 \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948\\u0964 \\u092f\\u0939 \\u0938\\u0941\\u0928\\u093f\\u0936\\u094d\\u091a\\u093f\\u0924 \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948 \\u0915\\u093f \\u0935\\u093f\\u0915\\u0932\\u093e\\u0902\\u0917 \\u091b\\u093e\\u0924\\u094d\\u0930\\u094b\\u0902 \\u0915\\u094b \\u0909\\u091a\\u094d\\u091a \\u0917\\u0941\\u0923\\u0935\\u0924\\u094d\\u0924\\u093e \\u0935\\u093e\\u0932\\u0940 \\u0936\\u093f\\u0915\\u094d\\u0937\\u093e \\u0914\\u0930 \\u0935\