            'description' => '{"en":"Study of the processes and techniques used to verify and validate software systems to ensure they meet quality standards and functional requirements. Software testing includes techniques such as unit testing, integration testing, system testing, and acceptance testing, as well as automated testing and test-driven development (TDD).","hi":"\\u0938\\u0949\\u092b\\u093c\\u094d\\u091f\\u0935\\u0947\\u092f\\u0930 \\u092a\\u0930\\u0940\\u0915\\u094d\\u0937\\u0923 \\u0914\\u0930 \\u0917\\u0941\\u0923\\u0935\\u0924\\u094d\\u0924\\u093e \\u0906\\u0936\\u094d\\u0935\\u093e\\u0938\\u0928 \\u0926\\u094b \\u092a\\u094d\\u0930\\u092e\\u0941\\u0916 \\u0917\\u0924\\u093f\\u0935\\u093f\\u0927\\u093f\\u092f\\u093e\\u0901 \\u0939\\u0948\\u0902 \\u091c\\u094b \\u0909\\u0928\\u0915\\u0947 \\u0935\\u093f\\u0915\\u093e\\u0938 \\u0915\\u0940 \\u0917\\u0941\\u0923\\u0935\\u0924\\u094d\\u0924\\u093e \\u0914\\u0930 \\u0938\\u0941\\u0928\\u093f\\u0936\\u094d\\u091a\\u093f\\u0924 \\u0915\\u0930\\u0924\\u0940 \\u0939\\u0948\\u0902\\u0964 \\u0938\\u0949\\u092b\\u093c\\u094d\\u091f\\u0935\\u0947\\u092f\\u0930 \\u092a\\u0930\\u0940\\u0915\\u094d\\u0937\\u0923 \\u092e\\u0947\\u0902, \\u092c\\u0940\\u092e\\u093e\\u0930\\u093f\\u092f\\u094b\\u0902 \\u0915\\u0940 \\u0916\\u094b\\u091c \\u0915\\u0930\\u0928\\u0947 \\u0914\\u0930 \\u0938\\u0949\\u092b\\u093c\\u094d\\u091f\\u0935\\u0947\\u092f\\u0930 \\u0915\\u0940 \\u0917\\u0941\\u0923\\u0935\\u0924\\u094d\\u0924\\u093e \\u0915\\u0940 \\u091c\\u093e\\u0901\\u091a \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0915\\u0908 \\u092a\\u094d\\u0930\\u0915\\u093e\\u0930 \\u0915\\u0947 \\u092a\\u0930\\u0940\\u0915\\u094d\\u0937\\u0923 \\u0915\\u093e\\u0930\\u094d\\u092f\\u0915\\u094d\\u0930\\u092e \\u0936\\u093e\\u092e\\u093f\\u0932 \\u0939\\u094b\\u0924\\u0947 \\u0939\\u0948\\u0902\\u0964 \\u0935\\u0939\\u0940\\u0902, \\u0917\\u0941\\u0923\\u0935\\u0924\\u094d\\u0924\\u093e \\u0906\\u0936\\u094d\\u0935\