                'description' => '{"en":"Unsupervised Learning is a machine learning paradigm where the model learns patterns from unlabeled data without any explicit supervision. The algorithm explores the data structure to find hidden patterns or intrinsic structures, such as clustering similar data points together or reducing the dimensionality of the data.","hi":"\\u0905\\u0928\\u0941\\u092a\\u0947\\u0915\\u094d\\u0937\\u093f\\u0924 \\u0905\\u0927\\u093f\\u0917\\u092e \\u090f\\u0915 \\u092e\\u0936\\u0940\\u0928 \\u0905\\u0927\\u093f\\u0917\\u092e \\u0928\\u0948\\u0924\\u093f\\u0915\\u0924\\u093e \\u0939\\u0948 \\u091c\\u0939\\u093e\\u0902 \\u092e\\u0949\\u0921\\u0932 \\u092c\\u093f\\u0928\\u093e \\u0915\\u093f\\u0938\\u0940 \\u0938\\u094d\\u092a\\u0937\\u094d\\u091f \\u092a\\u0930\\u094d\\u092f\\u0935\\u0947\\u0915\\u094d\\u0937\\u0923 \\u0915\\u0947 \\u0905\\u0928\\u0932\\u0947\\u092c\\u0932\\u094d\\u0921 \\u0921\\u0947\\u091f\\u093e \\u0938\\u0947 \\u092a\\u0948\\u091f\\u0930\\u094d\\u0928\\u094d\\u0938 \\u0938\\u0940\\u0916\\u0924\\u093e \\u0939\\u0948\\u0964 \\u090f\\u0932\\u094d\\u0917\\u094b\\u0930\\u093f\\u0926\\u092e \\u0921\\u0947\\u091f\\u093e \\u0938\\u0902\\u0930\\u091a\\u0928\\u093e \\u0915\\u0940 \\u0916\\u094b\\u091c \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948 \\u0924\\u093e\\u0915\\u093f \\u091b\\u093f\\u092a\\u0947 \\u0939\\u0941\\u090f \\u092a\\u0948\\u091f\\u0930\\u094d\\u0928 \\u092f\\u093e \\u0905\\u0902\\u0924\\u0930\\u094d\\u0928\\u093f\\u0915\\u0940 \\u0938\\u0902\\u0930\\u091a\\u0928\\u094b\\u0902, \\u091c\\u0948\\u0938\\u0947 \\u0915\\u093f \\u0938\\u092e\\u093e\\u0928 \\u0921\\u0947\\u091f\\u093e \\u092c\\u093f\\u0902\\u0926\\u0941\\u0913\\u0902 \\u0915\\u094b \\u090f\\u0915 \\u0938\\u093e\\u0925 \\u0915\\u094d\\u0932\\u0938\\u094d\\u091f\\u0930\\u093f\\u0902\\u0917 \\u0915\\u0930\\u0928\\u093e \\u092f\\u093e \\u0921\\u0947\\u091f\\u093e \\u0915\\u0940 \\u0906\\u092f\\u093e\\u092e\\u093e\\u0915 \\u0918\\u091f\\u093e\\u0928\\u093e, \\u0