                'description' => '{"en":"Number Theory is a branch of mathematics that deals with the properties and relationships of numbers, particularly integers. It includes the study of prime numbers, divisibility, modular arithmetic, and Diophantine equations.","hi":"\\u0938\\u0902\\u0916\\u094d\\u092f\\u093e \\u0938\\u093f\\u0926\\u094d\\u0927\\u093e\\u0902\\u0924 \\u090f\\u0915 \\u0917\\u0923\\u093f\\u0924 \\u0915\\u0940 \\u0936\\u093e\\u0916\\u093e \\u0939\\u0948 \\u091c\\u094b \\u0938\\u0902\\u0916\\u094d\\u092f\\u093e\\u0913\\u0902 \\u0914\\u0930 \\u0909\\u0928\\u0915\\u0947 \\u0917\\u0941\\u0923\\u094b\\u0902 \\u0914\\u0930 \\u0938\\u0902\\u092c\\u0902\\u0927\\u094b\\u0902, \\u0935\\u093f\\u0936\\u0947\\u0937\\u0924\\u0903 \\u092a\\u0942\\u0930\\u094d\\u0923\\u093e\\u0902\\u0915\\u094b\\u0902, \\u0915\\u0947 \\u0905\\u0927\\u094d\\u092f\\u092f\\u0928 \\u0938\\u0947 \\u0938\\u0902\\u092c\\u0902\\u0927\\u093f\\u0924 \\u0939\\u0948\\u0964 \\u0907\\u0938\\u092e\\u0947\\u0902 \\u092e\\u0941\\u0916\\u094d\\u092f \\u0930\\u0942\\u092a \\u0938\\u0947 \\u092a\\u094d\\u0930\\u0927\\u093e\\u0928 \\u0938\\u0902\\u0916\\u094d\\u092f\\u093e\\u0913\\u0902, \\u0935\\u093f\\u092d\\u093e\\u091c\\u094d\\u092f\\u0924\\u093e, \\u092e\\u0949\\u0921\\u094d\\u092f\\u0942\\u0932\\u0930 \\u0905\\u0902\\u0915\\u0917\\u0923\\u093f\\u0924, \\u0914\\u0930 \\u0921\\u093e\\u092f\\u094b\\u092b\\u093c\\u0948\\u0902\\u091f\\u093e\\u0907\\u0928 \\u0938\\u092e\\u0940\\u0915\\u0930\\u0923\\u094b\\u0902 \\u0915\\u093e \\u0905\\u0927\\u094d\\u092f\\u092f\\u0928 \\u0936\\u093e\\u092e\\u093f\\u0932 \\u0939\\u0948\\u0964","ar":"\\u0646\\u0638\\u0631\\u064a\\u0629 \\u0627\\u0644\\u0623\\u0639\\u062f\\u0627\\u062f \\u0647\\u064a \\u0641\\u0631\\u0639 \\u0645\\u0646 \\u0627\\u0644\\u0631\\u064a\\u0627\\u0636\\u064a\\u0627\\u062a \\u064a\\u062a\\u0646\\u0627\\u0648\\u0644 \\u0627\\u0644\\u062e\\u0635\\u0627\\u0626\\u0635 \\u0648\\u0627\\u0644\\u0639\\u0644\\u0627\\u0642\\u0627\\u062a \\u0628\\u064a\\