                'description' => '{"en":"Probability is a branch of mathematics that deals with the likelihood of events occurring. It quantifies uncertainty and measures the likelihood of various outcomes in a given situation.","hi":"\\u0938\\u0902\\u092d\\u093e\\u0935\\u0928\\u093e \\u0917\\u0923\\u093f\\u0924 \\u0915\\u0940 \\u090f\\u0915 \\u0936\\u093e\\u0916\\u093e \\u0939\\u0948 \\u091c\\u094b \\u0918\\u091f\\u0928\\u093e\\u0913\\u0902 \\u0915\\u0947 \\u0939\\u094b\\u0928\\u0947 \\u0915\\u0940 \\u0938\\u0902\\u092d\\u093e\\u0935\\u0928\\u093e \\u0915\\u0947 \\u0938\\u093e\\u0925 \\u0938\\u0902\\u092c\\u0902\\u0927\\u093f\\u0924 \\u0939\\u094b\\u0924\\u0940 \\u0939\\u0948\\u0964 \\u092f\\u0939 \\u0905\\u0928\\u093f\\u0936\\u094d\\u091a\\u093f\\u0924\\u0924\\u093e \\u0915\\u094b \\u092e\\u093e\\u092a\\u0924\\u093e \\u0939\\u0948 \\u0914\\u0930 \\u090f\\u0915 \\u0926\\u093f\\u090f \\u0917\\u090f \\u092a\\u0930\\u093f\\u0938\\u094d\\u0925\\u093f\\u0924\\u093f \\u092e\\u0947\\u0902 \\u0935\\u093f\\u092d\\u093f\\u0928\\u094d\\u0928 \\u092a\\u0930\\u093f\\u0923\\u093e\\u092e\\u094b\\u0902 \\u0915\\u0940 \\u0938\\u0902\\u092d\\u093e\\u0935\\u0928\\u093e \\u0915\\u094b \\u092e\\u093e\\u092a\\u0924\\u093e \\u0939\\u0948\\u0964","ar":"\\u0627\\u0644\\u0627\\u062d\\u062a\\u0645\\u0627\\u0644\\u064a\\u0629 \\u0647\\u064a \\u0641\\u0631\\u0639 \\u0645\\u0646 \\u0627\\u0644\\u0631\\u064a\\u0627\\u0636\\u064a\\u0627\\u062a \\u064a\\u062a\\u0646\\u0627\\u0648\\u0644 \\u0627\\u062d\\u062a\\u0645\\u0627\\u0644 \\u062d\\u062f\\u0648\\u062b \\u0627\\u0644\\u0623\\u062d\\u062f\\u0627\\u062b. \\u0625\\u0646\\u0647\\u0627 \\u062a\\u0642\\u064a\\u0633 \\u0639\\u062f\\u0645 \\u0627\\u0644\\u064a\\u0642\\u064a\\u0646 \\u0648\\u062a\\u0642\\u064a\\u0633 \\u0627\\u062d\\u062a\\u0645\\u0627\\u0644\\u064a\\u0629 \\u0627\\u0644\\u0646\\u062a\\u0627\\u0626\\u062c \\u0627\\u0644\\u0645\\u062e\\u062a\\u0644\\u0641\\u0629 \\u0641\\u064a \\u0627\\u0644\\u0648\\u0636\\u0639 \\u0627\\u0644\\u0645\\