                'description' => '{"en":"Semi-Supervised Learning is a machine learning paradigm where the model is trained on a combination of labeled and unlabeled data. The labeled data provides some supervision to guide the learning process, while the unlabeled data allows the model to generalize better by capturing underlying patterns in the data distribution.","hi":"\\u0905\\u0930\\u094d\\u0927-\\u092a\\u0930\\u094d\\u092f\\u0935\\u0947\\u0915\\u094d\\u0937\\u093f\\u0924 \\u0905\\u0927\\u093f\\u0917\\u092e \\u090f\\u0915 \\u092e\\u0936\\u0940\\u0928 \\u0905\\u0927\\u093f\\u0917\\u092e \\u0928\\u0948\\u0924\\u093f\\u0915\\u0924\\u093e \\u0939\\u0948 \\u091c\\u0939\\u093e\\u0902 \\u092e\\u0949\\u0921\\u0932 \\u0915\\u094b \\u0932\\u0947\\u092c\\u0932 \\u0914\\u0930 \\u0905\\u0928\\u0932\\u0947\\u092c\\u0932\\u094d\\u0921 \\u0921\\u0947\\u091f\\u093e \\u0915\\u093e \\u0938\\u0902\\u092f\\u094b\\u091c\\u0928 \\u092a\\u0930 \\u092a\\u094d\\u0930\\u0936\\u093f\\u0915\\u094d\\u0937\\u093f\\u0924 \\u0915\\u093f\\u092f\\u093e \\u091c\\u093e\\u0924\\u093e \\u0939\\u0948\\u0964 \\u0932\\u0947\\u092c\\u0932 \\u0921\\u0947\\u091f\\u093e \\u0938\\u0940\\u0916\\u0928\\u0947 \\u0915\\u0940 \\u092a\\u094d\\u0930\\u0915\\u094d\\u0930\\u093f\\u092f\\u093e \\u0915\\u094b \\u0928\\u093f\\u0930\\u094d\\u0926\\u0947\\u0936\\u093f\\u0924 \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0915\\u0941\\u091b \\u092a\\u0930\\u094d\\u092f\\u0935\\u0947\\u0915\\u094d\\u0937\\u0923 \\u092a\\u094d\\u0930\\u0926\\u093e\\u0928 \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948, \\u091c\\u092c\\u0915\\u093f \\u0905\\u0928\\u0932\\u0947\\u092c\\u0932\\u094d\\u0921 \\u0921\\u0947\\u091f\\u093e \\u092e\\u0949\\u0921\\u0932 \\u0915\\u094b \\u0921\\u0947\\u091f\\u093e \\u0935\\u093f\\u0924\\u0930\\u0923 \\u092e\\u0947\\u0902 \\u0926\\u0930\\u0905\\u0938\\u0932 \\u091b\\u093f\\u092a\\u0940 \\u0939\\u0941\\u0908 \\u092a\\u0948\\u091f\\u0930\\u094d\\u0928 \\u0915\\u094b \\u0915\\u0948\\u092