                'description' => '{"en":"Reinforcement Learning is a machine learning paradigm where an agent learns to make decisions by interacting with an environment. The agent receives feedback in the form of rewards or penalties based on its actions, and its goal is to maximize the cumulative reward over time by learning optimal strategies.","hi":"\\u092a\\u0941\\u0928\\u0930\\u094d\\u0928\\u093f\\u0930\\u094d\\u0927\\u093e\\u0930\\u0923 \\u0905\\u0927\\u093f\\u0917\\u092e \\u090f\\u0915 \\u092e\\u0936\\u0940\\u0928 \\u0905\\u0927\\u093f\\u0917\\u092e \\u0928\\u0948\\u0924\\u093f\\u0915\\u0924\\u093e \\u0939\\u0948 \\u091c\\u0939\\u093e\\u0902 \\u090f\\u0915 \\u090f\\u091c\\u0947\\u0902\\u091f \\u092a\\u0930\\u094d\\u092f\\u093e\\u0935\\u0930\\u0923 \\u0915\\u0947 \\u0938\\u093e\\u0925 \\u092c\\u093e\\u0924\\u091a\\u0940\\u0924 \\u0915\\u0930\\u0915\\u0947 \\u0928\\u093f\\u0930\\u094d\\u0923\\u092f \\u0932\\u0947\\u0928\\u093e \\u0938\\u0940\\u0916\\u0924\\u093e \\u0939\\u0948\\u0964 \\u090f\\u091c\\u0947\\u0902\\u091f \\u0905\\u092a\\u0928\\u0947 \\u0915\\u094d\\u0930\\u093f\\u092f\\u093e\\u0913\\u0902 \\u0915\\u0947 \\u0906\\u0927\\u093e\\u0930 \\u092a\\u0930 \\u092a\\u0941\\u0930\\u0938\\u094d\\u0915\\u093e\\u0930 \\u092f\\u093e \\u091c\\u0941\\u0930\\u094d\\u092e\\u093e\\u0928\\u093e \\u0915\\u0947 \\u0930\\u0942\\u092a \\u092e\\u0947\\u0902 \\u092a\\u094d\\u0930\\u0924\\u093f\\u092a\\u0941\\u0937\\u094d\\u091f\\u093f \\u092a\\u094d\\u0930\\u093e\\u092a\\u094d\\u0924 \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948, \\u0914\\u0930 \\u0907\\u0938\\u0915\\u093e \\u0909\\u0926\\u094d\\u0926\\u0947\\u0936\\u094d\\u092f \\u0938\\u092e\\u092f \\u0915\\u0947 \\u0938\\u093e\\u0925 \\u0938\\u092e\\u092f \\u0915\\u093e \\u092f\\u094b\\u0917 \\u0938\\u0902\\u091a\\u093f\\u0924 \\u092a\\u0941\\u0930\\u0938\\u094d\\u0915\\u093e\\u0930 \\u0915\\u094b \\u0905\\u0927\\u093f\\u0915\\u0924\\u092e \\u0915\\u0930\\u0928\\u093e \\u0939\\u094b\\u0924\\u093e \\u0939\\u0948 \\u0905\\u