            'description' => '{"en":"Deep Learning is a subfield of machine learning that uses artificial neural networks with many layers (hence \\"deep\\") to learn representations of data. It has shown remarkable success in various tasks such as image recognition, speech recognition, natural language processing, and many others.","hi":"\\u0917\\u0939\\u0930\\u093e \\u0905\\u0927\\u093f\\u0917\\u092e \\u092e\\u0936\\u0940\\u0928 \\u0905\\u0927\\u093f\\u0917\\u092e \\u0915\\u0940 \\u090f\\u0915 \\u0909\\u092a\\u0936\\u093e\\u0916\\u093e \\u0939\\u0948 \\u091c\\u094b \\u0921\\u0947\\u091f\\u093e \\u0915\\u0947 \\u092a\\u094d\\u0930\\u0924\\u093f\\u0928\\u093f\\u0927\\u093f\\u0924\\u094d\\u0935 \\u0938\\u0940\\u0916\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u092c\\u0939\\u0941\\u0924 \\u0938\\u0902\\u0916\\u094d\\u092f\\u093e \\u092e\\u0947\\u0902 \\u092a\\u0930\\u094d\\u092f\\u093e\\u0935\\u0943\\u0924\\u094d\\u0924\\u093f\\u092f\\u094b\\u0902 (\\u0907\\u0938\\u0932\\u093f\\u090f \\"\\u0917\\u0939\\u0930\\u093e\\") \\u0915\\u0947 \\u0938\\u093e\\u0925 \\u0915\\u0943\\u0924\\u094d\\u0930\\u093f\\u092e \\u0938\\u094d\\u0928\\u093e\\u092f\\u0941 \\u0928\\u0947\\u091f\\u0935\\u0930\\u094d\\u0915 \\u0915\\u093e \\u0909\\u092a\\u092f\\u094b\\u0917 \\u0915\\u0930\\u0924\\u0940 \\u0939\\u0948\\u0964 \\u092f\\u0939 \\u091b\\u0935\\u093f \\u092a\\u0939\\u091a\\u093e\\u0928, \\u092d\\u093e\\u0937\\u093e \\u092a\\u0939\\u091a\\u093e\\u0928, \\u092a\\u094d\\u0930\\u093e\\u0915\\u0943\\u0924\\u093f\\u0915 \\u092d\\u093e\\u0937\\u093e \\u092a\\u094d\\u0930\\u0938\\u0902\\u0938\\u094d\\u0915\\u0930\\u0923 \\u0914\\u0930 \\u0905\\u0928\\u094d\\u092f \\u0915\\u0908 \\u0915\\u093e\\u0930\\u094d\\u092f\\u094b\\u0902 \\u092e\\u0947\\u0902 \\u0909\\u0924\\u094d\\u0915\\u0943\\u0937\\u094d\\u091f \\u0938\\u092b\\u0932\\u0924\\u093e \\u092a\\u094d\\u0930\\u093e\\u092a\\u094d\\u0924 \\u0915\\u093f\\u092f\\u093e \\u0939\\u0948\\u0964","ar":"\\u0627\\u0644\\u062a\\u0639\\u0644\\u06