                'description' => '{"en":"Jurisprudence is the theoretical study of law, including the principles, origins, and interpretation of legal systems. It explores the philosophical and sociological aspects of law, as well as the nature of justice, rights, and obligations.","hi":"\\u0935\\u093f\\u0927\\u093f\\u0936\\u093e\\u0938\\u094d\\u0924\\u094d\\u0930 \\u0915\\u093e\\u0928\\u0942\\u0928 \\u0915\\u0940 \\u0938\\u093f\\u0926\\u094d\\u0927\\u093e\\u0902\\u0924\\u093f\\u0915 \\u0905\\u0927\\u094d\\u092f\\u092f\\u0928 \\u0939\\u0948, \\u091c\\u093f\\u0938\\u092e\\u0947\\u0902 \\u0915\\u093e\\u0928\\u0942\\u0928\\u0940 \\u092a\\u094d\\u0930\\u0923\\u093e\\u0932\\u093f\\u092f\\u094b\\u0902 \\u0915\\u0947 \\u0938\\u093f\\u0926\\u094d\\u0927\\u093e\\u0902\\u0924\\u094b\\u0902, \\u0909\\u0924\\u094d\\u092a\\u0924\\u094d\\u0924\\u093f\\u092f\\u094b\\u0902, \\u0914\\u0930 \\u0935\\u094d\\u092f\\u093e\\u0916\\u094d\\u092f\\u093e\\u0913\\u0902 \\u0915\\u093e \\u0905\\u0927\\u094d\\u092f\\u092f\\u0928 \\u0939\\u094b\\u0924\\u093e \\u0939\\u0948\\u0964 \\u0907\\u0938\\u092e\\u0947\\u0902 \\u0915\\u093e\\u0928\\u0942\\u0928 \\u0915\\u0947 \\u0926\\u093e\\u0930\\u094d\\u0936\\u0928\\u093f\\u0915 \\u0914\\u0930 \\u0938\\u093e\\u092e\\u093e\\u091c\\u093f\\u0915 \\u092a\\u0939\\u0932\\u0941\\u0913\\u0902 \\u0915\\u093e \\u0905\\u0928\\u094d\\u0935\\u0947\\u0937\\u0923 \\u0915\\u093f\\u092f\\u093e \\u091c\\u093e\\u0924\\u093e \\u0939\\u0948, \\u0938\\u093e\\u0925 \\u0939\\u0940 \\u0928\\u094d\\u092f\\u093e\\u092f, \\u0905\\u0927\\u093f\\u0915\\u093e\\u0930 \\u0914\\u0930 \\u0915\\u0930\\u094d\\u0924\\u0935\\u094d\\u092f\\u094b\\u0902 \\u0915\\u0940 \\u092a\\u094d\\u0930\\u0915\\u0943\\u0924\\u093f\\u0964","ar":"\\u0639\\u0644\\u0645 \\u0627\\u0644\\u0642\\u0627\\u0646\\u0648\\u0646 \\u0647\\u0648 \\u0627\\u0644\\u062f\\u0631\\u0627\\u0633\\u0629 \\u0627\\u0644\\u0646\\u0638\\u0631\\u064a\\u0629 \\u0644\\u0644\\u0642\\u0627\\u0646\\u0648\\u0646\\u060c \\u0628\\u0645\\u0627 \\