                'description' => '{"en":"Constitutional Law is the branch of law that deals with the interpretation and implementation of a country\'s constitution. It defines the powers and duties of government institutions, outlines fundamental rights and freedoms of citizens, and establishes the framework for the operation of the state.","hi":"\\u0938\\u0902\\u0935\\u0948\\u0927\\u093e\\u0928\\u093f\\u0915 \\u0935\\u093f\\u0927\\u093f \\u0935\\u0939 \\u0935\\u093f\\u0927\\u093f \\u0915\\u0940 \\u0936\\u093e\\u0916\\u093e \\u0939\\u0948 \\u091c\\u094b \\u0915\\u093f\\u0938\\u0940 \\u0926\\u0947\\u0936 \\u0915\\u0947 \\u0938\\u0902\\u0935\\u093f\\u0927\\u093e\\u0928 \\u0915\\u0947 \\u0935\\u094d\\u092f\\u093e\\u0916\\u094d\\u092f\\u093e\\u0928 \\u0914\\u0930 \\u0915\\u093e\\u0930\\u094d\\u092f\\u093e\\u0928\\u094d\\u0935\\u092f\\u0928 \\u0938\\u0947 \\u0938\\u0902\\u092c\\u0902\\u0927\\u093f\\u0924 \\u0939\\u0948\\u0964 \\u092f\\u0939 \\u0938\\u0930\\u0915\\u093e\\u0930\\u0940 \\u0938\\u0902\\u0938\\u094d\\u0925\\u093e\\u0913\\u0902 \\u0915\\u0947 \\u0936\\u0915\\u094d\\u0924\\u093f\\u092f\\u094b\\u0902 \\u0914\\u0930 \\u0915\\u0930\\u094d\\u0924\\u0935\\u094d\\u092f\\u094b\\u0902 \\u0915\\u094b \\u092a\\u0930\\u093f\\u092d\\u093e\\u0937\\u093f\\u0924 \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948, \\u0928\\u093e\\u0917\\u0930\\u093f\\u0915\\u094b\\u0902 \\u0915\\u0947 \\u092e\\u094c\\u0932\\u093f\\u0915 \\u0905\\u0927\\u093f\\u0915\\u093e\\u0930 \\u0914\\u0930 \\u0938\\u094d\\u0935\\u0924\\u0902\\u0924\\u094d\\u0930\\u0924\\u093e\\u0913\\u0902 \\u0915\\u094b \\u0930\\u0942\\u092a\\u093e\\u0902\\u0924\\u0930\\u093f\\u0924 \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948, \\u0914\\u0930 \\u0930\\u093e\\u091c\\u094d\\u092f \\u0915\\u0947 \\u0938\\u0902\\u091a\\u093e\\u0932\\u0928 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0922\\u093e\\u0902\\u091a\\u093e \\u0938\\u094d\\u0925\\u093e\\u092a\\u093f\\u0924 \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948\\u0964","ar":"\\u0627\\u0644\\u