                'description' => '{"en":"Criminal Law is the branch of law that deals with crimes and punishments. It defines offenses and prescribes the punishment for those who commit them. Criminal law also encompasses procedures for investigation, arrest, trial, and sentencing of individuals accused of committing crimes.","hi":"\\u0905\\u092a\\u0930\\u093e\\u0927\\u093f\\u0915 \\u0935\\u093f\\u0927\\u093f \\u0935\\u0939 \\u0935\\u093f\\u0927\\u093f \\u0915\\u0940 \\u0936\\u093e\\u0916\\u093e \\u0939\\u0948 \\u091c\\u094b \\u0905\\u092a\\u0930\\u093e\\u0927\\u094b\\u0902 \\u0914\\u0930 \\u0938\\u091c\\u093e \\u0915\\u0947 \\u0938\\u093e\\u0925 \\u0938\\u0902\\u092c\\u0902\\u0927\\u093f\\u0924 \\u0939\\u0948\\u0964 \\u092f\\u0939 \\u0905\\u092a\\u0930\\u093e\\u0927\\u094b\\u0902 \\u0915\\u094b \\u092a\\u0930\\u093f\\u092d\\u093e\\u0937\\u093f\\u0924 \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948 \\u0914\\u0930 \\u0909\\u0928\\u094d\\u0939\\u0947\\u0902 \\u0915\\u0930\\u0928\\u0947 \\u0935\\u093e\\u0932\\u094b\\u0902 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0926\\u0902\\u0921 \\u0915\\u093e \\u0928\\u093f\\u0930\\u094d\\u0927\\u093e\\u0930\\u0923 \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948\\u0964 \\u0905\\u092a\\u0930\\u093e\\u0927\\u093f\\u0915 \\u0935\\u093f\\u0927\\u093f \\u092e\\u0947\\u0902 \\u0906\\u0930\\u094b\\u092a\\u0940 \\u0935\\u094d\\u092f\\u0915\\u094d\\u0924\\u093f\\u092f\\u094b\\u0902 \\u0915\\u0947 \\u091c\\u093e\\u0902\\u091a, \\u0917\\u093f\\u0930\\u092b\\u094d\\u0924\\u093e\\u0930\\u0940, \\u0905\\u0926\\u093e\\u0932\\u0924\\u0940 \\u092a\\u094d\\u0930\\u0915\\u094d\\u0930\\u093f\\u092f\\u093e, \\u0914\\u0930 \\u0938\\u091c\\u093e \\u0915\\u093e \\u092d\\u0940 \\u0906\\u0935\\u0930\\u094d\\u091c\\u0928 \\u0939\\u094b\\u0924\\u093e \\u0939\\u0948\\u0964","ar":"\\u0627\\u0644\\u0642\\u0627\\u0646\\u0648\\u0646 \\u0627\\u0644\\u062c\\u0646\\u0627\\u0626\\u064a \\u0647\\u0648 \\u0641\\u0631\\u0639 \\u0645\\u0646 \\u0627\\u0644\\u0642\\u0627\\u0646\\u064