            'description' => '{"en":"Civil Law is the branch of law that deals with disputes between individuals or organizations, typically regarding issues such as contracts, property, family matters, and torts (civil wrongs). It encompasses legal principles and procedures for resolving conflicts and enforcing rights through civil litigation.","hi":"\\u0928\\u093e\\u0917\\u0930\\u093f\\u0915 \\u0935\\u093f\\u0927\\u093f \\u0935\\u0939 \\u0935\\u093f\\u0927\\u093f \\u0915\\u0940 \\u0936\\u093e\\u0916\\u093e \\u0939\\u0948 \\u091c\\u094b \\u0935\\u094d\\u092f\\u0915\\u094d\\u0924\\u093f\\u092f\\u094b\\u0902 \\u092f\\u093e \\u0938\\u0902\\u0917\\u0920\\u0928\\u094b\\u0902 \\u0915\\u0947 \\u092c\\u0940\\u091a \\u0935\\u093f\\u0935\\u093e\\u0926\\u094b\\u0902 \\u0915\\u094b \\u0928\\u093f\\u092f\\u0902\\u0924\\u094d\\u0930\\u093f\\u0924 \\u0915\\u0930\\u0924\\u0940 \\u0939\\u0948, \\u0906\\u092e\\u0924\\u094c\\u0930 \\u092a\\u0930 \\u0938\\u092e\\u091d\\u094c\\u0924\\u094b\\u0902, \\u0938\\u0902\\u092a\\u0924\\u094d\\u0924\\u093f, \\u092a\\u0930\\u093f\\u0935\\u093e\\u0930 \\u092e\\u093e\\u092e\\u0932\\u094b\\u0902, \\u0914\\u0930 \\u091f\\u0949\\u0930\\u094d\\u091f\\u094d\\u0938 (\\u0928\\u093e\\u0917\\u0930\\u093f\\u0915 \\u0905\\u092a\\u0930\\u093e\\u0927\\u094b\\u0902) \\u091c\\u0948\\u0938\\u0947 \\u092e\\u0941\\u0926\\u094d\\u0926\\u094b\\u0902 \\u0915\\u0947 \\u0938\\u0902\\u092c\\u0902\\u0927 \\u092e\\u0947\\u0902\\u0964 \\u092f\\u0939 \\u0935\\u093f\\u0935\\u093e\\u0926\\u094b\\u0902 \\u0915\\u094b \\u0939\\u0932 \\u0915\\u0930\\u0928\\u0947 \\u0914\\u0930 \\u0928\\u093e\\u0917\\u0930\\u093f\\u0915 \\u092e\\u0941\\u0926\\u094d\\u0926\\u094b\\u0902 \\u0915\\u0947 \\u092e\\u093e\\u0927\\u094d\\u092f\\u092e \\u0938\\u0947 \\u0905\\u0927\\u093f\\u0915\\u093e\\u0930\\u094b\\u0902 \\u0915\\u094b \\u092a\\u094d\\u0930\\u0935\\u0930\\u094d\\u0924\\u0928 \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0915\\u093e\\u0928\\u0942\\u0928\\u0940 \\u0938