                'name' => '{"en":"International Law","hi":"\\u0905\\u0902\\u0924\\u0930\\u0930\\u093e\\u0937\\u094d\\u091f\\u094d\\u0930\\u0940\\u092f \\u0935\\u093f\\u0927\\u093f","ar":"\\u0627\\u0644\\u0642\\u0627\\u0646\\u0648\\u0646 \\u0627\\u0644\\u062f\\u0648\\u0644\\u064a"}',
                'description' => '{"en":"International Law is the set of rules and principles that govern relations between states and other international actors, such as international organizations and individuals. It regulates issues such as diplomacy, human rights, armed conflict, trade, and environmental protection on the global stage.","hi":"\\u0905\\u0902\\u0924\\u0930\\u0930\\u093e\\u0937\\u094d\\u091f\\u094d\\u0930\\u0940\\u092f \\u0935\\u093f\\u0927\\u093f \\u090f\\u0915 \\u0938\\u0947\\u091f \\u0915\\u0947 \\u0928\\u093f\\u092f\\u092e \\u0914\\u0930 \\u0938\\u093f\\u0926\\u094d\\u0927\\u093e\\u0902\\u0924\\u094b\\u0902 \\u0939\\u0948 \\u091c\\u094b \\u0930\\u093e\\u091c\\u094d\\u092f\\u094b\\u0902 \\u0914\\u0930 \\u0905\\u0928\\u094d\\u092f \\u0905\\u0902\\u0924\\u0930\\u0930\\u093e\\u0937\\u094d\\u091f\\u094d\\u0930\\u0940\\u092f \\u0915\\u093e\\u0930\\u094d\\u092f\\u0915\\u0930\\u094d\\u0924\\u093e\\u0913\\u0902 \\u0915\\u0947 \\u092c\\u0940\\u091a \\u0938\\u0902\\u092c\\u0902\\u0927\\u094b\\u0902 \\u0915\\u094b \\u0928\\u093f\\u092f\\u0902\\u0924\\u094d\\u0930\\u093f\\u0924 \\u0915\\u0930\\u0924\\u0947 \\u0939\\u0948\\u0902, \\u091c\\u0948\\u0938\\u0947 \\u0915\\u093f \\u0905\\u0902\\u0924\\u0930\\u0930\\u093e\\u0937\\u094d\\u091f\\u094d\\u0930\\u0940\\u092f \\u0938\\u0902\\u0917\\u0920\\u0928\\u094b\\u0902 \\u0914\\u0930 \\u0935\\u094d\\u092f\\u0915\\u094d\\u0924\\u093f\\u092f\\u094b\\u0902\\u0964 \\u092f\\u0939 \\u0935\\u093f\\u0936\\u094d\\u0935 \\u0938\\u094d\\u0924\\u0930 \\u092a\\u0930 \\u0921\\u093f\\u092a\\u094d\\u0932\\u094b\\u092e\\u0947\\u0938\\u0940, \\u092e\\u093e\\u0928\\u0935 \\u0905\\u0927\\u093f\\u0915\\u093e\\u0930, \\u0938\\u0936\\u0938\\u094d\\u0924\\u094d\\u0930 \\u0938\\u0902\\u0918\\u0930\\u094d\\u0937, \\u0935\\u094d\\u092f\\u093e\\u092a\\u093e\\u0930, \\u0914\\u0930 \\u092a\\u0930\\u094d\\u092f\\u093e\\u0935\\u0930\\u0923 \\u0938\\u0902\\u0930\\u0915\\u094d\\u0937\\u0923 \\u091c\\u0948\\u0938\\u0947 \\u092e\\u0941\\u0926\\u094d\