                'name' => '{"en":"Drawing","hi":"\\u091a\\u093f\\u0924\\u094d\\u0930\\u0915\\u0932\\u093e","ar":"\\u0627\\u0644\\u0631\\u0633\\u0645"}',
                'description' => '{"en":"Drawing is the art or technique of producing images on a surface, usually paper, using various tools such as pencils, pens, markers, or digital software. It involves creating lines, shapes, and tones to represent objects, scenes, or ideas.","hi":"\\u091a\\u093f\\u0924\\u094d\\u0930\\u0915\\u0932\\u093e \\u090f\\u0915 \\u0915\\u0932\\u093e \\u092f\\u093e \\u0924\\u0915\\u0928\\u0940\\u0915 \\u0939\\u0948 \\u091c\\u094b \\u0938\\u0924\\u0939 \\u092a\\u0930 \\u091b\\u0935\\u093f\\u092f\\u093e\\u0901 \\u0909\\u0924\\u094d\\u092a\\u0928\\u094d\\u0928 \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0915\\u093f\\u092f\\u093e \\u091c\\u093e\\u0924\\u093e \\u0939\\u0948, \\u0906\\u092e\\u0924\\u094c\\u0930 \\u092a\\u0930 \\u0915\\u093e\\u0917\\u091c\\u093c \\u0915\\u093e \\u0907\\u0938\\u094d\\u0924\\u0947\\u092e\\u093e\\u0932 \\u0915\\u0930\\u0915\\u0947, \\u092a\\u0947\\u0902\\u0938\\u093f\\u0932, \\u092a\\u0947\\u0928, \\u092e\\u093e\\u0930\\u094d\\u0915\\u0930\\u094d\\u0938, \\u092f\\u093e \\u0921\\u093f\\u091c\\u093f\\u091f\\u0932 \\u0938\\u0949\\u092b\\u093c\\u094d\\u091f\\u0935\\u0947\\u092f\\u0930 \\u091c\\u0948\\u0938\\u0947 \\u0935\\u093f\\u092d\\u093f\\u0928\\u094d\\u0928 \\u0909\\u092a\\u0915\\u0930\\u0923\\u094b\\u0902 \\u0915\\u093e \\u0909\\u092a\\u092f\\u094b\\u0917 \\u0915\\u0930\\u0915\\u0947\\u0964 \\u092f\\u0939 \\u0935\\u0938\\u094d\\u0924\\u0941\\u0913\\u0902, \\u0938\\u0940\\u0928\\u094b\\u0902, \\u092f\\u093e \\u0935\\u093f\\u091a\\u093e\\u0930\\u094b\\u0902 \\u0915\\u093e \\u092a\\u094d\\u0930\\u0924\\u093f\\u0928\\u093f\\u0927\\u093f\\u0924\\u094d\\u0935 \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0930\\u0947\\u0916\\u093e\\u090f\\u0901, \\u0906\\u0915\\u0943\\u0924\\u093f\\u092f\\u093e\\u0901, \\u0914\\u0930 \\u091f\\u094b\\u0928 \\u092c\\u0928\\u093e\\u0928\\u0947 \\u092e\\u0947\\u0902 \\u0936\\u093e\\u092e\\u093f\\u0932 \\u0939\\u0948\\u0964","ar":"\\u0627\\u06