            array (
                'id' => 87,
                'name' => '{"en":"Painting","hi":"\\u091a\\u093f\\u0924\\u094d\\u0930\\u0915\\u0932\\u093e","ar":"\\u0627\\u0644\\u0631\\u0633\\u0645"}',
                'description' => '{"en":"Painting is the art or practice of applying pigments, colors, or other mediums to a surface, typically canvas, paper, wood, or walls, using brushes, knives, sponges, or fingers. It involves creating visual representations of subjects, scenes, or emotions through various techniques and styles.","hi":"\\u091a\\u093f\\u0924\\u094d\\u0930\\u0915\\u0932\\u093e \\u090f\\u0915 \\u0915\\u0932\\u093e \\u092f\\u093e \\u0905\\u092d\\u094d\\u092f\\u093e\\u0938 \\u0939\\u0948 \\u091c\\u093f\\u0938\\u092e\\u0947\\u0902 \\u0930\\u0902\\u0917, \\u0930\\u0902\\u0917, \\u092f\\u093e \\u0905\\u0928\\u094d\\u092f \\u092e\\u093e\\u0927\\u094d\\u092f\\u092e\\u094b\\u0902 \\u0915\\u094b \\u0938\\u0924\\u0939 \\u092a\\u0930 \\u0932\\u093e\\u0917\\u0942 \\u0915\\u093f\\u092f\\u093e \\u091c\\u093e\\u0924\\u093e \\u0939\\u0948, \\u0906\\u092e\\u0924\\u094c\\u0930 \\u092a\\u0930 \\u0915\\u0948\\u0928\\u0935\\u093e\\u0938, \\u0915\\u093e\\u0917\\u091c\\u093c, \\u0932\\u0915\\u0921\\u093c\\u0940, \\u092f\\u093e \\u0926\\u0940\\u0935\\u093e\\u0930\\u094b\\u0902 \\u0915\\u093e \\u0907\\u0938\\u094d\\u0924\\u0947\\u092e\\u093e\\u0932 \\u0915\\u0930\\u0915\\u0947, \\u092c\\u094d\\u0930\\u0936, \\u091a\\u093e\\u0915\\u0942, \\u0938\\u094d\\u092a\\u0902\\u091c, \\u092f\\u093e \\u0909\\u0902\\u0917\\u0932\\u093f\\u092f\\u094b\\u0902 \\u0915\\u093e \\u0907\\u0938\\u094d\\u0924\\u0947\\u092e\\u093e\\u0932 \\u0915\\u0930\\u0915\\u0947\\u0964 \\u092f\\u0939 \\u0935\\u093f\\u092d\\u093f\\u0928\\u094d\\u0928 \\u0924\\u0915\\u0928\\u0940\\u0915\\u094b\\u0902 \\u0914\\u0930 \\u0936\\u0948\\u0932\\u093f\\u092f\\u094b\\u0902 \\u0915\\u0947 \\u092e\\u093e\\u0927\\u094d\\u092f\\u092e \\u0938\\u0947 \\u0935\\u093f\\u0937\\u092f\\u094b\\u0902, \\u0926\\u0943\\u0936\\u094d\\u092f\\u094b\\u0902, \\u092f\\u093e \\u092d\\u093e\\u0935\\u0928\\u093e\\u0913\\u0902 \\u0915\\u0947 \\u0926\\u0943\\u0936\\u094d\\u092f\\u093f\\u0915 \\u092a\\u094d\\u0930\\u0924\\u093f\\u0928\\u093f\\u092