            87 => 
            array (
                'id' => 88,
                'name' => '{"en":"Sculpture","hi":"\\u092e\\u0942\\u0930\\u094d\\u0924\\u093f\\u0915\\u0932\\u093e","ar":"\\u0627\\u0644\\u0646\\u062d\\u062a"}',
                'description' => '{"en":"Sculpture is the art of creating three-dimensional forms by carving, modeling, casting, or assembling materials such as clay, stone, metal, wood, or plastic. It involves shaping and manipulating materials to represent objects, figures, or abstract concepts in space.","hi":"\\u092e\\u0942\\u0930\\u094d\\u0924\\u093f\\u0915\\u0932\\u093e \\u0909\\u0928\\u094d\\u0928\\u0924\\u093f \\u0915\\u0940 \\u0915\\u0932\\u093e \\u0939\\u0948 \\u091c\\u093f\\u0938\\u092e\\u0947\\u0902 \\u0924\\u0940\\u0928-\\u0906\\u092f\\u093e\\u092e\\u0940 \\u0930\\u0942\\u092a\\u094b\\u0902 \\u0915\\u094b \\u092c\\u0928\\u093e\\u0928\\u0947 \\u0915\\u0940 \\u0915\\u0932\\u093e \\u0939\\u094b\\u0924\\u0940 \\u0939\\u0948, \\u092a\\u0924\\u094d\\u0925\\u0930, \\u092e\\u093f\\u091f\\u094d\\u091f\\u0940, \\u0927\\u093e\\u0924\\u0941, \\u0932\\u0915\\u0921\\u093c\\u0940, \\u092f\\u093e \\u092a\\u094d\\u0932\\u093e\\u0938\\u094d\\u091f\\u093f\\u0915 \\u091c\\u0948\\u0938\\u0947 \\u0938\\u093e\\u092e\\u0917\\u094d\\u0930\\u093f\\u092f\\u094b\\u0902 \\u0915\\u094b \\u0916\\u094b\\u0926\\u0915\\u0930, \\u0906\\u0915\\u093e\\u0930 \\u0926\\u0947\\u0915\\u0930, \\u092a\\u094d\\u0930\\u0924\\u093f\\u092e\\u093e \\u0915\\u0930\\u0915\\u0947, \\u092f\\u093e \\u091c\\u094b\\u0921\\u093c\\u0915\\u0930\\u0964 \\u092f\\u0939 \\u0905\\u0935\\u0938\\u094d\\u0925\\u093e \\u092e\\u0947\\u0902 \\u0935\\u0938\\u094d\\u0924\\u0941\\u0913\\u0902, \\u092a\\u094d\\u0930\\u0924\\u093f\\u092e\\u093e\\u0913\\u0902, \\u092f\\u093e \\u0905\\u092e\\u0942\\u0930\\u094d\\u0924 \\u0935\\u093f\\u091a\\u093e\\u0930\\u094b\\u0902 \\u0915\\u093e \\u092a\\u094d\\u0930\\u0924\\u093f\\u0928\\u093f\\u0927\\u093f\\u0924\\u094d\\u0935 \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0938\\u093e\\u092e\\u0917\\u094d\\u0930\\u093f\\u092f\\u094b\\u0902 \\u0915\\u094b \\u0906\\u0915\\u093e\\u0930\\u093f\\u0924 \\u0915\\u0930\\u0928\\u0947 \\u0914\\u0930 \\u0928\\u093f\\u092f\\u0902\\u0924\\u094d\\u0930\\u093f\\u0924 \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0940 \\u0915\\u0932\\u093e \\u0939\\u0948\\u0964","ar":"\\u0627\\u0644\\u0646\\u062d\\u062a \\u0647\\u0648 \\u0641\\u0646 \\u062e\\u0644\\u0642 \\u0627\\u0644\\u0623\\u0634\\u0643\\u0627\\u0644 \\u062b\\u0644\\u0627\\u062b\\u064a\\u0629 \\u0627\\u0644\\u0623\\u0628\\u0639\\u0627\\u062f \\u0639\\u0646 \\u0637\\u0631\\u064a\\u0642 \\u0627\\u0644\\u0646\\u062d\\u062a \\u0623\\u0648 \\u0627\\u0644\\u0646\\u0645\\u0630\\u062c\\u0629 \\u0623\\u0648 \\u0627\\u0644\\u0635\\u0628 \\u0623\\u0648 \\u062a\\u062c\\u0645\\u064a\\u0639 \\u0627\\u0644\\u0645\\u0648\\u0627\\u062f \\u0645\\u062b\\u0644 \\u0627\\u0644\\u0637\\u064a\\u0646\\u060c \\u0648\\u0627\\u0644\\u062d\\u062c\\u0631\\u060c \\u0648\\u0627\\u0644\\u0645\\u0639\\u062f\\u0646\\u060c \\u0648\\u0627\\u0644\\u062e\\u0634\\u0628\\u060c \\u0623\\u0648 \\u0627\\u0644\\u0628\\u0644\\u0627\\u0633\\u062a\\u064a\\u0643. \\u064a\\u062a\\u0636\\u0645\\u0646 \\u062a\\u0634\\u0643\\u064a\\u0644 \\u0648\\u062a\\u0644\\u0627\\u0639\\u0628 \\u0627\\u0644\\u0645\\u0648\\u0627\\u062f \\u0644\\u062a\\u0645\\u062b\\u064a\\u0644 \\u0627\\u0644\\u0623\\u0634\\u064a\\u0627\\u0621 \\u0623\\u0648 \\u0627\\u0644\\u0623\\u0634\\u0643\\u0627\\u0644 \\u0623\\u0648 \\u0627\\u0644\\u0645\\u0641\\u0627\\u0647\\u064a\\u0645 \\u0627\\u0644\\u0645\\u062c\\u0631\\u062f\\u0629 \\u0641\\u064a \\u0627\\u0644\\u0641\\u0636\\u0627\\u0621"}',
