            88 => 
            array (
                'id' => 89,
                'name' => '{"en":"Printmaking","hi":"\\u092a\\u094d\\u0930\\u093f\\u0902\\u091f\\u092e\\u0947\\u0915\\u093f\\u0902\\u0917","ar":"\\u0641\\u0646 \\u0627\\u0644\\u0637\\u0628\\u0627\\u0639\\u0629"}',
                'description' => '{"en":"Printmaking is the artistic process of creating images or designs by transferring ink onto a surface, typically paper, fabric, or other materials, using various techniques such as relief printing, intaglio, lithography, or screen printing. It involves creating multiple copies of an original artwork, often resulting in unique and expressive pieces.","hi":"\\u092a\\u094d\\u0930\\u093f\\u0902\\u091f\\u092e\\u0947\\u0915\\u093f\\u0902\\u0917 \\u090f\\u0915 \\u0915\\u0932\\u093e\\u0924\\u094d\\u092e\\u0915 \\u092a\\u094d\\u0930\\u0915\\u094d\\u0930\\u093f\\u092f\\u093e \\u0939\\u0948 \\u091c\\u093f\\u0938\\u092e\\u0947\\u0902 \\u091a\\u093f\\u0924\\u094d\\u0930\\u094b\\u0902 \\u092f\\u093e \\u0921\\u093f\\u091c\\u093c\\u093e\\u0907\\u0928\\u094b\\u0902 \\u0915\\u094b \\u0938\\u0924\\u0939 \\u092a\\u0930 \\u0907\\u0902\\u0915 \\u0915\\u094b \\u0938\\u094d\\u0925\\u093e\\u0928\\u093e\\u0902\\u0924\\u0930\\u093f\\u0924 \\u0915\\u0930\\u0915\\u0947 \\u092c\\u0928\\u093e\\u092f\\u093e \\u091c\\u093e\\u0924\\u093e \\u0939\\u0948, \\u0906\\u092e\\u0924\\u094c\\u0930 \\u092a\\u0930 \\u0915\\u093e\\u0917\\u091c\\u093c, \\u0915\\u092a\\u0921\\u093c\\u093e, \\u092f\\u093e \\u0905\\u0928\\u094d\\u092f \\u0938\\u093e\\u092e\\u0917\\u094d\\u0930\\u093f\\u092f\\u094b\\u0902 \\u0915\\u093e \\u0907\\u0938\\u094d\\u0924\\u0947\\u092e\\u093e\\u0932 \\u0915\\u0930\\u0915\\u0947, \\u0930\\u093f\\u0932\\u0940\\u092b \\u092a\\u094d\\u0930\\u093f\\u0902\\u091f\\u093f\\u0902\\u0917, \\u0907\\u0902\\u091f\\u093e\\u0917\\u094d\\u0932\\u093f\\u092f\\u094b, \\u0932\\u093f\\u0925\\u094b\\u0917\\u094d\\u0930\\u093e\\u092b\\u0940, \\u092f\\u093e \\u0938\\u094d\\u0915\\u094d\\u0930\\u0940\\u0928 \\u092a\\u094d\\u0930\\u093f\\u0902\\u091f\\u093f\\u0902\\u0917 \\u091c\\u0948\\u0938\\u0940 \\u0935\\u093f\\u092d\\u093f\\u0928\\u094d\\u0928 \\u0924\\u0915\\u0928\\u0940\\u0915\\u094b\\u0902 \\u0915\\u093e \\u0909\\u092a\\u092f\\u094b\\u0917 \\u0915\\u0930\\u0915\\u0947\\u0964 \\u0907\\u0938\\u092e\\u0947\\u0902 \\u092e\\u0942\\u0932 \\u0915\\u0932\\u093e \\u0915\\u0947 \\u090f\\u0915\\u093e\\u0927\\u093f\\u0915 \\u092a\\u094d\\u0930\\u0924\\u093f\\u092f\\u093e\\u0902 \\u092c\\u0928\\u093e\\u0928\\u093e \\u0936\\u093e\\u092e\\u093f\\u0932 \\u0939\\u094b\\u0924\\u093e \\u0939\\u0948, \\u091c\\u094b \\u0905\\u0915\\u094d\\u0938\\u0930 \\u0905\\u0928\\u0942\\u0920\\u0947 \\u0914\\u0930 \\u0905\\u092d\\u093f\\u0935\\u094d\\u092f\\u0915\\u094d\\u0924\\u093f\\u0936\\u0940\\u0932 \\u091f\\u0941\\u0915\\u0921\\u093c\\u0947 \\u0915\\u0947 \\u0930\\u0942\\u092a \\u092e\\u0947\\u0902 \\u092a\\u0930\\u093f\\u0923\\u093e\\u092e\\u093f\\u0924 \\u0939\\u094b\\u0924\\u0947 \\u0939\\u0948\\u0902\\u0964","ar":"\\u0641\\u0646 \\u0627\\u0644\\u0637\\u0628\\u0627\\u0639\\u0629 \\u0647\\u0648 \\u0627\\u0644\\u0639\\u0645\\u0644\\u064a\\u0629 \\u0627\\u0644\\u0641\\u0646\\u064a\\u0629 \\u0644\\u0625\\u0646\\u0634\\u0627\\u0621 \\u0627\\u0644\\u0635\\u0648\\u0631 \\u0623\\u0648 \\u0627\\u0644\\u062a\\u0635\\u0627\\u0645\\u064a\\u0645 \\u0639\\u0646 \\u0637\\u0631\\u064a\\u0642 \\u0646\\u0642\\u0644 \\u0627\\u0644\\u062d\\u0628\\u0631 \\u0639\\u0644\\u0649 \\u0633\\u0637\\u062d \\u0645\\u0639\\u064a\\u0646\\u060c \\u0639\\u0627\\u062f\\u0629\\u064b \\u0627\\u0644\\u0648\\u0631\\u0642 \\u0623\\u0648 \\u0627\\u0644\\u0642\\u0645\\u0627\\u0634 \\u0623\\u0648 \\u0645\\u0648\\u0627\\u062f \\u0623\\u062e\\u0631\\u0649\\u060c \\u0628\\u0627\\u0633\\u062a\\u062e\\u062f\\u0627\\u0645 \\u062a\\u0642\\u0646\\u064a\\u0627\\u062a \\u0645\\u062e\\u062a\\u0644\\u0641\\u0629 \\u0645\\u062b\\u0644 \\u0627\\u0644\\u0637\\u0628\\u0627\\u0639\\u0629 \\u0628\\u0627\\u0644\\u062a\\u0633\\u0644\\u064a\\u0641\\u060c \\u0627\\u0644\\u0625\\u0646\\u062a\\u0627\\u062c \\u0627\\u0644\\u062d\\u0641\\u0631\\u064a\\u060c \\u0627\\u0644\\u0637\\u0628\\u0627\\u0639\\u0629 \\u0627\\u0644\\u062d\\u062c\\u0631\\u064a\\u0629\\u060c \\u0623\\u0648 \\u0627\\u0644\\u0637\\u0628\\u0627\\u0639\\u