                'name' => '{"en":"Photography","hi":"\\u092b\\u094b\\u091f\\u094b\\u0917\\u094d\\u0930\\u093e\\u092b\\u093c\\u0940","ar":"\\u0627\\u0644\\u062a\\u0635\\u0648\\u064a\\u0631 \\u0627\\u0644\\u0641\\u0648\\u062a\\u0648\\u063a\\u0631\\u0627\\u0641\\u064a"}',
                'description' => '{"en":"Photography is the art, science, and practice of capturing light to create images using a camera. It involves controlling various elements such as exposure, composition, and focus to convey a message, tell a story, or evoke emotions through visual storytelling.","hi":"\\u092b\\u094b\\u091f\\u094b\\u0917\\u094d\\u0930\\u093e\\u092b\\u093c\\u0940 \\u0915\\u0948\\u092e\\u0930\\u0947 \\u0915\\u093e \\u0909\\u092a\\u092f\\u094b\\u0917 \\u0915\\u0930\\u0915\\u0947 \\u092a\\u094d\\u0930\\u0915\\u093e\\u0936 \\u0915\\u094b \\u0915\\u0948\\u0926 \\u0915\\u0930\\u0915\\u0947 \\u091b\\u0935\\u093f\\u092f\\u093e\\u0901 \\u092c\\u0928\\u093e\\u0928\\u0947 \\u0915\\u0940 \\u0915\\u0932\\u093e, \\u0935\\u093f\\u091c\\u094d\\u091e\\u093e\\u0928, \\u0914\\u0930 \\u0905\\u092d\\u094d\\u092f\\u093e\\u0938 \\u0939\\u0948\\u0964 \\u0907\\u0938\\u092e\\u0947\\u0902 \\u092a\\u094d\\u0930\\u0915\\u093e\\u0936 \\u092a\\u0915\\u094d\\u0937, \\u0938\\u0902\\u0930\\u091a\\u0928\\u093e, \\u0914\\u0930 \\u092b\\u094b\\u0915\\u0938 \\u091c\\u0948\\u0938\\u0947 \\u0935\\u093f\\u092d\\u093f\\u0928\\u094d\\u0928 \\u0924\\u0924\\u094d\\u0935\\u094b\\u0902 \\u0915\\u094b \\u0928\\u093f\\u092f\\u0902\\u0924\\u094d\\u0930\\u093f\\u0924 \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0940 \\u091c\\u0930\\u0942\\u0930\\u0924 \\u0939\\u094b\\u0924\\u0940 \\u0939\\u0948 \\u0924\\u093e\\u0915\\u093f \\u0935\\u093f\\u091c\\u0941\\u0905\\u0932 \\u0915\\u0939\\u093e\\u0928\\u0940 \\u0938\\u0947 \\u0938\\u0902\\u0926\\u0947\\u0936 \\u092a\\u0939\\u0941\\u0902\\u091a\\u093e\\u092f\\u093e, \\u0915\\u0939\\u093e\\u0928\\u0940 \\u0938\\u0941\\u0928\\u093e\\u0908 \\u092f\\u093e \\u092d\\u093e\\u0935\\u0928\\u093e\\u0913\\u0902 \\u0915\\u094b \\u0909\\u0924\\u094d\\u0924\\u0947\\u091c\\u093f\\u0924 \\u0915\\u093f\\u092f\\u093e \\u091c\\u093e \\u0938\\u0915\\u0947\\u0964","ar":"\\u0627\\u0644\\u062a\\u0635\\u0648\\u064a\\u0631 \\u0627\\u0644\\u0641\\u0648\\u062a\\u0648\\u063a\\u0631\\u06