            array (
                'id' => 91,
                'name' => '{"en":"Penetration Testing","hi":"\\u092a\\u094d\\u0930\\u0935\\u093f\\u0937\\u094d\\u091f\\u093f \\u092a\\u0930\\u0940\\u0915\\u094d\\u0937\\u0923","ar":"\\u0627\\u062e\\u062a\\u0628\\u0627\\u0631 \\u0627\\u0644\\u0627\\u062e\\u062a\\u0631\\u0627\\u0642"}',
                'description' => '{"en":"Penetration Testing, also known as pen testing or ethical hacking, is a security assessment technique used to evaluate the security of a computer system or network by simulating real-world cyberattacks. It involves identifying vulnerabilities, exploiting them to gain access to sensitive data or systems, and providing recommendations for improving security measures.","hi":"\\u092a\\u094d\\u0930\\u0935\\u093f\\u0937\\u094d\\u091f\\u093f \\u092a\\u0930\\u0940\\u0915\\u094d\\u0937\\u0923, \\u091c\\u093f\\u0938\\u0947 \\u092a\\u0947\\u0928 \\u091f\\u0947\\u0938\\u094d\\u091f\\u093f\\u0902\\u0917 \\u092f\\u093e \\u0928\\u0948\\u0924\\u093f\\u0915 \\u0939\\u0948\\u0915\\u093f\\u0902\\u0917 \\u0915\\u0947 \\u0930\\u0942\\u092a \\u092e\\u0947\\u0902 \\u092d\\u0940 \\u091c\\u093e\\u0928\\u093e \\u091c\\u093e\\u0924\\u093e \\u0939\\u0948, \\u090f\\u0915 \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e \\u092e\\u0942\\u0932\\u094d\\u092f\\u093e\\u0902\\u0915\\u0928 \\u0924\\u0915\\u0928\\u0940\\u0915 \\u0939\\u0948 \\u091c\\u094b \\u090f\\u0915 \\u0915\\u0902\\u092a\\u094d\\u092f\\u0942\\u091f\\u0930 \\u0938\\u093f\\u0938\\u094d\\u091f\\u092e \\u092f\\u093e \\u0928\\u0947\\u091f\\u0935\\u0930\\u094d\\u0915 \\u0915\\u0940 \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e \\u0915\\u093e \\u092e\\u0942\\u0932\\u094d\\u092f\\u093e\\u0902\\u0915\\u0928 \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0909\\u092a\\u092f\\u094b\\u0917 \\u0915\\u0940 \\u091c\\u093e\\u0924\\u0940 \\u0939\\u0948, \\u0935\\u093e\\u0938\\u094d\\u0924\\u0935\\u093f\\u0915 \\u0926\\u0941\\u0928\\u093f\\u092f\\u093e \\u0915\\u0947 \\u0938\\u093e\\u0907\\u092c\\u0930 \\u0939\\u092e\\u0932\\u094b\\u0902 \\u0915\\u094b \\u0938\\u093f\\u092e\\u094d\\u092f\\u0942\\u0932\\u0947\\u091f \\u0915\\u0930\\u0915\\u0947\\u0964 \\u0907\\u0938\\u092e\\u0947\\u0902 \\u0915\\u092e\\u091c\\u094b\\u0930\\u093f\\u092f\\u094b\\u0902 \\u0915\\u0940 \\u092a\\u0939\\u091a\\u093e\\u0928, \\u0909\\u0928\\u094d\\u0939\\u0947\\u0902 \\u0909\\u092a\\u092f\\u094b\\u0917 \\u0915\\u0930\\u0915\\u0947 \\u0938\\u0902\\u0935\\u0947\\u0926\\u0928\\u0936\\u0940\\u0932 \\u0921\\u0947\\u091f\\u093e \\u092f\\u093e \\u0938\\u093f\\u0938\\u094d\\u091f\\u092e \\u0924\\u0915 \\u092a\\u0939\\u0941\\u0902\\u091a\\u0928\\u093e, \\u0914\\u0930 \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e \\u092e\\u093e\\u092a\\u093e\\u0913\\u0902 \\u0915\\u094b \\u0938\\u0941\\u0927\\u093e\\u0930\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0938\\u093f\\u092b\\u093e\\u0930\\u093f\\u0936\\u0947\\u0902 \\u092a\\u094d\\u0930\\u0926\\u093e\\u0928 \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0940 \\u0936\\u093e\\u092e\\u093f\\u0932 \\u0939\\u094b\\u0924\\u0940 \\u0939\\u0948\\u0964","ar":"\\u0627\\u062e\\u062a\\u0628\\u0627\\u0631 \\u0627\\u0644\\u0627\\u062e\\u062a\\u0631\\u0627\\u0642\\u060c \\u0627\\u0644\\u0645\\u0639\\u0631\\u0648\\u0641 \\u0623\\u064a\\u0636\\u064b\\u0627 \\u0628\\u0627\\u0633\\u0645 \\u0627\\u062e\\u062a\\u0628\\u0627\\u0631 \\u0627\\u0644\\u0642\\u0644\\u0645 \\u0623\\u0648 \\u0627\\u0644\\u0627\\u062e\\u062a\\u0631\\u0627\\u0642 \\u0627\\u0644\\u0623\\u062e\\u0644\\u0627\\u0642\\u064a\\u060c \\u0647\\u0648 \\u062a\\u0642\\u0646\\u064a\\u0629 \\u062a\\u0642\\u064a\\u064a\\u0645 \\u0627\\u0644\\u0623\\u0645\\u0627\\u0646 \\u062a\\u0633\\u062a\\u062e\\u062f\\u0645 \\u0644\\u062a\\u0642\\u064a\\u064a\\u0645 \\u0623\\u0645\\u0627\\u0646 \\u0646\\u0638\\u0627\\u0645 \\u0643\\u0645\\u0628\\u064a\\u0648\\u062a\\u0631 \\u0623\\u0648 \\u0634\\u0628\\u0643\\u0629 \\u0639\\u0646 \\u0637\\u0631\\u064a\\u0642 \\u0645\\u062d\\u0627\\u0643\\u0627\\u0629 \\u0647\\u062c\\u0645\\u0627\\u062a \\u0627\\u0644\\u0625\\u0646\\u062a\\u0631\\u0646\\u062a \\u0641\\u064a \\u0627\\u0644\\u0639\\u0627\\u0644\\u0645 \\u0627\\u0644\\u062d\\u0642\\u064a\\u0642\\u064a. \\u064a\\u062a\\u0636\\u0645\\u0646 \\u062a\\u062d\\u062f\\u064a\\u062f \\u0627\\u0644\\u062b\\u063a\\u0631\\u