                'description' => '{"en":"Vulnerability Assessment is a process used to identify, quantify, and prioritize security vulnerabilities in a computer system, network, or application. It involves scanning systems for weaknesses, analyzing the findings, and providing recommendations for mitigating risks and strengthening security measures.","hi":"\\u092d\\u0947\\u0926\\u094d\\u092f\\u0924\\u093e \\u092e\\u0942\\u0932\\u094d\\u092f\\u093e\\u0902\\u0915\\u0928 \\u090f\\u0915 \\u092a\\u094d\\u0930\\u0915\\u094d\\u0930\\u093f\\u092f\\u093e \\u0939\\u0948 \\u091c\\u093f\\u0938\\u0915\\u093e \\u0909\\u092a\\u092f\\u094b\\u0917 \\u0915\\u093f\\u092f\\u093e \\u091c\\u093e\\u0924\\u093e \\u0939\\u0948 \\u090f\\u0915 \\u0915\\u0902\\u092a\\u094d\\u092f\\u0942\\u091f\\u0930 \\u0938\\u093f\\u0938\\u094d\\u091f\\u092e, \\u0928\\u0947\\u091f\\u0935\\u0930\\u094d\\u0915, \\u092f\\u093e \\u090f\\u092a\\u094d\\u0932\\u093f\\u0915\\u0947\\u0936\\u0928 \\u092e\\u0947\\u0902 \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e \\u092d\\u0947\\u0926\\u094d\\u092f\\u0924\\u093e\\u0913\\u0902 \\u0915\\u0940 \\u092a\\u0939\\u091a\\u093e\\u0928, \\u092e\\u093e\\u0924\\u094d\\u0930\\u093e\\u0924\\u094d\\u092e\\u0915 \\u0915\\u0930\\u0928\\u0947, \\u0914\\u0930 \\u092a\\u094d\\u0930\\u093e\\u0925\\u092e\\u093f\\u0915\\u0924\\u093e \\u0926\\u0947\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f\\u0964 \\u0907\\u0938\\u092e\\u0947\\u0902 \\u092a\\u094d\\u0930\\u0923\\u093e\\u0932\\u093f\\u092f\\u094b\\u0902 \\u0915\\u094b \\u0915\\u092e\\u091c\\u094b\\u0930\\u093f\\u092f\\u094b\\u0902 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0938\\u094d\\u0915\\u0948\\u0928 \\u0915\\u093f\\u092f\\u093e \\u091c\\u093e\\u0924\\u093e \\u0939\\u0948, \\u092b\\u093f\\u0930 \\u092a\\u0930\\u093f\\u0923\\u093e\\u092e\\u094b\\u0902 \\u0915\\u093e \\u0935\\u093f\\u0936\\u094d\\u0932\\u0947\\u0937\\u0923 \\u0915\\u093f\\u092f\\u093e \\u091c\\u093e\\u0924\\u093e \\u0939\\u0948, \\u0914\\u0930 \\u091c\\u094b\\u0916\\u093f\\u092e \\u0915\\u094b \\u0915\\u092e \\u0915\\u0930\\u0928\\u0947 \\u0914\\u0930 \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e \\u0909\\u092a\\u093e\\u092f\\u094b\\u0902 \\u0915\\u094b \\u092e\\u091c\\u092c\\u0942\\u0924 \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0938\\u093f\\u092b\\u093e\\u0930\\u093f\\u0936\\u0947\\u0902 \\u092a\\u094d\\u0930\\u0926\\u093e\\u0928 \\u0915\\u0940 \\u091c\\u093e\\u0924\\u0940 \\u0939\\u0948\\u0964","ar":"\\u062a\\u0642\\u064a\\u064a\\u0645 \\u0627\\u0644\\u0636\\u0639\\u0641 \\u0647\\u0648 \\u0639\\u0645\\u0644\\u064a\\u0629 \\u062a\\u064f\\u0633\\u062a\\u062e\\u062f\\u0645 \\u0644\\u062a\\u062d\\u062f\\u064a\\u062f \\u0648\\u0642\\u064a\\u0627\\u0633 \\u0648\\u062a\\u0631\\u062a\\u064a\\u0628 \\u0627\\u0644\\u062b\\u063a\\u0631\\u0627\\u062a \\u0627\\u0644\\u0623\\u0645\\u0646\\u064a\\u0629 \\u0641\\u064a \\u0646\\u0638\\u0627\\u0645 \\u0643\\u0645\\u0628\\u064a\\u0648\\u062a\\u0631 \\u0623\\u0648 \\u0634\\u0628\\u0643\\u0629 \\u0623\\u0648 \\u062a\\u0637\\u0628\\u064a\\u0642. \\u064a\\u062a\\u0636\\u0645\\u0646 \\u0630\\u0644\\u0643 \\u0641\\u062d\\u0635 \\u0627\\u0644\\u0623\\u0646\\u0638\\u0645\\u0629 \\u0644\\u0644\\u0636\\u0639\\u0641\\u060c \\u0648\\u062a\\u062d\\u0644\\u064a\\u0644 \\u0627\\u0644\\u0646\\u062a\\u0627\\u0626\\u062c\\u060c \\u0648\\u062a\\u0642\\u062f\\u064a\\u0645 \\u0627\\u0644\\u062a\\u0648\\u0635\\u064a\\u0627\\u062a \\u0644\\u0644\\u062d\\u062f \\u0645\\u0646 \\u0627\\u0644\\u0645\\u062e\\u0627\\u0637\\u0631 \\u0648\\u062a\\u0639\\u0632\\u064a\\u0632 \\u062a\\u062f\\u0627\\u0628\\u064a\\u0631 \\u0627\\u0644\\u0623\\u0645\\u0627\\u0646."}',
