                'description' => '{"en":"Network Security Testing, also known as security assessment or security auditing, is the process of evaluating the security of a computer network infrastructure by identifying vulnerabilities, assessing potential threats, and implementing measures to protect against unauthorized access, data breaches, and cyberattacks.","hi":"\\u0928\\u0947\\u091f\\u0935\\u0930\\u094d\\u0915 \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e \\u092a\\u0930\\u0940\\u0915\\u094d\\u0937\\u0923, \\u091c\\u093f\\u0938\\u0947 \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e \\u092e\\u0942\\u0932\\u094d\\u092f\\u093e\\u0902\\u0915\\u0928 \\u092f\\u093e \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e \\u092e\\u0902\\u0917\\u0930\\u093e\\u0908 \\u092d\\u0940 \\u0915\\u0939\\u093e \\u091c\\u093e\\u0924\\u093e \\u0939\\u0948, \\u090f\\u0915 \\u092a\\u094d\\u0930\\u0915\\u094d\\u0930\\u093f\\u092f\\u093e \\u0939\\u0948 \\u091c\\u093f\\u0938\\u0915\\u093e \\u0909\\u092a\\u092f\\u094b\\u0917 \\u0915\\u093f\\u092f\\u093e \\u091c\\u093e\\u0924\\u093e \\u0939\\u0948 \\u0915\\u0902\\u092a\\u094d\\u092f\\u0942\\u091f\\u0930 \\u0928\\u0947\\u091f\\u0935\\u0930\\u094d\\u0915 \\u092c\\u0941\\u0928\\u093f\\u092f\\u093e\\u0926\\u0940 \\u0938\\u0902\\u0930\\u091a\\u0928\\u093e \\u0915\\u0940 \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e \\u0915\\u093e \\u092e\\u0942\\u0932\\u094d\\u092f\\u093e\\u0902\\u0915\\u0928 \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f, \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e \\u0915\\u092e\\u093f\\u092f\\u094b\\u0902 \\u0915\\u0940 \\u092a\\u0939\\u091a\\u093e\\u0928 \\u0915\\u0930\\u0928\\u0947, \\u0938\\u0902\\u092d\\u093e\\u0935\\u093f\\u0924 \\u0916\\u0924\\u0930\\u094b\\u0902 \\u0915\\u093e \\u092e\\u0942\\u0932\\u094d\\u092f\\u093e\\u0902\\u0915\\u0928 \\u0915\\u0930\\u0928\\u0947, \\u0914\\u0930 \\u0905\\u0928\\u0927\\u093f\\u0915\\u0943\\u0924 \\u092a\\u0939\\u0941\\u0902\\u091a, \\u0921\\u0947\\u09