                'name' => '{"en":"Web Application Security Testing","hi":"\\u0935\\u0947\\u092c \\u090f\\u092a\\u094d\\u0932\\u093f\\u0915\\u0947\\u0936\\u0928 \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e \\u092a\\u0930\\u0940\\u0915\\u094d\\u0937\\u0923","ar":"\\u0627\\u062e\\u062a\\u0628\\u0627\\u0631 \\u0623\\u0645\\u0627\\u0646 \\u062a\\u0637\\u0628\\u064a\\u0642\\u0627\\u062a \\u0627\\u0644\\u0648\\u064a\\u0628"}',
                'description' => '{"en":"Web Application Security Testing is the process of evaluating the security of a web application by identifying vulnerabilities, weaknesses, and potential threats. It involves assessing various aspects such as authentication, authorization, input validation, session management, and data protection to ensure that the application is resilient against common security risks and cyberattacks.","hi":"\\u0935\\u0947\\u092c \\u090f\\u092a\\u094d\\u0932\\u093f\\u0915\\u0947\\u0936\\u0928 \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e \\u092a\\u0930\\u0940\\u0915\\u094d\\u0937\\u0923 \\u090f\\u0915 \\u092a\\u094d\\u0930\\u0915\\u094d\\u0930\\u093f\\u092f\\u093e \\u0939\\u0948 \\u091c\\u093f\\u0938\\u092e\\u0947\\u0902 \\u090f\\u0915 \\u0935\\u0947\\u092c \\u090f\\u092a\\u094d\\u0932\\u093f\\u0915\\u0947\\u0936\\u0928 \\u0915\\u0940 \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e \\u0915\\u093e \\u092e\\u0942\\u0932\\u094d\\u092f\\u093e\\u0902\\u0915\\u0928 \\u0915\\u093f\\u092f\\u093e \\u091c\\u093e\\u0924\\u093e \\u0939\\u0948, \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e \\u0915\\u092e\\u093f\\u092f\\u094b\\u0902 \\u0915\\u0940 \\u092a\\u0939\\u091a\\u093e\\u0928, \\u0915\\u092e\\u091c\\u094b\\u0930\\u093f\\u092f\\u094b\\u0902, \\u0914\\u0930 \\u0938\\u0902\\u092d\\u093e\\u0935\\u093f\\u0924 \\u0916\\u0924\\u0930\\u094b\\u0902 \\u0915\\u094b\\u0964 \\u0907\\u0938\\u092e\\u0947\\u0902 \\u092a\\u094d\\u0930\\u092e\\u093e\\u0923\\u0940\\u0915\\u0930\\u0923, \\u0905\\u0927\\u093f\\u0915\\u0943\\u0924\\u093f, \\u0907\\u0928\\u092a\\u0941\\u091f \\u092e\\u093e\\u0928\\u094d\\u092f\\u0924\\u093e, \\u0938\\u0924\\u094d\\u0930 \\u092a\\u094d\\u0930\\u092c\\u0902\\u0927\\u0928, \\u0914\\u0930 \\u0921\\u0947\\u091f\\u093e \\u0938\\u0902\\u0930\\u0915\\u094d\\u0937\\u0923 \\u091c\\u0948\\u0938\\u0947 \\u0935\\u093f\\u092d\\u093f\\u0928\\u094d\\u0928 \\u092a\\u0939\\u0932\\u0941\\u0913\\u0902 \\u0915\\u093e \\u092e\\u0942\\u0932\\u094d\\