                'description' => '{"en":"Social Engineering is a tactic used by attackers to manipulate individuals into divulging confidential information, performing actions, or providing access to restricted systems or resources. It involves exploiting human psychology and building trust to deceive targets and gain unauthorized access to sensitive information or assets.","hi":"\\u0938\\u093e\\u092e\\u093e\\u091c\\u093f\\u0915 \\u0907\\u0902\\u091c\\u0940\\u0928\\u093f\\u092f\\u0930\\u093f\\u0902\\u0917 \\u0939\\u092e\\u0932\\u093e\\u0935\\u0930\\u094b\\u0902 \\u0926\\u094d\\u0935\\u093e\\u0930\\u093e \\u090f\\u0915\\u0932\\u094b\\u0917\\u094b\\u0902 \\u0915\\u094b \\u0916\\u0941\\u0932\\u0940 \\u0938\\u0942\\u091a\\u0928\\u093e \\u0926\\u0947\\u0928\\u0947, \\u0915\\u093e\\u0930\\u094d\\u0930\\u0935\\u093e\\u0908 \\u0915\\u0930\\u0928\\u0947, \\u092f\\u093e \\u092a\\u094d\\u0930\\u0924\\u093f\\u092c\\u0902\\u0927\\u093f\\u0924 \\u0938\\u093f\\u0938\\u094d\\u091f\\u092e \\u092f\\u093e \\u0938\\u0902\\u0938\\u093e\\u0927\\u0928\\u094b\\u0902 \\u0924\\u0915 \\u092a\\u0939\\u0941\\u0902\\u091a \\u092a\\u094d\\u0930\\u0926\\u093e\\u0928 \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u090f\\u0915 \\u0924\\u0915\\u0928\\u0940\\u0915 \\u0939\\u094b\\u0924\\u0940 \\u0939\\u0948\\u0964 \\u0907\\u0938\\u092e\\u0947\\u0902 \\u092e\\u093e\\u0928\\u0935 \\u092e\\u0928\\u094b\\u0935\\u093f\\u091c\\u094d\\u091e\\u093e\\u0928 \\u0915\\u093e \\u0909\\u092a\\u092f\\u094b\\u0917 \\u0915\\u0930\\u0928\\u093e \\u0914\\u0930 \\u0935\\u093f\\u0936\\u094d\\u0935\\u093e\\u0938 \\u0915\\u094b \\u092c\\u0928\\u093e\\u090f \\u0930\\u0916\\u0928\\u093e \\u0936\\u093e\\u092e\\u093f\\u0932 \\u0939\\u0948 \\u0924\\u093e\\u0915\\u093f \\u0932\\u0915\\u094d\\u0937\\u094d\\u092f\\u094b\\u0902 \\u0915\\u094b \\u0927\\u094b\\u0916\\u093e \\u0926\\u0947\\u0915\\u0930 \\u0905\\u0928\\u0927\\u093f\\u0915\\u0943\\u0924 \\u0930\\u0942\\u092a \\u0938\\u0947 \\u0938\\u0902\\u0935\\u0947