                'name' => '{"en":"Literature","hi":"\\u0938\\u093e\\u0939\\u093f\\u0924\\u094d\\u092f","ar":"\\u0627\\u0644\\u0623\\u062f\\u0628"}',
                'description' => '{"en":"Literature encompasses written works that express ideas, emotions, stories, or experiences through various forms such as novels, poetry, plays, essays, and short stories. It reflects the cultural, social, and historical contexts of the societies in which it is produced, offering insights into human nature, beliefs, and values.","hi":"\\u0938\\u093e\\u0939\\u093f\\u0924\\u094d\\u092f \\u0935\\u093f\\u092d\\u093f\\u0928\\u094d\\u0928 \\u0930\\u0942\\u092a\\u094b\\u0902 \\u092e\\u0947\\u0902 \\u091c\\u0948\\u0938\\u0947 \\u0915\\u093f \\u0915\\u093e\\u0935\\u094d\\u092f, \\u0915\\u0939\\u093e\\u0928\\u093f\\u092f\\u093e\\u0901, \\u0928\\u093e\\u091f\\u0915, \\u0928\\u093f\\u092c\\u0902\\u0927 \\u0914\\u0930 \\u0932\\u0918\\u0941 \\u0915\\u0925\\u093e\\u090f\\u0901 \\u0915\\u0947 \\u092e\\u093e\\u0927\\u094d\\u092f\\u092e \\u0938\\u0947 \\u0935\\u093f\\u091a\\u093e\\u0930, \\u092d\\u093e\\u0935\\u0928\\u093e\\u090f\\u0901, \\u0915\\u0939\\u093e\\u0928\\u093f\\u092f\\u093e\\u0901, \\u092f\\u093e \\u0905\\u0928\\u0941\\u092d\\u0935\\u094b\\u0902 \\u0915\\u094b \\u0935\\u094d\\u092f\\u0915\\u094d\\u0924 \\u0915\\u0930\\u0928\\u0947 \\u0935\\u093e\\u0932\\u0940 \\u0932\\u093f\\u0916\\u093f\\u0924 \\u0915\\u0943\\u0924\\u093f\\u092f\\u094b\\u0902 \\u0915\\u094b \\u0938\\u092e\\u093e\\u0939\\u093f\\u0924 \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948\\u0964 \\u092f\\u0939 \\u0909\\u0928 \\u0938\\u092e\\u093e\\u091c\\u094b\\u0902 \\u0915\\u0940 \\u0938\\u093e\\u0902\\u0938\\u094d\\u0915\\u0943\\u0924\\u093f\\u0915, \\u0938\\u093e\\u092e\\u093e\\u091c\\u093f\\u0915, \\u0914\\u0930 \\u0910\\u0924\\u093f\\u0939\\u093e\\u0938\\u093f\\u0915 \\u092a\\u0930\\u093f\\u0938\\u094d\\u0925\\u093f\\u0924\\u093f\\u092f\\u094b\\u0902 \\u0915\\u094b \\u092a\\u094d\\u0930\\u0924\\u093f\\u092c\\u093f\\u092e\\u094d\\u092c\\u093f\\u0924 \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948, \\u091c\\u093f\\u0928\\u092e\\u0947\\u0902 \\u092f\\u0939 \\u0909\\u0924\\u094d