                'name' => '{"en":"Language and Linguistics","hi":"\\u092d\\u093e\\u0937\\u093e \\u0914\\u0930 \\u092d\\u093e\\u0937\\u093e\\u0935\\u093f\\u091c\\u094d\\u091e\\u093e\\u0928","ar":"\\u0627\\u0644\\u0644\\u063a\\u0629 \\u0648\\u0639\\u0644\\u0645 \\u0627\\u0644\\u0644\\u063a\\u0629"}',
                'description' => '{"en":"Language and Linguistics is the scientific study of human language. It explores the structure, evolution, acquisition, and usage of languages, as well as their social and cultural contexts. Linguists analyze various aspects of language, including phonetics, phonology, morphology, syntax, semantics, and pragmatics, to understand how languages function and how they shape communication and thought.","hi":"\\u092d\\u093e\\u0937\\u093e \\u0914\\u0930 \\u092d\\u093e\\u0937\\u093e\\u0935\\u093f\\u091c\\u094d\\u091e\\u093e\\u0928 \\u092e\\u093e\\u0928\\u0935 \\u092d\\u093e\\u0937\\u093e \\u0915\\u093e \\u0935\\u0948\\u091c\\u094d\\u091e\\u093e\\u0928\\u093f\\u0915 \\u0905\\u0927\\u094d\\u092f\\u092f\\u0928 \\u0939\\u0948\\u0964 \\u092f\\u0939 \\u092d\\u093e\\u0937\\u093e\\u0913\\u0902 \\u0915\\u0940 \\u0938\\u0902\\u0930\\u091a\\u0928\\u093e, \\u0935\\u093f\\u0915\\u093e\\u0938, \\u092a\\u094d\\u0930\\u093e\\u092a\\u094d\\u0924\\u093f, \\u0914\\u0930 \\u0909\\u092a\\u092f\\u094b\\u0917 \\u0915\\u0947 \\u0938\\u0902\\u092c\\u0902\\u0927 \\u092e\\u0947\\u0902 \\u0905\\u0928\\u0941\\u0938\\u0902\\u0927\\u093e\\u0928 \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948, \\u0938\\u093e\\u0925 \\u0939\\u0940 \\u0909\\u0928\\u0915\\u0947 \\u0938\\u093e\\u092e\\u093e\\u091c\\u093f\\u0915 \\u0914\\u0930 \\u0938\\u093e\\u0902\\u0938\\u094d\\u0915\\u0943\\u0924\\u093f\\u0915 \\u092a\\u0930\\u093f\\u0938\\u094d\\u0925\\u093f\\u0924\\u093f\\u092f\\u094b\\u0902 \\u0915\\u094b \\u092d\\u0940 \\u0926\\u0947\\u0916\\u0924\\u093e \\u0939\\u0948\\u0964 \\u092d\\u093e\\u0937\\u093e\\u0935\\u093f\\u091c\\u094d\\u091e\\u093e\\u0928\\u0940 \\u092d\\u093e\\u0937\\u093e \\u0915\\u0947 \\u0935\\u093f\\u092d\\u093f\\u0928\\u094d\\u0928 \\u092a\\u0939\\u0932\\u0941\\u0913\\u0902 \\u0915\\u093e \\u0935\\u093f\\u0936\\u094d\\u0932\\u0947\\u0937\\u0923 \\u0915\\u0930\\u0924\\u0947 \\u0939\\u0948\\u0902, \\u091c\\u093f\\u0938\\u092e\\u0947\\u0902 \\u0927\\u094d\\u0935\\u0928\\u093f\\u0915\\u0940, \\u0927\\u094d\\u0935\\u0928\\u093f\\u0935\\u093f\\u091c\\u094d\\u091e\\u093e\\u0928, \\u0930\\u0942\\u092a\\u0935\\u093f\\u091c\\u094d\\u091e\\u093e\\u0928, \\u0935\\u093e\\u0915\\u094d\\u092f-\\u0930\\u091a\\u0928\\u093e, \\u0936\\u092c\\u094d\\u0926\\u093e\\u0930\\u094d\\u0925-\\u0935\\u093f\\u091c\\u094d\\u091e\\u093e\\u0928, \\u0914\\u0930 \\u092a\\u094d\\u0930\\u0917\\u094d\\u092f\\u093e\\u0928\\u094d\\u0924\\u0930 \\u0936\\u093e\\u092e\\u093f\\u0932 \\u0939\\u0948\\u0902, \\u0924\\u093e\\u0915\\u093f \\u0935\\u0947 \\u0938\\u092e\\u091d \\u0938\\u0915\\u0947\\u0902 \\u0915\\u093f \\u092d\\u093e\\u0937\\u093e\\u090f\\u0901 \\u0915\\u0948\\u0938\\u0947 \\u0915\\u093e\\u0930\\u094d\\u092f \\u0915\\u0930\\u0924\\u0940 \\u0939\\u0948\\u0902 \\u0914\\u0930 \\u0935\\u0947 \\u0938\\u0902\\u091a\\u093e\\u0930 \\u0914\\u0930 \\u0935\\u093f\\u091a\\u093e\\u0930 \\u0915\\u094b \\u0915\\u0948\\u0938\\u0947 \\u0906\\u0915\\u093e\\u0930 \\u0926\\u0947\\u0924\\u0940 \\u0939\\u0948\\u0902\\u0964","ar":"\\u0639\\u0644\\u0645 \\u0627\\u0644\\u0644\\u063a\\u0629 \\u0648\\u0639\\u0644\\u0645 \\u0627\\u0644\\u0644\\u063a\\u0629 \\u0647\\u0648 \\u0627\\u0644\\u062f\\u0631\\u0627\\u0633\\u0629 \\u0627\\u0644\\u0639\\u0644\\u0645\\u064a\\u0629 \\u0644\\u0644\\u063a\\u0629 \\u0627\\u0644\\u0628\\u0634\\u0631\\u064a\\u0629. \\u064a\\u0633\\u062a\\u0643\\u0634\\u0641 \\u0647\\u0630\\u0627 \\u0627\\u0644\\u0645\\u062c\\u0627\\u0644 \\u0627\\u0644\\u0628\\u0646\\u064a\\u0629 \\u0648\\u0627\\u0644\\u062a\\u0637\\u0648\\u0631 \\u0648\\u0627\\u0644\\u0627\\u0643\\u062a\\u0633\\u0627\\u0628 \\u0648\\u0627\\u0633\\u062a\\u062e\\u062f\\u0627\\u0645 \\u0627\\u0644\\u0644\\u063a\\u0627\\u062a\\u060c \\u0628\\u0627\\u0644\\u0625\\u0636\\u0627\\u0641\\u0629 \\u0625\\u0644\\u0649 \\u0633\\u064a\\u0627\\u0642\\u0627\\u062a\\u0647\\u0627 \\u0627\\u0644\\u0627\\u062c\\u062a\\u0645\\u0627\\u0639\\u064a\\u0629 \\u0648\\u0627\\u0644\\u062b\\u0642\\u0627\\u0641. \\u064a\\u062d\\u064