                'description' => '{"en":"Composition and Rhetoric is a field of study that focuses on the art of effective communication through writing and speaking. It explores the principles of composition, including organization, coherence, and style, as well as the techniques of persuasion and argumentation used in rhetoric. This discipline aims to enhance students\' ability to express themselves clearly and persuasively in various contexts.","hi":"\\u0930\\u091a\\u0928\\u093e \\u0914\\u0930 \\u0935\\u093e\\u0915\\u094d\\u092f\\u0930\\u091a\\u0928\\u093e \\u090f\\u0915 \\u0905\\u0927\\u094d\\u092f\\u092f\\u0928 \\u0915\\u094d\\u0937\\u0947\\u0924\\u094d\\u0930 \\u0939\\u0948 \\u091c\\u094b \\u0932\\u0947\\u0916\\u0928 \\u0914\\u0930 \\u092c\\u094b\\u0932\\u0928\\u0947 \\u0915\\u0947 \\u092e\\u093e\\u0927\\u094d\\u092f\\u092e \\u0938\\u0947 \\u092a\\u094d\\u0930\\u092d\\u093e\\u0935\\u0940 \\u0938\\u0902\\u091a\\u093e\\u0930 \\u0915\\u0932\\u093e \\u092a\\u0930 \\u0927\\u094d\\u092f\\u093e\\u0928 \\u0915\\u0947\\u0902\\u0926\\u094d\\u0930\\u093f\\u0924 \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948\\u0964 \\u0907\\u0938\\u092e\\u0947\\u0902 \\u0938\\u0902\\u0917\\u0920\\u0928, \\u0938\\u0902\\u0918\\u091f\\u0928, \\u0914\\u0930 \\u0936\\u0948\\u0932\\u0940 \\u0938\\u0939\\u093f\\u0924 \\u0930\\u091a\\u0928\\u093e \\u0915\\u0947 \\u0938\\u093f\\u0926\\u094d\\u0927\\u093e\\u0902\\u0924\\u094b\\u0902 \\u0915\\u093e \\u0905\\u0927\\u094d\\u092f\\u092f\\u0928 \\u0915\\u093f\\u092f\\u093e \\u091c\\u093e\\u0924\\u093e \\u0939\\u0948, \\u0938\\u093e\\u0925 \\u0939\\u0940 \\u0930\\u093f\\u091f\\u094b\\u0930\\u093f\\u0915 \\u092e\\u0947\\u0902 \\u092a\\u094d\\u0930\\u092f\\u094b\\u0917 \\u0915\\u093f\\u090f \\u091c\\u093e\\u0928\\u0947 \\u0935\\u093e\\u0932\\u0947 \\u092a\\u094d\\u0930\\u0947\\u0930\\u0923\\u093e \\u0914\\u0930 \\u0924\\u0930\\u094d\\u0915 \\u0915\\u0947 \\u0924\\u0915\\u0928\\u0940\\u0915\\u094b\\u0902 \\u0915\\u093e \\u092d\\u0940 \\u0905\\u0927\\u094d\\u0