\u062a \\u0627\\u0644\\u0625\\u0642\\u0646\\u0627\\u0639 \\u0648\\u0627\\u0644\\u062c\\u062f\\u0627\\u0644 \\u0627\\u0644\\u0645\\u0633\\u062a\\u062e\\u062f\\u0645\\u0629 \\u0641\\u064a \\u0627\\u0644\\u0628\\u0644\\u0627\\u063a\\u0629. \\u064a\\u0647\\u062f\\u0641 \\u0647\\u0630\\u0627 \\u0627\\u0644\\u062a\\u062e\\u0635\\u0635 \\u0625\\u0644\\u0649 \\u062a\\u0639\\u0632\\u064a\\u0632 \\u0642\\u062f\\u0631\\u0629 \\u0627\\u0644\\u0637\\u0644\\u0627\\u0628 \\u0639\\u0644\\u0649 \\u0627\\u0644\\u062a\\u0639\\u0628\\u064a\\u0631 \\u0639\\u0646 \\u0623\\u0646\\u0641\\u0633\\u0647\\u0645 \\u0628\\u0648\\u0636\\u0648\\u062d \\u0648\\u0625\\u0642\\u0646\\u0627\\u0639 \\u0641\\u064a \\u0633\\u064a\\u0627\\u0642\\u0627\\u062a \\u0645\\u062e\\u062a\\u0644\\u0641\\u0629."}',
