                'id' => 99,
                'name' => '{"en":"Creative Writing","hi":"\\u0930\\u091a\\u0928\\u093e\\u0924\\u094d\\u092e\\u0915 \\u0932\\u0947\\u0916\\u0928","ar":"\\u0627\\u0644\\u0643\\u062a\\u0627\\u0628\\u0629 \\u0627\\u0644\\u0625\\u0628\\u062f\\u0627\\u0639\\u064a\\u0629"}',
                'description' => '{"en":"Creative Writing is a form of expression that involves crafting original works of fiction, poetry, drama, or non-fiction. It encourages writers to explore their imagination, emotions, and experiences to create engaging narratives, vivid imagery, and compelling characters. Through the use of language and literary techniques, creative writers convey their ideas and stories in unique and imaginative ways.","hi":"\\u0930\\u091a\\u0928\\u093e\\u0924\\u094d\\u092e\\u0915 \\u0932\\u0947\\u0916\\u0928 \\u090f\\u0915 \\u0905\\u092d\\u093f\\u0935\\u094d\\u092f\\u0915\\u094d\\u0924\\u093f \\u0915\\u093e \\u0930\\u0942\\u092a \\u0939\\u0948 \\u091c\\u094b \\u0915\\u093f \\u0915\\u0932\\u094d\\u092a\\u0928\\u093e, \\u0915\\u0935\\u093f\\u0924\\u093e, \\u0928\\u093e\\u091f\\u0915, \\u092f\\u093e \\u0917\\u0948\\u0930-\\u0915\\u093e\\u0935\\u094d\\u092f \\u0915\\u0947 \\u092e\\u0942\\u0932 \\u0915\\u093e\\u0930\\u094d\\u092f\\u094b\\u0902 \\u0915\\u094b \\u092c\\u0928\\u093e\\u0928\\u0947 \\u092e\\u0947\\u0902 \\u0938\\u092e\\u0930\\u094d\\u0925 \\u0939\\u094b\\u0924\\u093e \\u0939\\u0948\\u0964 \\u092f\\u0939 \\u0932\\u0947\\u0916\\u0915\\u094b\\u0902 \\u0915\\u094b \\u0909\\u0928\\u0915\\u0940 \\u0915\\u0932\\u094d\\u092a\\u0928\\u093e, \\u092d\\u093e\\u0935\\u0928\\u093e\\u0913\\u0902, \\u0914\\u0930 \\u0905\\u0928\\u0941\\u092d\\u0935\\u094b\\u0902 \\u0915\\u0940 \\u091c\\u093e\\u0902\\u091a \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u092a\\u094d\\u0930\\u094b\\u0924\\u094d\\u0938\\u093e\\u0939\\u093f\\u0924 \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948 \\u0924\\u093e\\u0915\\u093f \\u0935\\u0947 \\u0930\\u094b\\u091a\\u0915 \\u0915\\u0925\\u093e\\u0913\\u0902, \\u091a\\u093f\\u0924\\u094d\\u0930\\u0935\\u093f\\u091a\\u093e\\u0930\\u094b\\u0902, \\u0914\\u0930 \\u092a\\u094d\\u0930\\u0947\\u0930\\u0915 \\u092a\\u093e\\u0924\\u094d\\u0930\\u094b\\u0902 \\u0915\\u094b \\u092c\\u0928\\u093e \\u0938\\u0915\\u0947\\u0902\\u0964 \\u092d\\u093e\\u0937\\u093e \\u0914\\u0930 \\u0938\\u093e\\u0939\\u093f\\u0924\\u094d\\u092f\\u093f\\u0915 \\u0924\\u0915\\u0928\\u0940\\u0915\\u094b\\u0902 \\u0915\\u093e \\u0909\\u092a\\u092f\\u094b\\u0917 \\u0915\\u0930\\u0915\\u0947, \\u0930\\u091a\\u0928\\u093e\\u0924\\u094d\\u092e\\u0915 \\u0932\\u0947\\u0916\\u0915 \\u0905\\u092a\\u0928\\u0947 \\u0935\\u093f\\u091a\\u093e\\u0930\\u094b\\u0902 \\u0914\\u0930 \\u0915\\u0925\\u093e\\u0913\\u0902 \\u0915\\u094b \\u0905\\u0928\\u0942\\u0920\\u0947 \\u0914\\u0930 \\u0915\\u0932\\u094d\\u092a\\u0928\\u093e\\u0936\\u0940\\u0932 \\u0924\\u0930\\u0940\\u0915\\u094b\\u0902 \\u092e\\u0947\\u0902 \\u092a\\u094d\\u0930\\u0938\\u094d\\u0924\\u0941\\u0924 \\u0915\\u0930\\u0924\\u0947 \\u0939\\u0948\\u0902\\u0964","ar":"\\u0627\\u0644\\u0643\\u062a\\u0627\\u0628\\u0629 \\u0627\\u0644\\u0625\\u0628\\u062f\\u0627\\u0639\\u064a\\u0629 \\u0647\\u064a \\u0634\\u0643\\u0644 \\u0645\\u0646 \\u0623\\u0634\\u0643\\u0627\\u0644 \\u0627\\u0644\\u062a\\u0639\\u0628\\u064a\\u0631 \\u064a\\u062a\\u0636\\u0645\\u0646 \\u0635\\u064a\\u0627\\u063a\\u0629 \\u0623\\u0639\\u0645\\u0627\\u0644 \\u0623\\u0635\\u0644\\u064a\\u0629 \\u0645\\u0646 \\u0627\\u0644\\u062e\\u064a\\u0627\\u0644\\u060c \\u0648\\u0627\\u0644\\u0634\\u0639\\u0631\\u060c \\u0648\\u0627\\u0644\\u062f\\u0631\\u0627\\u0645\\u0627\\u060c \\u0623\\u0648 \\u063a\\u064a\\u0631 \\u0627\\u0644\\u062e\\u064a\\u0627\\u0644\\u064a\\u0629. \\u0625\\u0646\\u0647\\u0627 \\u062a\\u0634\\u062c\\u0639 \\u0627\\u0644\\u0643\\u062a\\u0627\\u0628 \\u0639\\u0644\\u0649 \\u0627\\u0633\\u062a\\u0643\\u0634\\u0627\\u0641 \\u062e\\u064a\\u0627\\u0644\\u0647\\u0645\\u060c \\u0648\\u0639\\u0648\\u0627\\u0637\\u0641\\u0647\\u0645\\u060c \\u0648\\u062a\\u062c\\u0627\\u0631\\u0628\\u0647\\u0645 \\u0644\\u062e\\u0644\\u0642 \\u0633\\u0631\\u062f\\u064a\\u0627\\u062a \\u062c\\u0630\\u0627\\u0628\\u0629\\u060c \\u0648\\u0635\\u0648\\u0631 \\u062d\\u064a\\u0629\\u060c \\u0648\\u0634\\u062e\\u0635\\u