            array (
                'id' => 100,
                'name' => '{"en":"Literary Theory and Criticism","hi":"\\u0938\\u093e\\u0939\\u093f\\u0924\\u094d\\u092f \\u0938\\u093f\\u0926\\u094d\\u0927\\u093e\\u0902\\u0924 \\u0914\\u0930 \\u0906\\u0932\\u094b\\u091a\\u0928\\u093e","ar":"\\u0646\\u0638\\u0631\\u064a\\u0629 \\u0627\\u0644\\u0623\\u062f\\u0628 \\u0648\\u0627\\u0644\\u0646\\u0642\\u062f"}',
                'description' => '{"en":"Literary Theory and Criticism is a field of study that examines literature through various theoretical perspectives and critical approaches. It explores the interpretation, analysis, and evaluation of literary texts, as well as the study of literary movements, genres, and historical contexts. Literary theorists and critics analyze the meaning, significance, and cultural impact of literary works, contributing to the understanding and appreciation of literature as an art form.","hi":"\\u0938\\u093e\\u0939\\u093f\\u0924\\u094d\\u092f \\u0938\\u093f\\u0926\\u094d\\u0927\\u093e\\u0902\\u0924 \\u0914\\u0930 \\u0906\\u0932\\u094b\\u091a\\u0928\\u093e \\u090f\\u0915 \\u0905\\u0927\\u094d\\u092f\\u092f\\u0928 \\u0915\\u094d\\u0937\\u0947\\u0924\\u094d\\u0930 \\u0939\\u0948 \\u091c\\u094b \\u0935\\u093f\\u092d\\u093f\\u0928\\u094d\\u0928 \\u0938\\u093f\\u0926\\u094d\\u0927\\u093e\\u0902\\u0924\\u093f\\u0915 \\u092a\\u0930\\u093f\\u092a\\u094d\\u0930\\u0947\\u0915\\u094d\\u0937\\u094d\\u092f\\u094b\\u0902 \\u0914\\u0930 \\u0906\\u0932\\u094b\\u091a\\u0928\\u093e\\u0924\\u094d\\u092e\\u0915 \\u0926\\u0943\\u0937\\u094d\\u091f\\u093f\\u0915\\u094b\\u0923\\u094b\\u0902 \\u0915\\u0947 \\u092e\\u093e\\u0927\\u094d\\u092f\\u092e \\u0938\\u0947 \\u0938\\u093e\\u0939\\u093f\\u0924\\u094d\\u092f \\u0915\\u0940 \\u091c\\u093e\\u0902\\u091a \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948\\u0964 \\u092f\\u0939 \\u0938\\u093e\\u0939\\u093f\\u0924\\u094d\\u092f\\u093f\\u0915 \\u092a\\u093e\\u0920\\u094b\\u0902 \\u0915\\u0947 \\u0935\\u094d\\u092f\\u093e\\u0916\\u094d\\u092f\\u093e, \\u0935\\u093f\\u0936\\u094d\\u0932\\u0947\\u0937\\u0923, \\u0914\\u0930 \\u092e\\u0942\\u0932\\u094d\\u092f\\u093e\\u0902\\u0915\\u0928, \\u0938\\u093e\\u0925 \\u0939\\u0940 \\u0938\\u093e\\u0939\\u093f\\u0924\\u094d\\u092f\\u093f\\u0915 \\u0906\\u0902\\u0926\\u094b\\u0932\\u0928\\u094b\\u0902, \\u0936\\u0948\\u0932\\u093f\\u092f\\u094b\\u0902, \\u0914\\u0930 \\u0910\\u0924\\u093f\\u0939\\u093e\\u0938\\u093f\\u0915 \\u0938\\u0902\\u0926\\u0930\\u094d\\u092d\\u094b\\u0902 \\u0915\\u093e \\u0905\\u0927\\u094d\\u092f\\u092f\\u0928 \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948\\u0964 \\u0938\\u093e\\u0939\\u093f\\u0924\\u094d\\u092f \\u0938\\u093f\\u0926\\u094d\\u0927\\u093e\\u0902\\u0924\\u0915\\u093e\\u0930 \\u0914\\u0930 \\u0906\\u0932\\u094b\\u091a\\u0915 \\u0932\\u0947\\u0916\\u0928\\u094b\\u0902 \\u0915\\u0947 \\u0905\\u0930\\u094d\\u0925, \\u092e\\u0939\\u0924\\u094d\\u0935, \\u0914\\u0930 \\u0938\\u093e\\u0902\\u0938\\u094d\\u0915\\u0943\\u0924\\u093f\\u0915 \\u092a\\u094d\\u0930\\u092d\\u093e\\u0935 \\u0915\\u093e \\u0935\\u093f\\u0936\\u094d\\u0932\\u0947\\u0937\\u0923 \\u0915\\u0930\\u0924\\u0947 \\u0939\\u0948\\u0902, \\u091c\\u094b \\u0938\\u093e\\u0939\\u093f\\u0924\\u094d\\u092f \\u0915\\u094b \\u090f\\u0915 \\u0915\\u0932\\u093e \\u0930\\u0942\\u092a \\u0915\\u0947 \\u0930\\u0942\\u092a \\u092e\\u0947\\u0902 \\u0938\\u092e\\u091d\\u0928\\u0947 \\u0914\\u0930 \\u092e\\u0942\\u0932\\u094d\\u092f\\u093e\\u0902\\u0915\\u0928 \\u0915\\u0930\\u0928\\u0947 \\u092e\\u0947\\u0902 \\u0938\\u0939\\u093e\\u092f\\u0915 \\u0939\\u094b\\u0924\\u093e \\u0939\\u0948\\u0964","ar":"\\u0646\\u0638\\u0631\\u064a\\u0629 \\u0627\\u0644\\u0623\\u062f\\u0628 \\u0648\\u0627\\u0644\\u0646\\u0642\\u062f \\u0647\\u064a \\u0645\\u062c\\u0627\\u0644 \\u062f\\u0631\\u0627\\u0633\\u064a \\u064a\\u0641\\u062d\\u0635 \\u0627\\u0644\\u0623\\u062f\\u0628 \\u0645\\u0646 \\u062e\\u0644\\u0627\\u0644 \\u0645\\u0646\\u0638\\u0648\\u0631\\u0627\\u062a \\u0646\\u0638\\u0631\\u064a\\u0629 \\u0645\\u062e\\u062a\\u0644\\u0641\\u0629 \\u0648\\u0646\\u0647\\u062c \\u0646\\u0642\\u062f\\u064a. \\u064a\\u0633\\u062a\\u0643\\u0634\\u0641 \\u0627\\u0644\\u062a\\u0641\\u0633\\u064a\\u0631 \\u0648\\u0627\\u0644\\u062a\\u062d\\u0644\\u064a\\u0644 \\u0648\\u0627\\u0644\\u062a\\u0642\\u064a\\u064a\\u0645 \\u0644\\u0644\\u0646\\u0635\\u0648\\u0635 \\u0627\\u0644\\u0623\\u062f\\u0628\