                'name' => '{"en":"Searching Algorithms","hi":"\\u0916\\u094b\\u091c \\u090f\\u0932\\u094d\\u0917\\u094b\\u0930\\u093f\\u0925\\u092e","ar":"\\u062e\\u0648\\u0627\\u0631\\u0632\\u0645\\u064a\\u0627\\u062a \\u0627\\u0644\\u0628\\u062d\\u062b"}',
                'description' => '{"en":"Searching Algorithms are a set of methods used to find the presence of a target value within a list or an array. These algorithms vary in efficiency and complexity and can be categorized based on their approach, such as linear search, binary search, or hashing. Searching algorithms play a crucial role in computer science and are used in various applications, including databases, information retrieval systems, and artificial intelligence.","hi":"\\u0916\\u094b\\u091c \\u090f\\u0932\\u094d\\u0917\\u094b\\u0930\\u093f\\u0925\\u092e \\u090f\\u0915 \\u0938\\u0947\\u091f \\u0939\\u0948 \\u091c\\u094b \\u0915\\u093f\\u0938\\u0940 \\u0938\\u0942\\u091a\\u0940 \\u092f\\u093e \\u090f\\u0915 \\u090f\\u0930\\u0947 \\u0915\\u0947 \\u092d\\u0940\\u0924\\u0930 \\u0932\\u0915\\u094d\\u0937\\u094d\\u092f \\u092e\\u093e\\u0928 \\u0915\\u0940 \\u092e\\u094c\\u091c\\u0942\\u0926\\u0917\\u0940 \\u0915\\u094b \\u0916\\u094b\\u091c\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u092a\\u094d\\u0930\\u092f\\u094b\\u0917 \\u0915\\u093f\\u090f \\u091c\\u093e\\u0928\\u0947 \\u0935\\u093e\\u0932\\u0947 \\u0924\\u0930\\u0940\\u0915\\u094b\\u0902 \\u0915\\u093e \\u0938\\u092e\\u0942\\u0939 \\u0939\\u094b\\u0924\\u093e \\u0939\\u0948\\u0964 \\u092f\\u0947 \\u090f\\u0932\\u094d\\u0917\\u094b\\u0930\\u093f\\u0925\\u092e \\u0926\\u0915\\u094d\\u0937\\u0924\\u093e \\u0914\\u0930 \\u091c\\u091f\\u093f\\u0932\\u0924\\u093e \\u092e\\u0947\\u0902 \\u092d\\u093f\\u0928\\u094d\\u0928 \\u0939\\u094b\\u0924\\u0947 \\u0939\\u0948\\u0902 \\u0914\\u0930 \\u0907\\u0938\\u0915\\u093e \\u0935\\u0930\\u094d\\u0917\\u0940\\u0915\\u0930\\u0923 \\u0915\\u093f\\u092f\\u093e \\u091c\\u093e \\u0938\\u0915\\u0924\\u093e \\u0939\\u0948 \\u0909\\u0928\\u0915\\u0947 \\u0926\\u0943\\u0937\\u094d\\u091f\\u093f\\u0915\\u094b\\u0923 \\u0915\\u0947 \\u0906\\u0927\\u093e\\u0930 \\u092a\\u0930, \\u091c\\u0948\\u0938\\u0947 \\u0932\\u0940\\u0928\\u093f\\u092f\\u0930 \\u0916\\u094b\\u091c