                'name' => '{"en":"Graph Algorithms","hi":"\\u0917\\u094d\\u0930\\u093e\\u092b \\u090f\\u0932\\u094d\\u0917\\u094b\\u0930\\u093f\\u0926\\u092e","ar":"\\u062e\\u0648\\u0627\\u0631\\u0632\\u0645\\u064a\\u0627\\u062a \\u0627\\u0644\\u0631\\u0633\\u0645 \\u0627\\u0644\\u0628\\u064a\\u0627\\u0646\\u064a"}',
            'description' => '{"en":"Graph Algorithms are a set of methods used to traverse or manipulate graphs. These algorithms deal with finding paths, cycles, connectivity, and other properties of graphs. Graph algorithms include various techniques such as depth-first search (DFS), breadth-first search (BFS), shortest path algorithms like Dijkstra\'s algorithm, and minimum spanning tree algorithms like Prim\'s and Kruskal\'s algorithms. These algorithms are fundamental in solving problems related to network routing, scheduling, and optimization.","hi":"\\u0917\\u094d\\u0930\\u093e\\u092b \\u090f\\u0932\\u094d\\u0917\\u094b\\u0930\\u093f\\u0926\\u092e \\u090f\\u0915 \\u0938\\u0947\\u091f \\u0939\\u0948 \\u091c\\u094b \\u0917\\u094d\\u0930\\u093e\\u092b \\u0915\\u094b \\u091f\\u094d\\u0930\\u0947\\u0935\\u0930\\u094d\\u0938 \\u092f\\u093e \\u092e\\u0948\\u0928\\u093f\\u092a\\u0941\\u0932\\u0947\\u091f \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u092a\\u094d\\u0930\\u092f\\u094b\\u0917 \\u0915\\u093f\\u090f \\u091c\\u093e\\u0924\\u0947 \\u0939\\u0948\\u0902\\u0964 \\u092f\\u0947 \\u090f\\u0932\\u094d\\u0917\\u094b\\u0930\\u093f\\u0926\\u092e \\u092a\\u0925, \\u091a\\u0915\\u094d\\u0930, \\u0915\\u0928\\u0947\\u0915\\u094d\\u091f\\u093f\\u0935\\u093f\\u091f\\u0940, \\u0914\\u0930 \\u0905\\u0928\\u094d\\u092f \\u0917\\u094d\\u0930\\u093e\\u092b \\u0915\\u0940 \\u0917\\u0941\\u0923\\u0927\\u0930\\u094d\\u092e\\u094b\\u0902 \\u0915\\u0940 \\u0916\\u094b\\u091c \\u0915\\u0947 \\u0938\\u093e\\u0925 \\u0938\\u0902\\u092c\\u0902\\u0927\\u093f\\u0924 \\u0939\\u094b\\u0924\\u0947 \\u0939\\u0948\\u0902\\u0964 \\u0917\\u094d\\u0930\\u093e\\u092b \\u090f\\u0932\\u094d\\u0917\\u094b\\u0930\\u093f\\u0926\\u092e \\u092e\\u0947\\u0902 \\u0917\\u0939\\u0930\\u093e\\u0908 \\u0938\\u0947 \\u0916\\u094b\\u091c (DFS), \\u091a\\u094c\\u0921\\u093c\\u093e\\u0908 \\u0938\\u0947 \\u0916\\u094b\\u091c (BFS), \\u0921\\u093e\\u0907\\u091c\\u094d\\u091f\\u094d\\u0930\\u093e \\u0915\\u0947 \\u090f\\u0932\\u094d\\u0917\\u094b\\u0930\\u093f\\u0926\\u092e \\u091c\\u0948\\u0938\\u0947 \\u0936\\u0949\\u0930\\u094d\\u091f\\u0947\\u0938\\u094d\\u091f \\u092a\\u0925 \\u090f\\u0932\\u094d\\u0917\\u094b\\u0930\\u093f\\u0926\\u092e, \\u0914\\u0930 \\u092a\\u094d\\u0930\\u093f\\u092e\\u094d\\u0938 \\u0914\\u0930 \\u0915\\u094d\\u0930\\u0941\\u0938\\u094d\\u0915\\u0932 \\u0915\\u0947 \\u090f\\u0932\\u094d\\u0917\\u094b\\u0930\\u093f\\u0926\\u092e \\u091c\\u0948\\u0938\\u0947 \\u0928\\u094d\\u092f\\u0942\\u0928\\u0924\\u092e \\u091b\\u093e\\u092f\\u093e \\u0935\\u0943\\u0915\\u094d\\u0937 \\u090f\\u0932\\u094d\\u0917\\u094b\\u0930\\u093f\\u0926\\u092e \\u0936\\u093e\\u092e\\u093f\\u0932 \\u0939\\u094b\\u0924\\u0947 \\u0939\\u0948\\u0902\\u0964 \\u0907\\u0928 \\u090f\\u0932\\u094d\\u0917\\u094b\\u0930\\u093f\\u0926\\u092e \\u0915\\u093e \\u0909\\u092a\\u092f\\u094b\\u0917 \\u0928\\u0947\\u091f\\u0935\\u0930\\u094d\\u0915 \\u0930\\u0942\\u091f\\u093f\\u0902\\u0917, \\u0905\\u0928\\u0941\\u0938\\u0942\\u091a\\u0928\\u093e, \\u0914\\u0930 \\u0905\\u0928\\u0941\\u0915\\u0942\\u0932\\u0928 \\u0938\\u0902\\u092c\\u0902\\u0927\\u093f\\u0924 \\u0938\\u092e\\u0938\\u094d\\u092f\\u093e\\u0913\\u0902 \\u0915\\u094b \\u0939\\u0932 \\u0915\\u0930\\u0928\\u0947 \\u092e\\u0947\\u0902 \\u092e\\u0939\\u0924\\u094d\\u0935\\u092a\\u0942\\u0930\\u094d\\u0923 \\u0939\\u0948\\u0964","ar":"\\u062e\\u0648\\u0627\\u0631\\u0632\\u0645\\u064a\\u0627\\u062a \\u0627\\u0644\\u0631\\u0633\\u0645 \\u0627\\u0644\\u0628\\u064a\\u0627\\u0646\\u064a \\u0647\\u064a \\u0645\\u062c\\u0645\\u0648\\u0639\\u0629 \\u0645\\u0646 \\u0627\\u0644\\u0623\\u0633\\u0627\\u0644\\u064a\\u0628 \\u0627\\u0644\\u0645\\u0633\\u062a\\u062e\\u062f\\u0645\\u0629 \\u0644\\u062a\\u0631\\u0627\\u0641\\u0631 \\u0623\\u0648 \\u062a\\u0644\\u0627\\u0639\\u0628 \\u0627\\u0644\\u0631\\u0633\\u0648\\u0645 \\u0627\\u0644\\u0628\\u064a\\u0627\\u0646\\u064a\\u0629. \\u062a\\u062a\\u0639\\u0627\\u0645\\u0644 \\u0647\\u0630\\u0647 \\u0627\\u0644\\u062e\\u0648\\u0627\\u0631\\u0632\\u0645\\u064a\\u0627\\u062a \\u0645\\u0639 \\u0627\\u0644\\u0639\\u062b\\u0648\\u0631 \\u0639\\u0644\\u0649 \\u0627\\u0644\\u0645\\u0633\\u0627\\u0631\\u0627\\u062a\\u060c \\u0648\\u0627\\u0644\\u062f\\u0648\\u0631\\u0627\\u062a\\u060c \\u0648\\u0627\\u0644\\u062a\\u0648\\u0635\\u064a\\u0644\\u064a\\u0629\\u060c \\u0648\\u062e\\u0635\\u0627\\u0626\\u0635 \\u0623\\u062e\\u0631\\u0649 \\u0644\\u0644\\u0631\\u0633\\u0648\\u0645 \\u0627\\u0644\\u0628\\u064a\\u0627\\u0646\\u064a\\u0629. \\u062a\\u0634\\u0645\\u0644 \\u062e\\u0648\\u0627\\u0631\\u0632\\u0645\\u064a\\u0627\\u062a \\u0627\\u0644\\u0631\\u0633\\u0645 \\u0627\\u0644\\u0628\\u064a\\u0627\\u0646\\u064a \\u062a\\u0642\\u0646\\u064a\\u0627\\u062a \\u0645\\u062e\\u062a\\u0644\\u0641\\u0629 \\u0645\\u062b\\u0644 \\u0627\\u0644\\u0628\\u062d\\u062b \\u0628\\u0627\\u0644\\u0639\\u0645\\u0642 (DFS)\\u060c \\u0648\\u0627\\u0644\\u0628\\u062d\\u062b \\u0628\\u0627\\u0644\\u0639\\u0631\\u0636 (BFS)\\u060c \\u0648\\u062e\\u0648\\u0627\\u0631\\u0632\\u0645\\u064a\\u0627\\u062a \\u0627\\u0644\\u0645\\u0633\\u0627\\u0631 \\u0627\\u0644\\u0623\\u0642\\u0635\\u0631 \\u0645\\u062b\\u0644 \\u062e\\u0648\\u0627\\u0631\\u0632\\u0645\\u064a\\u0629 \\u062f\\u064a\\u0643\\u0633\\u062a\\u0631\\u0627\\u060c \\u0648\\u062e\\u0648\\u0627\\u0631\\u0632\\u0645\\u064a\\u0627\\u062a \\u0627\\u0644\\u0634\\u062c\\u0631\\u0629 \\u0627\\u0644\\u0631\\u0642\\u064a\\u0642\\u0629 \\u0627\\u0644\\u062f\\u0646\\u064a\\u0627 \\u0645\\u062b\\u0644 \\u062e\\u0648\\u0627\\u0631\\u0632\\u0645\\u064a\\u0627\\u062a \\u0628\\u0631\\u064a\\u0645 \\u0648\\u0643\\u0631\\u0648\\u0633\\u0643\\u0627\\u0644. \\u062a\\u0639\\u062a\\u0628\\u0631 \\u0647\\u0630\\u0647 \\u0627\\u0644\\u062e\\u0648\\u0627\\u0631\\u0632\\u0645\\u064a\\u0627\\u062a \\u0623\\u0633\\u0627\\u0633\\u064a\\u0629 \\u0641\\u064a \\u062d\\u0644 \\u0627\\u0644\\u0645\\u0634\\u0627\\u0643\\u0644 \\u0627\\u0644\\u0645\\u062a\\u0639\\u0644\\u0642\\u0629 \\u0628\\u062a\\u0648\\u062c\\u064a\\u0647 \\u0627\\u0644\\u0634\\u0628\\u0643\\u0629\\u060c \\u0648\\u0627\\u0644\\u062c\\u062f\\u0648\\u0644\\u0629\\u060c \\u0648\\u0627\\u0644\\u062a\\u062d\\u0633\\u064a\\u0646"}',
