            'description' => '{"en":"Tree Algorithms are a set of methods used to manipulate and analyze tree data structures. These algorithms deal with tasks such as traversal, insertion, deletion, and searching within trees. Common tree algorithms include depth-first search (DFS), breadth-first search (BFS), tree traversal algorithms like inorder, preorder, and postorder traversal, as well as algorithms for balancing trees like AVL trees and Red-Black trees. Tree algorithms are fundamental in computer science and are used in various applications including data storage, parsing, and hierarchical data representation.","hi":"\\u091f\\u094d\\u0930\\u0940 \\u090f\\u0932\\u094d\\u0917\\u094b\\u0930\\u093f\\u0926\\u092e \\u090f\\u0915 \\u0938\\u0947\\u091f \\u0939\\u0948 \\u091c\\u094b \\u091f\\u094d\\u0930\\u0940 \\u0921\\u0947\\u091f\\u093e \\u0938\\u0902\\u0930\\u091a\\u0928\\u093e\\u0913\\u0902 \\u0915\\u094b \\u092e\\u0948\\u0928\\u093f\\u092a\\u0941\\u0932\\u0947\\u091f \\u0914\\u0930 \\u0935\\u093f\\u0936\\u094d\\u0932\\u0947\\u0937\\u0923 \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u092a\\u094d\\u0930\\u092f\\u094b\\u0917 \\u0915\\u093f\\u090f \\u091c\\u093e\\u0924\\u0947 \\u0939\\u0948\\u0902\\u0964 \\u092f\\u0947 \\u090f\\u0932\\u094d\\u0917\\u094b\\u0930\\u093f\\u0926\\u092e \\u091f\\u094d\\u0930\\u0940 \\u0915\\u0947 \\u092d\\u0940\\u0924\\u0930 \\u091f\\u094d\\u0930\\u093e\\u0935\\u0930\\u094d\\u0938\\u0932, \\u0907\\u0902\\u0938\\u0930\\u094d\\u0936\\u0928, \\u0921\\u093f\\u0932\\u0940\\u0936\\u0928, \\u0914\\u0930 \\u0916\\u094b\\u091c \\u091c\\u0948\\u0938\\u0947 \\u0915\\u093e\\u0930\\u094d\\u092f\\u094b\\u0902 \\u0938\\u0947 \\u0938\\u0902\\u092c\\u0902\\u0927\\u093f\\u0924 \\u0939\\u094b\\u0924\\u0947 \\u0939\\u0948\\u0902\\u0964 \\u0938\\u093e\\u092e\\u093e\\u0928\\u094d\\u092f \\u091f\\u094d\\u0930\\u0940 \\u090f\\u0932\\u094d\\u0917\\u094b\\u0930\\u093f\\u0926\\u092e \\u092e\\u0947\\u0902 \\u0917\\u0939\\u0930\\u093e\\u0908 