                'description' => '{"en":"Dynamic Programming is a method for solving complex problems by breaking them down into simpler subproblems and solving each subproblem only once, storing the solutions to avoid redundant computations. It involves solving overlapping subproblems and is typically used for optimization problems, where the objective is to find the best solution among many possible solutions. Dynamic Programming is widely used in various fields such as computer science, operations research, and economics.","hi":"\\u0917\\u0924\\u093f\\u0936\\u0940\\u0932 \\u092a\\u094d\\u0930\\u094b\\u0917\\u094d\\u0930\\u093e\\u092e\\u093f\\u0902\\u0917 \\u090f\\u0915 \\u0935\\u093f\\u0915\\u0947\\u0902\\u0926\\u094d\\u0930\\u0940\\u0915\\u0930\\u0923 \\u0915\\u093e \\u0924\\u0930\\u0940\\u0915\\u093e \\u0939\\u0948 \\u091c\\u093f\\u0938\\u0915\\u093e \\u0909\\u092a\\u092f\\u094b\\u0917 \\u0938\\u0902\\u0936\\u094b\\u0927\\u0928\\u0940\\u092f \\u0938\\u092e\\u0938\\u094d\\u092f\\u093e\\u0913\\u0902 \\u0915\\u094b \\u0939\\u0932 \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0915\\u093f\\u092f\\u093e \\u091c\\u093e\\u0924\\u093e \\u0939\\u0948, \\u091c\\u093f\\u0928\\u094d\\u0939\\u0947\\u0902 \\u0906\\u0938\\u093e\\u0928 \\u0938\\u092c\\u0938\\u092e\\u0938\\u094d\\u092f\\u093e\\u0913\\u0902 \\u092e\\u0947\\u0902 \\u0935\\u093f\\u092d\\u093e\\u091c\\u093f\\u0924 \\u0915\\u093f\\u092f\\u093e \\u091c\\u093e\\u0924\\u093e \\u0939\\u0948 \\u0914\\u0930 \\u092a\\u094d\\u0930\\u0924\\u094d\\u092f\\u0947\\u0915 \\u0938\\u092c\\u0938\\u092e\\u0938\\u094d\\u092f\\u093e \\u0915\\u094b \\u0915\\u0947\\u0935\\u0932 \\u090f\\u0915 \\u092c\\u093e\\u0930 \\u0939\\u0932 \\u0915\\u093f\\u092f\\u093e \\u091c\\u093e\\u0924\\u093e \\u0939\\u0948, \\u0932\\u093e\\u092a\\u0924\\u093e \\u0917\\u0923\\u0928\\u093e \\u0915\\u094b \\u092c\\u091a\\u093e\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0938\\u092e\\u093e\\u0927\\u093e\\u0928 \\u0938\\u0902\\u0917\