            'description' => '{"en":"Network Security refers to the measures taken to protect computer networks and data from unauthorized access, cyberattacks, or other security breaches. It involves implementing various technologies, policies, and procedures to ensure the confidentiality, integrity, and availability of network resources. Network security measures include firewalls, intrusion detection systems (IDS), encryption, authentication mechanisms, access control lists (ACLs), and regular security audits. Network security is essential for safeguarding sensitive information and maintaining the smooth operation of networks in organizations.","hi":"\\u0928\\u0947\\u091f\\u0935\\u0930\\u094d\\u0915 \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e \\u0909\\u0928 \\u0909\\u092a\\u093e\\u092f\\u094b\\u0902 \\u0915\\u094b \\u0938\\u0902\\u0926\\u0930\\u094d\\u092d\\u093f\\u0924 \\u0915\\u0930\\u0924\\u0940 \\u0939\\u0948 \\u091c\\u093f\\u0928\\u094d\\u0939\\u0947\\u0902 \\u0905\\u0928\\u0927\\u093f\\u0915\\u0943\\u0924 \\u092a\\u0939\\u0941\\u0902\\u091a, \\u0938\\u093e\\u0907\\u092c\\u0930 \\u0939\\u092e\\u0932\\u094b\\u0902, \\u092f\\u093e \\u0905\\u0928\\u094d\\u092f \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e \\u0909\\u0932\\u094d\\u0932\\u0902\\u0918\\u0928\\u094b\\u0902 \\u0938\\u0947 \\u0915\\u0902\\u092a\\u094d\\u092f\\u0942\\u091f\\u0930 \\u0928\\u0947\\u091f\\u0935\\u0930\\u094d\\u0915 \\u0914\\u0930 \\u0921\\u0947\\u091f\\u093e \\u0915\\u094b \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093f\\u0924 \\u0930\\u0916\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0915\\u093f\\u090f \\u091c\\u093e\\u0924\\u0947 \\u0939\\u0948\\u0902\\u0964 \\u0907\\u0938\\u092e\\u0947\\u0902 \\u0928\\u0947\\u091f\\u0935\\u0930\\u094d\\u0915 \\u0938\\u0902\\u0938\\u093e\\u0927\\u0928\\u094b\\u0902 \\u0915\\u0940 \\u0917\\u094b\\u092a\\u0928\\u0940\\u092f\\u0924\\u093e, \\u0938\\u0924\\u094d\\u092f\\u093e\\u092a\\u0928 \\u0914\\u0930 \\u0909\\u092a\\u0932\\u092c\\u094d\\u0927\\u0924\\u093e \\u0938\\u0941\\u0928\\u093f\\u0936\\u094d\\u091a\\u093f\\u0924 \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0935\\u093f\\u092d\\u093f\\u0928\\u094d\\u0928 \\u092a\\u094d\\u0930\\u094c\\u0926\\u094d\\u092f\\u094b\\u0917\\u093f\\u0915\\u093f\\u092f\\u094b\\u0902, \\u0928\\u0940\\u0924\\u093f\\u092f\\u094b\\u0902, \\u0914\\u0930 \\u092a\\u094d\\u0930\\u0915\\u094d\\u0930\\u093f\\u092f\\u093e\\u0913\\u0902 \\u0915\\u094b \\u0932\\u093e\\u0917\\u0942 \\u0915\\u0930\\u0928\\u093e \\u0936\\u093e\\u092e\\u093f\\u0932 \\u0939\\u0948\\u0964 \\u0928\\u0947\\u091f\\u0935\\u0930\\u094d\\u0915 \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e \\u0909\\u092a\\u093e\\u092f \\u092e\\u0947\\u0902 \\u092b\\u093e\\u092f\\u0930\\u0935\\u0949\\u0932, \\u092a\\u094d\\u0930\\u0935\\u0947\\u0936 \\u092a\\u0939\\u091a\\u093e\\u0928 \\u092a\\u094d\\u0930\\u0923\\u093e\\u0932\\u0940 (IDS), \\u090f\\u0928\\u094d\\u0915\\u094d\\u0930\\u093f\\u092a\\u094d\\u0936\\u0928, \\u092a\\u094d\\u0930\\u092e\\u093e\\u0923\\u0940\\u0915\\u0930\\u0923 \\u0924\\u0902\\u0924\\u094d\\u0930, \\u092a\\u0939\\u0941\\u0902\\u091a \\u0928\\u093f\\u092f\\u0902\\u0924\\u094d\\u0930\\u0923 \\u0938\\u0942\\u091a\\u093f\\u092f\\u094b\\u0902 (ACLs), \\u0914\\u0930 \\u0928\\u093f\\u092f\\u092e\\u093f\\u0924 \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e \\u092e\\u0941\\u0906\\u092f\\u0928\\u0940 \\u0936\\u093e\\u092e\\u093f\\u0932 \\u0939\\u094b\\u0924\\u0947 \\u0939\\u0948\\u0902\\u0964 \\u0928\\u0947\\u091f\\u0935\\u0930\\u094d\\u0915 \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e \\u0938\\u0902\\u0917\\u0920\\u0928\\u094b\\u0902 \\u092e\\u0947\\u0902 \\u0938\\u0902\\u0935\\u0947\\u0926\\u0928\\u0936\\u0940\\u0932 \\u091c\\u093e\\u0928\\u0915\\u093e\\u0930\\u0940 \\u0915\\u0940 \\u0930\\u0915\\u094d\\u0937\\u093e \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0914\\u0930 \\u0928\\u0947\\u091f\\u0935\\u0930\\u094d\\u0915\\u094b\\u0902 \\u0915\\u0947 \\u0938\\u0902\\u091a\\u093e\\u0932\\u0928 \\u0915\\u094b \\u0938\\u0941\\u0917\\u092e \\u092c\\u0928\\u093e\\u090f \\u0930\\u0916\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0905\\u0924\\u094d\\u092f\\u0902\\u0924 \\u092e\\u0939\\u0924\\u094d\\u0935\\u092a\\u0942\\u0930\\u094d\\u0923 \\u0939\\u0948\\u0964","ar":"\\u064a\\u0634\\u064a\\u0631 \\u0623\\u0645\\u0627\\u0646 \\u0627\\u0644\\u0634\\u0628\\u0643\\u0627\\u062a \\u0625\\u0644\\u0649 \\u0627\\u0644\\u062a\\u062f\\u0627\\u0628\\u064a\\u0631 \\u0627\\u0644\\u0645\\u062a\\u062e\\u0630\\u0629 \\u0644\\u062d\\u0645\\u0627\\u064a\\u0629 \\u0627\\u0644\\u0634\\u0628\\u0643\\u0627\\u062a \\u0627\\u0644\\u062d\\u0627\\u0633\\u0648\\u0628\\u064a\\u0629 \\u0648\\u0627\\u0644\\u0628\\u064a\\u0627\\u0646\\u0627\\u062a \\u0645\\u0646 \\u0627\\u0644\\u0648\\u0635\\u0648\\u0644 \\u063a\\u064a\\u0631 \\u0627\\u0644\\u0645\\u0635\\u0631\\u062d \\u0628\\u0647\\u060c \\u0648\\u0627\\u0644\\u0647\\u062c\\u0645\\u0627\\u062a \\u0627\\u0644\\u0633\\u064a\\u0628\\u0631\\u0627\\u0646\\u064a\\u0629\\u060c \\u0623\\u0648 \\u0623\\u064a \\u0627\\u0646\\u062a\\u0647\\u0627\\u0643\\u0627\\u062a \\u0623\\u0645\\u0646\\u064a\\u0629 \\u0623\\u062e\\u0631\\u0649. \\u064a\\u062a\\u0636\\u0645\\u0646 \\u0630\\u0644\\u0643 \\u062a\\u0646\\u0641\\u064a\\u0630 \\u0645\\u062e\\u062a\\u0644\\u0641 \\u0627\\u0644\\u062a\\u0642\\u0646\\u064a\\u0627\\u062a \\u0648\\u0627\\u0644\\u0633\\u064a\\u0627\\u0633\\u0627\\u062a \\u0648\\u0627\\u0644\\u0625\\u062c\\u0631\\u0627\\u0621\\u0627\\u062a \\u0644\\u0636\\u0645\\u0627\\u0646 \\u0633\\u0631\\u064a\\u0629 \\u0648\\u0633\\u0644\\u0627\\u0645\\u0629 \\u0648\\u062a\\u0648\\u0627\\u0641\\u0631 \\u0645\\u0648\\u0627\\u0631\\u062f \\u0627\\u0644\\u0634\\u0628\\u0643\\u0629. \\u062a\\u062a\\u0636\\u0645\\u0646 \\u062a\\u062f\\u0627\\u0628\\u064a\\u0631 \\u0623\\u0645\\u0627\\u0646 \\u0627\\u0644\\u0634\\u0628\\u0643\\u0627\\u062a \\u062c\\u062f\\u0631\\u0627\\u0646 \\u0627\\u0644\\u062d\\u0645\\u0627\\u064a\\u0629\\u060c \\u0623\\u0646\\u0638\\u0645\\u0629 \\u0627\\u0644\\u0643\\u0634\\u0641 \\u0639\\u0646 \\u0627\\u0644\\u0627\\u062e\\u062a\\u0631\\u0627\\u0642 (IDS)\\u060c \\u0627\\u0644\\u062a\\u0634\\u0641\\u064a\\u0631\\u060c \\u0622\\u0644\\u064a\\u0627\\u062a \\u0627\\u0644\\u0645\\u0635\\u0627\\u062f\\u0642\\u0629\\u060c \\u0642\\u0648\\u0627\\u0626\\u0645 \\u0627\\u0644\\u062a\\u062d\\u0643\\u0645 \\u0641\\u064a \\u0627\\u0644\\u0648\\u0635\\u0648\\u0644 (ACLs)\\u060c \\u0648\\u0627\\u0644\\u062a\\u062f\\u0642\\u064a\\u0642\\u0627\\u062a \\u0627\\u0644\\u0623\\u0645\\u0646\\u064a\\u0629 \\u0627\\u0644\\u062f\\u0648\\u0631\\u064a\\u0629. \\u064a\\u0639\\u062a\\u0628\\u0631 \\u0623\\u0645\\u0627\\u0646 \\u0627\\u0644\\u0634\\u0628\\u0643\\u0627\\u062a \\u0623\\u0633\\u0627\\u0633\\u064a\\u064b\\u0627 \\u0644\\u062d\\u0645\\u0627\\u064a\\u0629 \\u0627\\u0644\\u0645\\u0639\\u0644\\u0648\\u0645\\u0627\\u062a \\u0627\\u0644\\u062d\\u0633\\u0627\\u0633\\u0629 \\u0648\\u0636\\u0645\\u0627\\u0646 \\u0633\\u064a\\u0631 \\u0627\\u0644\\u0634\\u0628\\u0643\\u0627\\u062a \\u0628\\u0633\\u0644\\u0627\\u0633\\u0629 \\u0641\\u064a \\u0627\\u0644\\u0645\\u0624\\u0633\\u0633\\u0627\\u062a."}',
