            array (
                'id' => 107,
                'name' => '{"en":"Endpoint Security","hi":"\\u0905\\u0902\\u0924 \\u092a\\u094b\\u0907\\u0902\\u091f \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e","ar":"\\u0623\\u0645\\u0627\\u0646 \\u0627\\u0644\\u0646\\u0642\\u0637\\u0629 \\u0627\\u0644\\u0646\\u0647\\u0627\\u0626\\u064a\\u0629"}',
            'description' => '{"en":"Endpoint Security refers to the protection of endpoints or end-user devices such as laptops, desktops, mobile devices, and servers from cybersecurity threats. It involves securing these devices by implementing various measures like antivirus software, firewalls, intrusion detection systems (IDS), encryption, and endpoint detection and response (EDR) solutions. Endpoint security aims to prevent unauthorized access, data breaches, malware infections, and other cyberattacks that may target endpoints. It plays a crucial role in ensuring the overall security posture of an organization\'s IT infrastructure.","hi":"\\u0905\\u0902\\u0924 \\u092a\\u094b\\u0907\\u0902\\u091f \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e \\u0909\\u0928 \\u0905\\u0902\\u0924 \\u092a\\u094d\\u0930\\u092f\\u094b\\u0917\\u0915\\u0930\\u094d\\u0924\\u093e \\u092f\\u093e \\u0905\\u0902\\u0924-\\u0909\\u092a\\u0915\\u0930\\u0923\\u094b\\u0902 \\u0915\\u0940 \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e \\u0938\\u0947 \\u0938\\u0902\\u092c\\u0902\\u0927\\u093f\\u0924 \\u0939\\u094b\\u0924\\u0940 \\u0939\\u0948, \\u091c\\u0948\\u0938\\u0947 \\u0932\\u0948\\u092a\\u091f\\u0949\\u092a, \\u0921\\u0947\\u0938\\u094d\\u0915\\u091f\\u0949\\u092a, \\u092e\\u094b\\u092c\\u093e\\u0907\\u0932 \\u0909\\u092a\\u0915\\u0930\\u0923, \\u0914\\u0930 \\u0938\\u0930\\u094d\\u0935\\u0930, \\u0938\\u093e\\u0907\\u092c\\u0930 \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e \\u0938\\u0902\\u0915\\u091f\\u094b\\u0902 \\u0938\\u0947\\u0964 \\u0907\\u0938\\u092e\\u0947\\u0902 \\u0907\\u0928 \\u0909\\u092a\\u0915\\u0930\\u0923\\u094b\\u0902 \\u0915\\u094b \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093f\\u0924 \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0935\\u093f\\u092d\\u093f\\u0928\\u094d\\u0928 \\u0909\\u092a\\u093e\\u092f\\u094b\\u0902 \\u0915\\u094b \\u0932\\u093e\\u0917\\u0942 \\u0915\\u0930\\u0915\\u0947 \\u0936\\u093e\\u092e\\u093f\\u0932 \\u0939\\u094b\\u0924\\u093e \\u0939\\u0948, \\u091c\\u0948\\u0938\\u0947 \\u090f\\u0902\\u091f\\u0940\\u0935\\u093e\\u092f\\u0930\\u0938 \\u0938\\u0949\\u092b\\u093c\\u094d\\u091f\\u0935\\u0947\\u092f\\u0930, \\u092b\\u093c\\u093e\\u092f\\u0930\\u0935\\u0949\\u0932, \\u0905\\u0924\\u093f\\u0915\\u094d\\u0930\\u092e\\u0923 \\u0921\\u093f\\u091f\\u0947\\u0915\\u094d\\u0936\\u0928 \\u092a\\u094d\\u0930\\u0923\\u093e\\u0932\\u093f\\u092f\\u093e\\u0901 (IDS), \\u090f\\u0928\\u094d\\u0915\\u094d\\u0930\\u093f\\u092a\\u094d\\u0936\\u0928, \\u0914\\u0930 \\u0905\\u0902\\u0924 \\u092a\\u094b\\u0907\\u0902\\u091f \\u092a\\u0939\\u091a\\u093e\\u0928 \\u0914\\u0930 \\u092a\\u094d\\u0930\\u0924\\u093f\\u0915\\u094d\\u0930\\u093f\\u092f\\u093e (EDR) \\u0938\\u092e\\u093e\\u0927\\u093e\\u0928\\u0964 \\u0905\\u0902\\u0924 \\u092a\\u094b\\u0907\\u0902\\u091f \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e \\u0915\\u093e \\u0909\\u0926\\u094d\\u0926\\u0947\\u0936\\u094d\\u092f \\u0905\\u0928\\u0927\\u093f\\u0915\\u0943\\u0924 \\u092a\\u0939\\u0941\\u0902\\u091a, \\u0921\\u0947\\u091f\\u093e \\u0909\\u0932\\u094d\\u0932\\u0902\\u0918\\u0928, \\u092e\\u0948\\u0932\\u0935\\u0947\\u092f\\u0930 \\u0938\\u0902\\u0915\\u094d\\u0930\\u092e\\u0923, \\u0914\\u0930 \\u0905\\u0928\\u094d\\u092f \\u0938\\u093e\\u0907\\u092c\\u0930 \\u0939\\u092e\\u0932\\u094b\\u0902 \\u0915\\u094b \\u0930\\u094b\\u0915\\u0928\\u093e \\u0939\\u0948 \\u091c\\u094b \\u0905\\u0902\\u0924-\\u092a\\u094b\\u0907\\u0902\\u091f \\u0915\\u094b \\u0932\\u0915\\u094d\\u0937\\u094d\\u092f \\u092c\\u0928\\u093e \\u0938\\u0915\\u0924\\u0947 \\u0939\\u0948\\u0902\\u0964 \\u0907\\u0938\\u0915\\u093e \\u092e\\u0939\\u0924\\u094d\\u0935\\u092a\\u0942\\u0930\\u094d\\u0923 \\u092f\\u094b\\u0917\\u0926\\u093e\\u0928 \\u0939\\u0948 \\u090f\\u0915 \\u0938\\u0902\\u0917\\u0920\\u0928 \\u0915\\u0940 \\u0906\\u0908\\u091f\\u0940 \\u092c\\u0941\\u0928\\u093f\\u092f\\u093e\\u0926\\u0940 \\u0922\\u093e\\u0902\\u091a\\u0947 \\u0915\\u0940 \\u0915\