                'name' => '{"en":"Data Security","hi":"\\u0921\\u0947\\u091f\\u093e \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e","ar":"\\u0623\\u0645\\u0627\\u0646 \\u0627\\u0644\\u0628\\u064a\\u0627\\u0646\\u0627\\u062a"}',
                'description' => '{"en":"Data Security refers to the protection of digital data from unauthorized access, corruption, or theft throughout its lifecycle. It encompasses various measures and techniques to ensure the confidentiality, integrity, and availability of data. Data security includes implementing encryption, access controls, authentication mechanisms, backup and recovery procedures, and security policies and protocols. It aims to prevent data breaches, unauthorized data access, data loss, and data leakage. Data security is crucial for safeguarding sensitive information and maintaining trust with customers and stakeholders.","hi":"\\u0921\\u0947\\u091f\\u093e \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e \\u0909\\u0928 \\u0909\\u092a\\u093e\\u092f\\u094b\\u0902 \\u0915\\u094b \\u0938\\u0902\\u0926\\u0930\\u094d\\u092d\\u093f\\u0924 \\u0915\\u0930\\u0924\\u0940 \\u0939\\u0948 \\u091c\\u093f\\u0928\\u0938\\u0947 \\u0921\\u093f\\u091c\\u093f\\u091f\\u0932 \\u0921\\u0947\\u091f\\u093e \\u0915\\u094b \\u0905\\u0928\\u0927\\u093f\\u0915\\u0943\\u0924 \\u092a\\u0939\\u0941\\u0902\\u091a, \\u092d\\u094d\\u0930\\u0937\\u094d\\u091f\\u093e\\u091a\\u093e\\u0930, \\u092f\\u093e \\u091a\\u094b\\u0930\\u0940 \\u0938\\u0947 \\u092c\\u091a\\u093e\\u092f\\u093e \\u091c\\u093e\\u0924\\u093e \\u0939\\u0948 \\u0909\\u0938\\u0915\\u0947 \\u091c\\u0940\\u0935\\u0928\\u0915\\u093e\\u0932 \\u0915\\u0947 \\u0926\\u094c\\u0930\\u093e\\u0928\\u0964 \\u092f\\u0939 \\u0921\\u0947\\u091f\\u093e \\u0915\\u0940 \\u0917\\u094b\\u092a\\u0928\\u0940\\u092f\\u0924\\u093e, \\u0905\\u0916\\u0902\\u0921\\u0924\\u093e, \\u0914\\u0930 \\u0909\\u092a\\u0932\\u092c\\u094d\\u0927\\u0924\\u093e \\u0915\\u094b \\u0938\\u0941\\u0928\\u093f\\u0936\\u094d\\u091a\\u093f\\u0924 \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0935\\u093f\\u092d\\u093f\\u0928\\u094d\\u0928 \\u0909\\u092a\\u093e\\u092f\\u094b\\u0902 \\u0914\\u0930 \\u0924\\u0915\\u0928\\u0940\\u0915\\u094b\\u0902 \\u0915\\u094b \\u0936\\u093e\\u092e\\u093f\\u0932 \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948\\u0964 \\u0921\\u0947\\u091f\\u093e \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e \\u092e\\u0947\\u0902 \\u090f\\u0928\\u094d\\u0915\\u094d\\u0930\\u093f\\u092a\\u094d\\u0936\\u0928, \\u092a\\u0939\\u0941\\u0902\\u091a \\u0928\\u093f\\u092f\\u0902\\u0924\\u094d\\u0930\\u0923, \\u092a\\u094d\\u0930\\u092e\\u093e\\u0923\\u0940\\u0915\\u0930\\u0923 \\u092e\\u0947\\u0915\\u0947\\u0928\\u093f\\u091c\\u093c\\u094d\\u092e, \\u092c\\u0948\\u0915\\u0905\\u092a \\u0914\\u0930 \\u092c\\u0939\\u093e\\u0932\\u0940 \\u092a\\u094d\\u0930\\u0915\\u094d\\u0930\\u093f\\u092f\\u093e\\u090f\\u0901, \\u0914\\u0930 \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e \\u0928\\u0940\\u0924\\u093f\\u092f\\u094b\\u0902 \\u0914\\u0930 \\u092a\\u094d\\u0930\\u094b\\u091f\\u094b\\u0915\\u0949\\u0932\\u094d\\u0938 \\u0915\\u094b \\u0932\\u093e\\u0917\\u0942 \\u0915\\u0930\\u0928\\u093e \\u0936\\u093e\\u092e\\u093f\\u0932 \\u0939\\u0948\\u0964 \\u0907\\u0938\\u0915\\u093e \\u0909\\u0926\\u094d\\u0926\\u0947\\u0936\\u094d\\u092f \\u0921\\u0947\\u091f\\u093e \\u0909\\u0932\\u094d\\u0932\\u0902\\u0918\\u0928, \\u0905\\u0928\\u0927\\u093f\\u0915\\u0943\\u0924 \\u0921\\u0947\\u091f\\u093e \\u092a\\u0939\\u0941\\u0902\\u091a, \\u0921\\u0947\\u091f\\u093e \\u0939\\u093e\\u0928\\u093f, \\u0914\\u0930 \\u0921\\u0947\\u091f\\u093e \\u0932\\u0940\\u0915\\u0947\\u091c\\u093c \\u0938\\u0947 \\u092c\\u091a\\u0928\\u093e \\u0939\\u0948\\u0964 \\u0921\\u0947\\u091f\\u093e \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e \\u0938\\u0902\\u0935\\u0947\\u0926\\u0928\\u0936\\u0940\\u0932 \\u091c\\u093e\\u0928\\u0915\\u093e\\u0930\\u0940 \\u0915\\u0940 \\u0930\\u0915\\u094d\\u0937\\u093e \\u0915\\u0947 \\u0932\\u093f\\u090f \\u092e\\u0939\\u0924\\u094d\\u0935\\u092a\\u0942\\u0930\\u094d\\u0923 \\u0939\\u0948 \\u0914\\u0930 \\u0917\\u094d\\u0930\\u093e\\u0939\\u0915\\u094b\\u0902 \\u0914\\u0930 \\u0939\\u093f\\u0924