                'name' => '{"en":"Application Security","hi":"\\u090f\\u092a\\u094d\\u0932\\u093f\\u0915\\u0947\\u0936\\u0928 \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e","ar":"\\u0623\\u0645\\u0627\\u0646 \\u0627\\u0644\\u062a\\u0637\\u0628\\u064a\\u0642\\u0627\\u062a"}',
                'description' => '{"en":"Application Security refers to the measures taken to protect software applications from security threats throughout their development lifecycle. It involves identifying, fixing, and preventing security vulnerabilities and weaknesses that could be exploited by attackers to compromise the confidentiality, integrity, or availability of the application or its data. Application security practices include secure coding practices, penetration testing, vulnerability assessments, code reviews, and the use of security tools and technologies. Ensuring robust application security is essential for mitigating risks and maintaining the trust of users and stakeholders.","hi":"\\u090f\\u092a\\u094d\\u0932\\u093f\\u0915\\u0947\\u0936\\u0928 \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e \\u0909\\u0928 \\u0909\\u092a\\u093e\\u092f\\u094b\\u0902 \\u0915\\u094b \\u0938\\u0902\\u0926\\u0930\\u094d\\u092d\\u093f\\u0924 \\u0915\\u0930\\u0924\\u0940 \\u0939\\u0948 \\u091c\\u094b \\u0938\\u0949\\u092b\\u093c\\u094d\\u091f\\u0935\\u0947\\u092f\\u0930 \\u090f\\u092a\\u094d\\u0932\\u093f\\u0915\\u0947\\u0936\\u0928 \\u0915\\u094b \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e \\u0938\\u0902\\u0915\\u091f\\u094b\\u0902 \\u0938\\u0947 \\u0938\\u0902\\u0930\\u0915\\u094d\\u0937\\u093f\\u0924 \\u0930\\u0916\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0909\\u0928\\u0915\\u0947 \\u0935\\u093f\\u0915\\u093e\\u0938 \\u091c\\u0940\\u0935\\u0928\\u0915\\u093e\\u0932 \\u0915\\u0947 \\u0926\\u094c\\u0930\\u093e\\u0928 \\u0905\\u092a\\u0928\\u093e\\u090f \\u091c\\u093e\\u0924\\u0947 \\u0939\\u0948\\u0902\\u0964 \\u092f\\u0939 \\u0909\\u0928 \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e \\u0916\\u093e\\u092e\\u093f\\u092f\\u094b\\u0902 \\u0914\\u0930 \\u0915\\u092e\\u091c\\u094b\\u0930\\u093f\\u092f\\u094b\\u0902 \\u0915\\u094b \\u092a\\u0939\\u091a\\u093e\\u0928\\u0928\\u093e, \\u0938\\u0941\\u0927\\u093e\\u0930\\u0928\\u093e, \\u0914\\u0930 \\u09