u0623\\u062b\\u064a\\u0631 \\u0639\\u0644\\u0649 \\u0633\\u0631\\u064a\\u0629 \\u0623\\u0648 \\u0633\\u0644\\u0627\\u0645\\u0629 \\u0623\\u0648 \\u062a\\u0648\\u0641\\u0631 \\u0627\\u0644\\u062a\\u0637\\u0628\\u064a\\u0642 \\u0623\\u0648 \\u0628\\u064a\\u0627\\u0646\\u0627\\u062a\\u0647. \\u062a\\u0634\\u0645\\u0644 \\u0645\\u0645\\u0627\\u0631\\u0633\\u0627\\u062a \\u0623\\u0645\\u0627\\u0646 \\u0627\\u0644\\u062a\\u0637\\u0628\\u064a\\u0642\\u0627\\u062a \\u0645\\u0645\\u0627\\u0631\\u0633\\u0627\\u062a \\u0627\\u0644\\u0628\\u0631\\u0645\\u062c\\u0629 \\u0627\\u0644\\u0622\\u0645\\u0646\\u0629 \\u0648\\u0627\\u062e\\u062a\\u0628\\u0627\\u0631 \\u0627\\u0644\\u0627\\u062e\\u062a\\u0631\\u0627\\u0642 \\u0648\\u062a\\u0642\\u064a\\u064a\\u0645 \\u0627\\u0644\\u062b\\u063a\\u0631\\u0627\\u062a \\u0648\\u0645\\u0631\\u0627\\u062c\\u0639\\u0629 \\u0627\\u0644\\u0634\\u0641\\u0631\\u0629 \\u0648\\u0627\\u0633\\u062a\\u062e\\u062f\\u0627\\u0645 \\u0623\\u062f\\u0648\\u0627\\u062a \\u0648\\u062a\\u0642\\u0646\\u064a\\u0627\\u062a \\u0627\\u0644\\u0623\\u0645\\u0627\\u0646. \\u064a\\u0639\\u062f \\u0636\\u0645\\u0627\\u0646 \\u0623\\u0645\\u0627\\u0646 \\u0627\\u0644\\u062a\\u0637\\u0628\\u064a\\u0642\\u0627\\u062a \\u0627\\u0644\\u0642\\u0648\\u064a \\u0623\\u0645\\u0631\\u064b\\u0627 \\u0623\\u0633\\u0627\\u0633\\u064a\\u064b\\u0627 \\u0644\\u062a\\u0642\\u0644\\u064a\\u0644 \\u0627\\u0644\\u0645\\u062e\\u0627\\u0637\\u0631 \\u0648\\u0627\\u0644\\u062d\\u0641\\u0627\\u0638 \\u0639\\u0644\\u0649 \\u062b\\u0642\\u0629 \\u0627\\u0644\\u0645\\u0633\\u062a\\u062e\\u062f\\u0645\\u064a\\u0646 \\u0648\\u0627\\u0644\\u0623\\u0637\\u0631\\u0627\\u0641 \\u0627\\u0644\\u0645\\u0639\\u0646\\u064a\\u0629."}',
