                'name' => '{"en":"Cloud Security","hi":"\\u0915\\u094d\\u0932\\u093e\\u0909\\u0921 \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e","ar":"\\u0623\\u0645\\u0627\\u0646 \\u0627\\u0644\\u0633\\u062d\\u0627\\u0628\\u0629"}',
                'description' => '{"en":"Cloud Security refers to the protection of data, applications, and infrastructure hosted on cloud computing platforms from cyber threats and unauthorized access. It involves implementing various security measures, including access controls, encryption, identity management, and network security, to ensure the confidentiality, integrity, and availability of cloud resources. Cloud security also encompasses compliance with regulatory requirements and industry standards, as well as continuous monitoring and incident response to detect and mitigate security risks. With the increasing adoption of cloud services, robust cloud security measures are essential to safeguard sensitive information and maintain trust with users and stakeholders.","hi":"\\u0915\\u094d\\u0932\\u093e\\u0909\\u0921 \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e \\u0915\\u094b \\u0938\\u093e\\u0907\\u092c\\u0930 \\u0916\\u0924\\u0930\\u094b\\u0902 \\u0914\\u0930 \\u0905\\u0928\\u0927\\u093f\\u0915\\u0943\\u0924 \\u092a\\u0939\\u0941\\u0902\\u091a \\u0938\\u0947 \\u0915\\u094d\\u0932\\u093e\\u0909\\u0921 \\u0915\\u0902\\u092a\\u094d\\u092f\\u0942\\u091f\\u093f\\u0902\\u0917 \\u092a\\u094d\\u0932\\u0947\\u091f\\u092b\\u093c\\u0949\\u0930\\u094d\\u092e \\u092a\\u0930 \\u0939\\u094b\\u0938\\u094d\\u091f \\u0915\\u093f\\u090f \\u0917\\u090f \\u0921\\u0947\\u091f\\u093e, \\u090f\\u092a\\u094d\\u0932\\u093f\\u0915\\u0947\\u0936\\u0928, \\u0914\\u0930 \\u0905\\u0935\\u0938\\u0902\\u0930\\u091a\\u0928\\u093e \\u0915\\u0940 \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e \\u0938\\u0902\\u0926\\u0930\\u094d\\u092d\\u093f\\u0924 \\u0939\\u094b\\u0924\\u0940 \\u0939\\u0948\\u0964 \\u0907\\u0938\\u092e\\u0947\\u0902 \\u0935\\u093f\\u092d\\u093f\\u0928\\u094d\\u0928 \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e \\u0909\\u092a\\u093e\\u092f\\u094b\\u0902 \\u0915\\u094b \\u0932\\u093e\\u0917\\u0942 \\u0915\\u0930\\u0928\\u093e \\u0936\\u093e\\u092e\\u093f\\u0932 \\u0939