            'description' => '{"en":"Instruction Set Architecture (ISA) defines the interface between software and hardware in a computer system. It includes the set of instructions that a processor can execute, along with their encoding format and addressing modes. ISA also specifies the registers available to the programmer, memory organization, and exception handling mechanisms. It serves as a blueprint for designing processors and writing assembly language programs. ISA plays a crucial role in determining the performance, compatibility, and efficiency of a computer system.","hi":"\\u0928\\u093f\\u0930\\u094d\\u0926\\u0947\\u0936 \\u0938\\u092e\\u0942\\u0939 \\u0935\\u093e\\u0938\\u094d\\u0924\\u0941\\u0936\\u093e\\u0938\\u094d\\u0924\\u094d\\u0930 (ISA) \\u0915\\u0902\\u092a\\u094d\\u092f\\u0942\\u091f\\u0930 \\u0938\\u093f\\u0938\\u094d\\u091f\\u092e \\u092e\\u0947\\u0902 \\u0938\\u0949\\u092b\\u093c\\u094d\\u091f\\u0935\\u0947\\u092f\\u0930 \\u0914\\u0930 \\u0939\\u093e\\u0930\\u094d\\u0921\\u0935\\u0947\\u092f\\u0930 \\u0915\\u0947 \\u092c\\u0940\\u091a \\u0907\\u0902\\u091f\\u0930\\u092b\\u0947\\u0938 \\u0915\\u094b \\u092a\\u0930\\u093f\\u092d\\u093e\\u0937\\u093f\\u0924 \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948\\u0964 \\u0907\\u0938\\u092e\\u0947\\u0902 \\u0935\\u0939 \\u0938\\u0947\\u091f \\u0915\\u0947 \\u0928\\u093f\\u0930\\u094d\\u0926\\u0947\\u0936 \\u0936\\u093e\\u092e\\u093f\\u0932 \\u0939\\u094b\\u0924\\u0947 \\u0939\\u0948\\u0902 \\u091c\\u093f\\u0928\\u094d\\u0939\\u0947\\u0902 \\u092a\\u094d\\u0930\\u094b\\u0938\\u0947\\u0938\\u0930 \\u0938\\u0902\\u091a\\u093e\\u0932\\u093f\\u0924 \\u0915\\u0930 \\u0938\\u0915\\u0924\\u093e \\u0939\\u0948, \\u0938\\u093e\\u0925 \\u0939\\u0940 \\u0909\\u0928\\u0915\\u0940 \\u0915\\u094b\\u0921\\u093f\\u0902\\u0917 \\u092a\\u094d\\u0930\\u093e\\u0930\\u0942\\u092a \\u0914\\u0930 \\u092a\\u0924\\u093e \\u0928\\u093f\\u0930\\u094d\\u0926\\u0947\\u0936\\u0928 \\u092e\\u094b\\u0921\\u094d\\u0938 \\u0936\\u093e\\u092e\\u093f\\u0932 \\u0939\\u0948\\u0902\\u0964 ISA \\u092d\\u0940 \\u092a\\u094d\\u0930\\u094b\\u0917\\u094d\\u0930\\u093e\\u092e\\u0930 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0909\\u092a\\u0932\\u092c\\u094d\\u0927 \\u0930\\u091c\\u093f\\u0938\\u094d\\u091f\\u0930, \\u0938\\u094d\\u092e\\u0943\\u0924\\u093f \\u0938\\u0902\\u0917\\u0920\\u0928, \\u0914\\u0930 \\u0905\\u092a\\u0935\\u093e\\u0926 \\u0939\\u0948\\u0902\\u0921\\u0932\\u093f\\u0902\\u0917 \\u0924\\u0902\\u0924\\u094d\\u0930\\u094b\\u0902 \\u0915\\u094b \\u0928\\u093f\\u0930\\u094d\\u0926\\u093f\\u0937\\u094d\\u091f \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948\\u0964 \\u092f\\u0939 \\u092a\\u094d\\u0930\\u094b\\u0938\\u0947\\u0938\\u0930 \\u0921\\u093f\\u091c\\u093c\\u093e\\u0907\\u0928 \\u0914\\u0930 \\u0905\\u0938\\u0947\\u0902\\u092c\\u0932\\u0940 \\u092d\\u093e\\u0937\\u093e \\u0915\\u0947 \\u0915\\u093e\\u0930\\u094d\\u092f\\u0915\\u094d\\u0930\\u092e \\u0932\\u093f\\u0916\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u090f\\u0915 \\u092c\\u094d\\u0932\\u0942\\u092a\\u094d\\u0930\\u093f\\u0902\\u091f \\u0915\\u0947 \\u0930\\u0942\\u092a \\u092e\\u0947\\u0902 \\u0915\\u093e\\u092e \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948\\u0964 ISA \\u0915\\u0902\\u092a\\u094d\\u092f\\u0942\\u091f\\u0930 \\u0938\\u093f\\u0938\\u094d\\u091f\\u092e \\u0915\\u0940 \\u092a\\u094d\\u0930\\u0926\\u0930\\u094d\\u0936\\u0928, \\u0938\\u0902\\u0917\\u0924\\u0924\\u093e, \\u0914\\u0930 \\u0926\\u0915\\u094d\\u0937\\u0924\\u093e \\u0915\\u094b \\u0928\\u093f\\u0930\\u094d\\u0927\\u093e\\u0930\\u093f\\u0924 \\u0915\\u0930\\u0928\\u0947 \\u092e\\u0947\\u0902 \\u092e\\u0939\\u0924\\u094d\\u0935\\u092a\\u0942\\u0930\\u094d\\u0923 \\u092d\\u0942\\u092e\\u093f\\u0915\\u093e \\u0928\\u093f\\u092d\\u093e\\u0924\\u093e \\u0939\\u0948\\u0964","ar":"\\u062a\\u062d\\u062f\\u062f \\u0647\\u0646\\u062f\\u0633\\u0629 \\u0645\\u062c\\u0645\\u0648\\u0639\\u0629 \\u0627\\u0644\\u062a\\u0639\\u0644\\u064a\\u0645\\u0627\\u062a (ISA) \\u062