                'name' => '{"en":"Parallel and Distributed Computing","hi":"\\u0938\\u092e\\u093e\\u0928 \\u0914\\u0930 \\u0935\\u093f\\u0924\\u0930\\u093f\\u0924 \\u0915\\u0902\\u092a\\u094d\\u092f\\u0942\\u091f\\u093f\\u0902\\u0917","ar":"\\u0627\\u0644\\u062d\\u0648\\u0633\\u0628\\u0629 \\u0627\\u0644\\u0645\\u062a\\u0648\\u0627\\u0632\\u064a\\u0629 \\u0648\\u0627\\u0644\\u0645\\u0648\\u0632\\u0639\\u0629"}',
                'description' => '{"en":"Parallel and Distributed Computing is a computing paradigm where tasks are divided among multiple processors or computers to improve performance, increase efficiency, and handle large-scale computational problems. In parallel computing, tasks are executed simultaneously on multiple processors, exploiting concurrency to speed up computations. Distributed computing involves coordinating tasks across a network of interconnected computers, often geographically dispersed, to achieve a common goal. It encompasses concepts such as message passing, shared memory systems, and distributed algorithms. Parallel and Distributed Computing are used in various domains, including scientific simulations, big data processing, and high-performance computing applications.","hi":"\\u0938\\u092e\\u093e\\u0928 \\u0914\\u0930 \\u0935\\u093f\\u0924\\u0930\\u093f\\u0924 \\u0915\\u0902\\u092a\\u094d\\u092f\\u0942\\u091f\\u093f\\u0902\\u0917 \\u090f\\u0915 \\u0915\\u0902\\u092a\\u094d\\u092f\\u0942\\u091f\\u093f\\u0902\\u0917 \\u092f\\u0941\\u0917\\u092e \\u0939\\u0948 \\u091c\\u0939\\u093e\\u0902 \\u0915\\u093e\\u0930\\u094d\\u092f\\u094b\\u0902 \\u0915\\u094b \\u0905\\u0928\\u0941\\u092a\\u094d\\u0930\\u092f\\u094b\\u0917\\u0940 \\u0915\\u0930\\u0928\\u0947, \\u0926\\u0915\\u094d\\u0937\\u0924\\u093e \\u092c\\u0922\\u093c\\u093e\\u0928\\u0947, \\u0914\\u0930 \\u092c\\u0921\\u093c\\u0940 \\u092a\\u0948\\u092e\\u093e\\u0928\\u0947 \\u092a\\u0930 \\u0917\\u0923\\u0928\\u093e \\u0938\\u092e\\u0938\\u094d\\u092f\\u093e\\u0913\\u0902 \\u0915\\u094b \\u0938\\u0902\\u092d\\u093e\\u0932\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0915\\u0908 \\u092a\\u094d\\u0930\\u094b\\u0938\\u0947\\u0938\\u0930\\u094b\\u0902 \\u092f\\u093e \\u0915\\u0902\\u092a\\u094d\\u092f\\u0942\\u091f\\u0930\\u094b\\u0902 \\u092e\\u0947\\u0902 \\u092c\\u093e\\u0901\\u091f\\u093e \\u091c\\u093e\\u0924\\u093e \\u0939\\u0948\\u0964 \\u092a\\u0930\\u093e\\u0932\\u0932 \\u0915\\u0902\\u092a\\u094d\\u092f\\u0942\\u091f\\u093f\\u0902\\u0917 \\u092e\\u0947\\u0902, \\u0915\\u093e\\u0930\\u094d\\u092f\\u094b\\u0902 \\u0915\\u094b \\u0915\\u0908 \\u092a\\u094d\\u0930\\u094b\\u0938\\u0947\\u0938\\u0930\\u094b\\u0902 \\u092a\\u0930 \\u0938\\u092e\\u0935\\u0930\\u094d\\u0924\\u0940 \\u0930\\u0942\\u092a \\u0938\\u0947 \\u0915\\u094d\\u0930\\u093f\\u092f\\u093e\\u0928\\u094d\\u0935\\u093f\\u0924 \\u0915\\u093f\\u092f\\u093e \\u091c\\u093e\\u0924\\u093e \\u0939\\u0948, \\u091c\\u094b \\u0917\\u0923\\u0928\\u093e\\u0913\\u0902 \\u0915\\u094b \\u0924\\u0947\\u091c\\u093c \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0938\\u092e\\u0915\\u093e\\u0932\\u093f\\u0924\\u0924\\u093e \\u0915\\u093e \\u0909\\u092a\\u092f\\u094b\\u0917 \\u0915\\u0930\\u0924\\u0947 \\u0939\\u0948\\u0902\\u0964 \\u0935\\u093f\\u0924\\u0930\\u093f\\u0924 \\u0915\\u0902\\u092a\\u094d\\u092f\\u0942\\u091f\\u093f\\u0902\\u0917 \\u092e\\u0947\\u0902, \\u0915\\u093e\\u0930\\u094d\\u092f\\u094b\\u0902 \\u0915\\u094b \\u091c\\u093e\\u0930\\u0940 \\u0930\\u0916\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u090f\\u0915 \\u0928\\u0947\\u091f\\u0935\\u0930\\u094d\\u0915 \\u0915\\u0947 \\u092e\\u093e\\u0927\\u094d\\u092f\\u092e \\u0938\\u0947 \\u0938\\u0902\\u0917\\u0920\\u093f\\u0924 \\u0915\\u093f\\u092f\\u093e \\u091c\\u093e\\u0924\\u093e \\u0939\\u0948, \\u091c\\u094b \\u0905\\u0915\\u094d\\u0938\\u0930 \\u092d\\u0942\\u0917\\u094b\\u0932\\u093f\\u0915 \\u0930\\u0942\\u092a \\u0938\\u0947 \\u0935\\u093f\\u0924\\u0930\\u093f\\u0924 \\u0939\\u094b\\u0924\\u093e \\u0939\\u0948, \\u090f\\u0915 \\u0938\\u093e\\u092e\\u093e\\u0928\\u094d\\u092f \\u0932\\u0915\\u094d\\u0937\\u094d\\u092f \\u0915\\u094b \\u092a\\u094d\\u0930\\u093e\\u092a\\u094d\\u0924 \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f\\u0964 \\u0907\\u0938\\u092e\\u0947\\u0902 \\u0938\\u0902\\u0926\\u0947\\u0936 \\u092d\\u0947\\u091c\\u0928\\u093e, \\u0938\\u093e\\u091d\\u093e \\u0938\\u0