            'description' => '{"en":"Computer Networks are a set of interconnected computers and other devices that communicate with each other to share resources and information. They enable data transmission and exchange through various network technologies, protocols, and communication mediums such as wired and wireless connections. Computer networks facilitate various applications and services, including file sharing, email communication, web browsing, and online gaming. They are categorized based on their geographic scope into Local Area Networks (LANs), Wide Area Networks (WANs), and Metropolitan Area Networks (MANs). Computer networks play a crucial role in modern computing, enabling connectivity and collaboration across the globe.","hi":"\\u0915\\u0902\\u092a\\u094d\\u092f\\u0942\\u091f\\u0930 \\u0928\\u0947\\u091f\\u0935\\u0930\\u094d\\u0915 \\u090f\\u0915 \\u0938\\u092e\\u0942\\u0939 \\u0939\\u0948\\u0902 \\u091c\\u094b \\u090f\\u0915-\\u0926\\u0942\\u0938\\u0930\\u0947 \\u0915\\u0947 \\u0938\\u093e\\u0925 \\u0938\\u0902\\u091a\\u093e\\u0930 \\u0915\\u0930\\u0924\\u0947 \\u0939\\u0948\\u0902 \\u0914\\u0930 \\u0938\\u093e\\u091d\\u093e \\u0938\\u0902\\u0938\\u093e\\u0927\\u0928\\u094b\\u0902 \\u0914\\u0930 \\u091c\\u093e\\u0928\\u0915\\u093e\\u0930\\u0940 \\u0915\\u094b \\u0938\\u093e\\u091d\\u093e \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0915\\u0928\\u0947\\u0915\\u094d\\u091f \\u0915\\u093f\\u090f \\u0917\\u090f \\u0915\\u0902\\u092a\\u094d\\u092f\\u0942\\u091f\\u0930 \\u0914\\u0930 \\u0905\\u0928\\u094d\\u092f \\u0909\\u092a\\u0915\\u0930\\u0923\\u094b\\u0902 \\u0915\\u093e\\u0964 \\u0935\\u0947 \\u0935\\u093f\\u092d\\u093f\\u0928\\u094d\\u0928 \\u0928\\u0947\\u091f\\u0935\\u0930\\u094d\\u0915 \\u092a\\u094d\\u0930\\u094c\\u0926\\u094d\\u092f\\u094b\\u0917\\u093f\\u0915\\u093f\\u092f\\u094b\\u0902, \\u092a\\u094d\\u0930\\u094b\\u091f\\u094b\\u0915\\u0949\\u0932\\u094d\\u0938, \\u0914\\u0930 \\u0938\\u0902\\u091a\\u093e\\u0930 \\u092e\\u093e\\u0927\\u094d\\u092f\\u092e\\u094b\\u0902 \\u0915\\u0947 \\u092e\\u093e\\u0927\\u094d\\u092f\\u092e \\u0938\\u0947 \\u0921\\u0947\\u091f\\u093e \\u092a\\u094d\\u0930\\u0947\\u0937\\u0923 \\u0914\\u0930 \\u0935\\u093f\\u0928\\u093f\\u092e\\u092f \\u0915\\u094b \\u0938\\u0902\\u092d\\u0935 \\u092c\\u0928\\u093e\\u0924\\u0947 \\u0939\\u0948\\u0902, \\u091c\\u0948\\u0938\\u0947 \\u0915\\u093f \\u0935\\u093e\\u092f\\u0930\\u094d\\u0921 \\u0914\\u0930 \\u0935\\u093e\\u092f\\u0930\\u0932\\u0947\\u0938 \\u0915\\u0928\\u0947\\u0915\\u094d\\u0936\\u0928\\u094d\\u0938\\u0964 \\u0915\\u0902\\u092a\\u094d\\u092f\\u0942\\u091f\\u0930 \\u0928\\u0947\\u091f\\u0935\\u0930\\u094d\\u0915\\u094d\\u0938 \\u0935\\u093f\\u092d\\u093f\\u0928\\u094d\\u0928 \\u090f\\u092a\\u094d\\u0932\\u093f\\u0915\\u0947\\u0936\\u0928\\u094d\\u0938 \\u0914\\u0930 \\u0938\\u0947\\u0935\\u093e\\u0913\\u0902 \\u0915\\u094b \\u0938\\u0902\\u092d\\u0935 \\u092c\\u0928\\u093e\\u0924\\u0947 \\u0939\\u0948\\u0902, \\u091c\\u0948\\u0938\\u0947 \\u0915\\u093f \\u092b\\u093c\\u093e\\u0907\\u0932 \\u0938\\u093e\\u091d\\u093e \\u0915\\u0930\\u0928\\u093e, \\u0908\\u092e\\u0947\\u0932 \\u0938\\u0902\\u091a\\u093e\\u0930, \\u0935\\u0947\\u092c \\u092c\\u094d\\u0930\\u093e\\u0909\\u091c\\u093c\\u093f\\u0902\\u0917, \\u0914\\u0930 \\u0911\\u0928\\u0932\\u093e\\u0907\\u0928 \\u0917\\u0947\\u092e\\u093f\\u0902\\u0917\\u0964 \\u0907\\u0928\\u094d\\u0939\\u0947\\u0902 \\u0909\\u0928\\u0915\\u0947 \\u092d\\u0942\\u0917\\u094b\\u0932\\u093f\\u0915 \\u0915\\u094d\\u0937\\u0947\\u0924\\u094d\\u0930 \\u0915\\u0947 \\u0906\\u0927\\u093e\\u0930 \\u092a\\u0930 \\u0935\\u0930\\u094d\\u0917\\u0940\\u0915\\u0943\\u0924 \\u0915\\u093f\\u092f\\u093e \\u091c\\u093e\\u0924\\u093e \\u0939\\u0948, \\u091c\\u0948\\u0938\\u0947 \\u0915\\u093f \\u0938\\u094d\\u0925\\u093e\\u0928\\u0940\\u092f \\u0915\\u094d\\u0937\\u0947\\u0924\\u094d\\u0930 \\u0928\\u0947\\u091f\\u0935\\u0930\\u094d\\u0915 (LANs), \\u0935\\u094d\\u092f\\u093e\\u092a\\u0915 \\u0915\\u094d\\u0937\\u0947\\u0924\\u094d\\u0930 \\u0928\\u0947\\u091f\\u0935\\u0930\\u094d\\u0915 (WANs), \\u0914\\u0930 \\u0928\\u0917\\u0930\\u0940\\u092f \\u0915\\u094d\\u0937\\u0947\\u0924\\u094d\\u0930 \\u0928\\u0947\\u091f\\u0935\\u0930\\u094d\\u0915 (MANs)\\u0964 \\u0915\\u0902\\u092a\\u094d\\u092f\\u0942\\u091f\\u0930 \\u0928\\u0947\\u091f\\u0935\\u0930\\u094d\\u0915\\u094d\\u0938 \\u0906\\u0927\\u0941\\u0928\\u093f\\u0915 \\u0915\\u0902\\u092a\\u094d\\u092f\\u0942\\u091f\\u093f\\u0902\\u0917 \\u092e\\u0947\\u0902 \\u092e\\u0939\\u0924\\u094d\\u0935\\u092a\\u0942\\u0930\\u094d\\u0923 \\u092d\\u0942\\u092e\\u093f\\u0915\\u093e \\u0928\\u093f\\u092d\\u093e\\u0924\\u0947 \\u0939\\u0948\\u0902, \\u091c\\u094b \\u0935\\u0948\\u0936\\u094d\\u0935\\u093f\\u0915 \\u0938\\u0902\\u0935\\u093e\\u0926 \\u0914\\u0930 \\u0938\\u0939\\u092f\\u094b\\u0917 \\u0915\\u094b \\u0938\\u0902\\u092d\\u0935 \\u092c\\u0928\\u093e\\u0924\\u0947 \\u0939\\u0948\\u0902\\u0964","ar":"\\u0634\\u0628\\u0643\\u0627\\u062a \\u0627\\u0644\\u062d\\u0627\\u0633\\u0648\\u0628 \\u0647\\u064a \\u0645\\u062c\\u0645\\u0648\\u0639\\u0629 \\u0645\\u0646 \\u0627\\u0644\\u0623\\u062c\\u0647\\u0632\\u0629 \\u0627\\u0644\\u0645\\u062a\\u0635\\u0644\\u0629 \\u0628\\u0628\\u0639\\u0636\\u0647\\u0627 \\u0627\\u0644\\u0628\\u0639\\u0636 \\u0648\\u0627\\u0644\\u062a\\u064a \\u062a\\u062a\\u0648\\u0627\\u0635\\u0644 \\u0645\\u0639 \\u0628\\u0639\\u0636\\u0647\\u0627 \\u0627\\u0644\\u0628\\u0639\\u0636 \\u0644\\u0645\\u0634\\u0627\\u0631\\u0643\\u0629 \\u0627\\u0644\\u0645\\u0648\\u0627\\u0631\\u062f \\u0648\\u0627\\u0644\\u0645\\u0639\\u0644\\u0648\\u0645\\u0627\\u062a. \\u062a\\u0645\\u0643\\u0646 \\u0647\\u0630\\u0647 \\u0627\\u0644\\u0634\\u0628\\u0643\\u0627\\u062a \\u0645\\u0646 \\u0646\\u0642\\u0644 \\u0627\\u0644\\u0628\\u064a\\u0627\\u0646\\u0627\\u062a \\u0648\\u062a\\u0628\\u0627\\u062f\\u0644\\u0647\\u0627 \\u0645\\u0646 \\u062e\\u0644\\u0627\\u0644 \\u0645\\u062c\\u0645\\u0648\\u0639\\u06