                'name' => '{"en":"Public Cloud","hi":"\\u0938\\u093e\\u0930\\u094d\\u0935\\u091c\\u0928\\u093f\\u0915 \\u092c\\u093e\\u0926\\u0932","ar":"\\u0627\\u0644\\u0633\\u062d\\u0627\\u0628\\u0629 \\u0627\\u0644\\u0639\\u0627\\u0645\\u0629"}',
            'description' => '{"en":"Public Cloud refers to a type of cloud computing where cloud services are provided over the internet by third-party providers. These services, such as infrastructure as a service (IaaS), platform as a service (PaaS), and software as a service (SaaS), are available to multiple users, organizations, or the general public. Public cloud services are hosted and managed by cloud service providers in their data centers, allowing users to access computing resources on-demand and pay for only the resources they use. They offer scalability, flexibility, and cost-effectiveness, making them suitable for various applications and businesses.","hi":"\\u0938\\u093e\\u0930\\u094d\\u0935\\u091c\\u0928\\u093f\\u0915 \\u092c\\u093e\\u0926\\u0932 \\u090f\\u0915 \\u092a\\u094d\\u0930\\u0915\\u093e\\u0930 \\u0915\\u0940 \\u092c\\u093e\\u0926\\u0932 \\u0915\\u0902\\u092a\\u094d\\u092f\\u0942\\u091f\\u093f\\u0902\\u0917 \\u0915\\u094b \\u0938\\u0902\\u0926\\u0930\\u094d\\u092d\\u093f\\u0924 \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948 \\u091c\\u0939\\u093e\\u0902 \\u0924\\u0940\\u0938\\u0930\\u0947 \\u092a\\u0915\\u094d\\u0937 \\u092a\\u094d\\u0930\\u0926\\u093e\\u0924\\u093e\\u0913\\u0902 \\u0926\\u094d\\u0935\\u093e\\u0930\\u093e \\u0907\\u0902\\u091f\\u0930\\u0928\\u0947\\u091f \\u0915\\u0947 \\u092e\\u093e\\u0927\\u094d\\u092f\\u092e \\u0938\\u0947 \\u0915\\u094d\\u0932\\u093e\\u0909\\u0921 \\u0938\\u0947\\u0935\\u093e\\u090f\\u0902 \\u092a\\u094d\\u0930\\u0926\\u093e\\u0928 \\u0915\\u0940 \\u091c\\u093e\\u0924\\u0940 \\u0939\\u0948\\u0902\\u0964 \\u0907\\u0928 \\u0938\\u0947\\u0935\\u093e\\u0913\\u0902 \\u092e\\u0947\\u0902, \\u091c\\u0948\\u0938\\u0947 \\u0915\\u093f \\u0907\\u0902\\u092b\\u094d\\u0930\\u093e\\u0938\\u094d\\u091f\\u094d\\u0930\\u0915\\u094d\\u091a\\u0930 \\u092f\\u093e \\u0938\\u0947\\u0935\\u093e (IaaS), \\u092a\\u094d\\u0932\\u0947\\u091f\\u092b\\u093c\\u0949\\u0930\\u094d\\u092e \\u092f\\u093e \\u0938\\u0947\\u0935\\u093e (PaaS), \\u0914\\u0930 \\u0938\\u0949\\u092b\\u093c\\u094d\\u091f\\u0935\\u0947\\u092f\\u0930 \\u092f\\u093e \\u0938\\u0947\\u0935\\u093e (SaaS), \\u0915\\u0908 \\u0909\\u092a\\u092f\\u094b\\u0917\\u0915\\u0930\\u094d\\u0924\\u093e\\u0913\\u0902, \\u0938\\u0902\\u0917\\u0920\\u0928\\u094b\\u0902, \\u092f\\u093e \\u0938\\u093e\\u092e\\u093e\\u0928\\u094d\\u092f \\u091c\\u0928\\u0924\\u093e \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0909\\u092a\\u0932\\u092c\\u094d\\u0927 \\u0939\\u094b\\u0924\\u0940 \\u0939\\u0948\\u0902\\u0964 \\u0938\\u093e\\u0930\\u094d\\u0935\\u091c\\u0928\\u093f\\u0915 \\u092c\\u093e\\u0926\\u0932 \\u0938\\u0947\\u0935\\u093e\\u090f\\u0902 \\u0915\\u094d\\u0932\\u093e\\u0909\\u0921 \\u0938\\u0947\\u0935\\u093e \\u092a\\u094d\\u0930\\u0926\\u093e\\u0924\\u093e\\u0913\\u0902 \\u0926\\u094d\\u0935\\u093e\\u0930\\u093e \\u0909\\u0928\\u0915\\u0947 \\u0921\\u0947\\u091f\\u093e \\u0915\\u0947\\u0902\\u0926\\u094d\\u0930\\u094b\\u0902 \\u092e\\u0947\\u0902 \\u0939\\u094b\\u0938\\u094d\\u091f \\u0914\\u0930 \\u092a\\u094d\\u0930\\u092c\\u0902\\u0927\\u093f\\u0924 \\u0915\\u0940 \\u091c\\u093e\\u0924\\u0940 \\u0939\\u0948\\u0902, \\u091c\\u093f\\u0938\\u0938\\u0947 \\u0909\\u092a\\u092f\\u094b\\u0917\\u0915\\u0930\\u094d\\u0924\\u093e\\u0913\\u0902 \\u0915\\u094b \\u0921\\u0947\\u092e\\u093e\\u0902\\u0921 \\u092a\\u0930 \\u0915\\u0902\\u092a\\u094d\\u092f\\u0942\\u091f\\u093f\\u0902\\u0917 \\u0938\\u0902\\u0938\\u093e\\u0927\\u0928\\u094b\\u0902 \\u0924\\u0915 \\u092a\\u0939\\u0941\\u0902\\u091a \\u092e\\u093f\\u0932\\u0924\\u0940 \\u0939\\u0948 \\u0914\\u0930 \\u0935\\u0947 \\u0915\\u0947\\u0935\\u0932 \\u0909\\u0928\\u094d\\u0939\\u0940\\u0902 \\u0938\\u0902\\u0938\\u093e\\u0927\\u0928\\u094b\\u0902 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u092d\\u0941\\u0917\\u0924\\u093e\\u0928 \\u0915\\u0930\\u0924\\u0947 \\u0939\\u0948\\u0902 \\u091c\\u094b \\u0935\\u0947 \\u0909\\u092a\\u092f\\u094b\\u0917 \\u0915\\u0930\\u0924\\u0947 \\u0939\\u0948\\u0902\\u0964 \\u092f\\u0947 \\u092e\\u093e\\u0902\\u0917\\u092a\\u0942\\u0930\\u094d\\u0923\\u0924\\u093e, \\u0932\\u091a\\u0940\\u0932\\u093e\\u092a\\u0928, \\u0914\\u0930 \\u0932\\u093e\\u0917\\u0924 \\u092a\\u094d\\u0930\\u092d\\u093e\\u0935\\u0940\\u0924\\u093e \\u092a\\u094d\\u0930\\u0926\\u093e\\u0928 \\u0915\\u0930\\u0924\\u0947 \\u0939\\u0948\\u0902, \\u091c\\u094b \\u0909\\u0928\\u094d\\u0939\\u0947\\u0902 \\u0935\\u093f\\u092d\\u093f\\u0928\\u094d\\u0928 \\u0905\\u0928\\u0941\\u092a\\u094d\\u0930\\u092f\\u094b\\u0917\\u094b\\u0902 \\u0914\\u0930 \\u0935\\u094d\\u092f\\u0935\\u0938\\u093e\\u092f\\u094b\\u0902 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0909\\u092a\\u092f\\u0941\\u0915\\u094d\\u0924 \\u092c\\u0928\\u093e\\u0924\\u093e \\u0939\\u0948\\u0964","ar":"\\u0627\\u0644\\u0633\\u062d\\u0627\\u0628\\u0629 \\u0627\\u0644\\u0639\\u0627\\u0645\\u0629 \\u062a\\u0634\\u064a\\u0631 \\u0625\\u0644\\u0649 \\u0646\\u0648\\u0639 \\u0645\\u0646 \\u0627\\u0644\\u062d\\u0648\\u0633\\u0628\\u0629 \\u0627\\u0644\\u0633\\u062d\\u0627\\u0628\\u064a\\u0629 \\u062d\\u064a\\u062b \\u064a\\u062a\\u0645 \\u062a\\u0648\\u0641\\u064a\\u0631 \\u062e\\u062f\\u0645\\u0627\\u062a \\u0627\\u0644\\u0633\\u062d\\u0627\\u0628\\u0629 \\u0639\\u0628\\u0631 \\u0627\\u0644\\u0625\\u0646\\u062a\\u0631\\u0646\\u062a \\u0645\\u0646 \\u0642\\u0628\\u0644 \\u0645\\u0632\\u0648\\u062f\\u064a\\u0646 \\u0637\\u0631\\u0641 \\u062b\\u0627\\u0644\\u062b. \\u062a\\u062a\\u0648\\u0641\\u0631 \\u0647\\u0630\\u0647 \\u0627\\u0644\\u062e\\u062f\\u0645\\u0627\\u062a\\u060c \\u0645\\u062b\\u0644 \\u0627\\u0644\\u0628\\u0646\\u064a\\u0629 \\u0643\\u062e\\u062f\\u0645\\u0629 (IaaS)\\u060c \\u0648\\u0627\\u0644\\u0645\\u0646\\u0635\\u0629 \\u0643\\u062e\\u062f\\u0645\\u0629 (PaaS)"}',
