                'name' => '{"en":"Hybrid Cloud","hi":"\\u0939\\u093e\\u0907\\u092c\\u094d\\u0930\\u093f\\u0921 \\u092c\\u093e\\u0926\\u0932","ar":"\\u0627\\u0644\\u0633\\u062d\\u0627\\u0628\\u0629 \\u0627\\u0644\\u0647\\u062c\\u064a\\u0646\\u0629"}',
                'description' => '{"en":"Hybrid Cloud is a cloud computing environment that combines elements of both public and private clouds. In a hybrid cloud, organizations can leverage the scalability and cost-effectiveness of public clouds while retaining greater control, security, and customization options offered by private clouds. It allows data and applications to be seamlessly shared between public and private cloud infrastructures, providing flexibility and optimizing resource utilization. Organizations can use a hybrid cloud model to meet specific business requirements, regulatory compliance, or performance needs. Hybrid cloud architectures often involve connecting on-premises data centers with public cloud services through secure networking technologies and protocols.","hi":"\\u0939\\u093e\\u0907\\u092c\\u094d\\u0930\\u093f\\u0921 \\u092c\\u093e\\u0926\\u0932 \\u090f\\u0915 \\u0915\\u094d\\u0932\\u093e\\u0909\\u0921 \\u0915\\u0902\\u092a\\u094d\\u092f\\u0942\\u091f\\u093f\\u0902\\u0917 \\u092a\\u0930\\u094d\\u092f\\u093e\\u0935\\u0930\\u0923 \\u0939\\u0948 \\u091c\\u094b \\u0938\\u093e\\u0930\\u094d\\u0935\\u091c\\u0928\\u093f\\u0915 \\u0914\\u0930 \\u0928\\u093f\\u091c\\u0940 \\u092c\\u093e\\u0926\\u0932\\u094b\\u0902 \\u0915\\u0947 \\u0924\\u0924\\u094d\\u0935\\u094b\\u0902 \\u0915\\u094b \\u0938\\u0902\\u092f\\u0941\\u0915\\u094d\\u0924 \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948\\u0964 \\u0939\\u093e\\u0907\\u092c\\u094d\\u0930\\u093f\\u0921 \\u092c\\u093e\\u0926\\u0932 \\u092e\\u0947\\u0902, \\u0938\\u0902\\u0917\\u0920\\u0928 \\u0938\\u093e\\u0930\\u094d\\u0935\\u091c\\u0928\\u093f\\u0915 \\u092c\\u093e\\u0926\\u0932\\u094b\\u0902 \\u0915\\u0940 \\u092e\\u093e\\u0902\\u0917\\u092a\\u0942\\u0930\\u094d\\u0923\\u0924\\u093e \\u0914\\u0930 \\u0932\\u093e\\u0917\\u0924-\\u092a\\u094d\\u0930\\u092d\\u093e\\u0935\\u0940\\u0924\\u093e \\u0915\\u093e \\u0932\\u093e\\u092d \\u0909\\u0920\\u093e \\u0938\\u0915\\u0924\\u0947 \\u0939\\u0948\\u0902, \\u091c\