                'description' => '{"en":"Organic chemistry is a branch of chemistry that focuses on the study of carbon-containing compounds, their properties, structure, composition, reactions, and synthesis. Carbon is unique in its ability to form diverse and complex molecules due to its tetravalency and the ability to form covalent bonds with other elements, including hydrogen, oxygen, nitrogen, sulfur, and halogens. Organic chemistry plays a crucial role in understanding the chemistry of life as many essential molecules found in living organisms, such as proteins, carbohydrates, lipids, and nucleic acids, are organic compounds. It encompasses various sub-disciplines, including organic synthesis, stereochemistry, reaction mechanisms, spectroscopy, and the study of organic reactions in both laboratory and industrial settings.","hi":"\\u091c\\u0948\\u0935\\u093f\\u0915 \\u0930\\u0938\\u093e\\u092f\\u0928 \\u0935\\u0939 \\u0930\\u0938\\u093e\\u092f\\u0928 \\u0935\\u093f\\u091c\\u094d\\u091e\\u093e\\u0928 \\u0915\\u093e \\u090f\\u0915 \\u0936\\u093e\\u0916\\u093e \\u0939\\u0948 \\u091c\\u094b \\u0915\\u093e\\u0930\\u094d\\u092c\\u0928-\\u092f\\u0941\\u0915\\u094d\\u0924 \\u092f\\u094c\\u0917\\u093f\\u0915\\u094b\\u0902 \\u0915\\u093e \\u0905\\u0927\\u094d\\u092f\\u092f\\u0928 \\u0915\\u0930\\u0924\\u0940 \\u0939\\u0948, \\u0909\\u0928\\u0915\\u0940 \\u0917\\u0941\\u0923, \\u0938\\u0902\\u0930\\u091a\\u0928\\u093e, \\u0938\\u0902\\u0918\\u091f\\u0928, \\u092a\\u094d\\u0930\\u0924\\u093f\\u0915\\u094d\\u0930\\u093f\\u092f\\u093e, \\u0914\\u0930 \\u0938\\u0902\\u0936\\u094d\\u0932\\u0947\\u0937\\u0923 \\u092a\\u0930\\u0964 \\u0915\\u093e\\u0930\\u094d\\u092c\\u0928 \\u0905\\u092a\\u0928\\u0940 \\u091a\\u093e\\u0930-\\u0927\\u093e\\u0930\\u0940 \\u0914\\u0930 \\u0905\\u0928\\u094d\\u092f \\u0924\\u0924\\u094d\\u0935\\u094b\\u0902, \\u091c\\u0948\\u0938\\u0947 \\u0915\\u093f \\u0939\\u093e\\u0907\\u0921\\u094d\\u0930\\u094b\\u091c\\u0928, \\u0911\\u0915\\u094d\\u0938\\u0940\\u091c\\u0928, \\u0928\\u093e\\u0907\\u091f\\u094d\\u0930\\u094b\\u091c\\u0928, \\u0938\\u0932\\u094d\\u092b\\u0930, \\u0914\\u0930 \\u0939\\u0948\\u0932\\u094b\\u091c\\u0928 \\u0915\\u0947 \\u0938\\u093e\\u0925 \\u0915\\u094b\\u0935\\u0947\\u0932\\u0947\\u0902\\u091f \\u092c\\u0902\\u0927 \\u092c\\u0928\\u093e\\u0928\\u0947 \\u0915\\u0940 \\u0915\\u094d\\u0937\\u092e\\u0924\\u093e \\u0915\\u0947 \\u0915\\u093e\\u0930\\u0923, \\u0935\\u093f\\u0935\\u093f\\u0927 \\u0914\\u0930 \\u091c\\u091f\\u093f\\u0932 \\u092f\\u094c\\u0917\\u093f\\u0915\\u094b\\u0902 \\u0915\\u093e \\u0917\\u0920\\u0928 \\u0915\\u0930\\u0928\\u0947 \\u092e\\u0947\\u0902 \\u0905\\u0928\\u0942\\u0920\\u093e \\u0939\\u0948\\u0964 \\u091c\\u0948\\u0935\\u093f\\u0915 \\u0930\\u0938\\u093e\\u092f\\u0928 \\u091c\\u0940\\u0935\\u0928 \\u0915\\u0940 \\u0930\\u0938\\u093e\\u092f\\u0928\\u093f\\u0915\\u0924\\u093e \\u0915\\u094b \\u0938\\u092e\\u091d\\u0928\\u0947 \\u092e\\u0947\\u0902 \\u092e\\u0939\\u0924\\u094d\\u0935\\u092a\\u0942\\u0930\\u094d\\u0923 \\u092d\\u0942\\u092e\\u093f\\u0915\\u093e \\u0928\\u093f\\u092d\\u093e\\u0924\\u093e \\u0939\\u0948 \\u0915\\u094d\\u092f\\u094b\\u0902\\u0915\\u093f \\u0915\\u0908 \\u092e\\u0939\\u0924\\u094d\\u0935\\u092a\\u0942\\u0930\\u094d\\u0923 \\u092f\\u094c\\u0917\\u093f\\u0915\\u094b\\u0902, \\u091c\\u0948\\u0938\\u0947 \\u0915\\u093f \\u092a\\u094d\\u0930\\u094b\\u091f\\u0940\\u0928, \\u0915\\u093e\\u0930\\u094d\\u092c\\u094b\\u0939\\u093e\\u0907\\u0921\\u094d\\u0930\\u0947\\u091f, \\u0932\\u093f\\u092a\\u093f\\u0921\\u094d\\u0938, \\u0914\\u0930 \\u0928\\u094d\\u092f\\u0942\\u0915\\u094d\\u0932\\u093f\\u0915 \\u090f\\u0938\\u093f\\u0921, \\u091c\\u094b \\u091c\\u0940\\u0935\\u093f\\u0924 \\u091c\\u0940\\u0935\\u094b\\u0902 \\u092e\\u0947\\u0902 \\u092a\\u093e\\u090f \\u091c\\u093e\\u0924\\u0947 \\u0939\\u0948\\u0902, \\u0935\\u0947 \\u091c\\u0948\\u0935\\u093f\\u0915 \\u092f\\u094c\\u0917\\u093f\\u0915 \\u0939\\u0948\\u0902\\u0964 \\u0907\\u0938\\u092e\\u0