            'description' => '{"en":"Inorganic chemistry is the branch of chemistry that deals with the study of inorganic compounds, which typically do not contain carbon-hydrogen (C-H) bonds. It focuses on the properties, structure, composition, reactions, and synthesis of substances that are primarily composed of elements other than carbon, such as metals, metalloids, and non-metals. Inorganic compounds play crucial roles in various fields, including materials science, coordination chemistry, bioinorganic chemistry, and environmental chemistry. The study of inorganic chemistry encompasses a wide range of topics, including solid-state chemistry, coordination chemistry, organometallic chemistry, and the chemistry of transition metals. Understanding inorganic chemistry is essential for gaining insights into the behavior of materials, the functioning of biological systems, and the environmental impact of chemical processes.","hi":"\\u0905\\u0915\\u093e\\u0930\\u094d\\u092c\\u094b\\u0928\\u093f\\u0915 \\u0930\\u0938\\u093e\\u092f\\u0928 \\u0935\\u0939 \\u0930\\u0938\\u093e\\u092f\\u0928 \\u0935\\u093f\\u091c\\u094d\\u091e\\u093e\\u0928 \\u0915\\u093e \\u090f\\u0915 \\u0936\\u093e\\u0916\\u093e \\u0939\\u0948 \\u091c\\u094b \\u0905\\u0915\\u093e\\u0930\\u094d\\u092c\\u0928-\\u0939\\u093e\\u0907\\u0921\\u094d\\u0930\\u094b\\u091c\\u0928 (C-H) \\u092c\\u0902\\u0927 \\u0928\\u0939\\u0940\\u0902 \\u0938\\u092e\\u093e\\u0924\\u0947 \\u0939\\u0941\\u090f \\u0905\\u0915\\u093e\\u0930\\u094d\\u092c\\u0928-\\u0938\\u092e\\u093e\\u0939\\u093f\\u0924 \\u092f\\u094c\\u0917\\u093f\\u0915\\u094b\\u0902 \\u0915\\u0947 \\u0905\\u0927\\u094d\\u092f\\u092f\\u0928 \\u0938\\u0947 \\u0938\\u0902\\u092c\\u0902\\u0927\\u093f\\u0924 \\u0939\\u0948\\u0964 \\u092f\\u0939 \\u0924\\u0924\\u094d\\u0935\\u094b\\u0902 \\u0915\\u0947 \\u0917\\u0941\\u0923, \\u0938\\u0902\\u0930\\u091a\\u0928\\u093e, \\u0938\\u0902\\u0918\\u091f\\u0928, \\u092a\\u094d\\u0930\\u0924\\u093f\\u0915\\u094d\\u0930\\u093f\\