                'description' => '{"en":"Analytical chemistry is a branch of chemistry that deals with the identification and quantification of chemical compounds in various substances. It involves the development and application of methods and techniques to analyze the composition, structure, and properties of matter. Analytical chemists utilize a variety of instruments and methods such as spectroscopy, chromatography, and electrochemistry to separate, identify, and quantify chemical substances. This field is crucial in various industries, including pharmaceuticals, environmental monitoring, food and beverage, and forensic science. Analytical chemistry plays a significant role in quality control, research, and problem-solving across diverse sectors.","hi":"\\u0935\\u093f\\u0936\\u094d\\u0932\\u0947\\u0937\\u0923\\u0940\\u092f \\u0930\\u0938\\u093e\\u092f\\u0928 \\u0930\\u0938\\u093e\\u092f\\u0928 \\u0935\\u093f\\u091c\\u094d\\u091e\\u093e\\u0928 \\u0915\\u0940 \\u090f\\u0915 \\u0936\\u093e\\u0916\\u093e \\u0939\\u0948 \\u091c\\u094b \\u0935\\u093f\\u092d\\u093f\\u0928\\u094d\\u0928 \\u092a\\u0926\\u093e\\u0930\\u094d\\u0925\\u094b\\u0902 \\u092e\\u0947\\u0902 \\u0930\\u093e\\u0938\\u093e\\u092f\\u0928\\u093f\\u0915 \\u092f\\u094c\\u0917\\u093f\\u0915\\u094b\\u0902 \\u0915\\u0940 \\u092a\\u0939\\u091a\\u093e\\u0928 \\u0914\\u0930 \\u092e\\u093e\\u0924\\u094d\\u0930\\u093e\\u0924\\u094d\\u092e\\u0915\\u0924\\u093e \\u0915\\u0947 \\u0938\\u093e\\u0925 \\u0938\\u0902\\u092c\\u0902\\u0927\\u093f\\u0924 \\u0939\\u0948\\u0964 \\u0907\\u0938\\u092e\\u0947\\u0902 \\u0935\\u0938\\u094d\\u0924\\u0941 \\u0915\\u0940 \\u0938\\u0902\\u0930\\u091a\\u0928\\u093e, \\u0938\\u0902\\u0930\\u091a\\u0928\\u093e, \\u0914\\u0930 \\u0917\\u0941\\u0923\\u094b\\u0902 \\u0915\\u093e \\u0935\\u093f\\u0936\\u094d\\u0932\\u0947\\u0937\\u0923 \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0935\\u093f\\u0927\\u093f\\u092f\\u094b\\u0902 \\u0914\\u0930 \\u0924\\u0915\\u0928\\u0940\\u0915\\u094b\\u0902 \\u0915\\u0947 \\u0935\\u093f\\u0915\\u093e\\u0938 \\u0914\\u0930 \\u0905\\u0928\\u0941\\u092a\\u094d\\u0930\\u092f\\u094b\\u0917 \\u0936\\u093e\\u092e\\u093f\\u0932 \\u0939\\u0948\\u0902\\u0964 \\u0935\\u093f\\u0936\\u094d\\u0932\\u0947\\u0937\\u0923\\u0940\\u092f \\u0930\\u0938\\u093e\\u092f\\u0928\\u093f\\u0915 \\u0930\\u0938\\u093e\\u092f\\u0928\\u093f\\u0915 \\u092f\\u094c\\u0917\\u093f\\u0915\\u094b\\u0902 \\u0915\\u094b \\u0905\\u0932\\u0917 \\u0915\\u0930\\u0928\\u0947, \\u092a\\u0939\\u091a\\u093e\\u0928\\u0928\\u0947, \\u0914\\u0930 \\u092e\\u093e\\u0924\\u094d\\u0930\\u093e\\u0924\\u094d\\u092e\\u0915\\u0924\\u093e \\u0932\\u093e\\u0917\\u0942 \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0938\\u094d\\u092a\\u0947\\u0915\\u094d\\u091f\\u094d\\u0930\\u094b\\u0938\\u094d\\u0915\\u094b\\u092a\\u0940, \\u0915\\u094d\\u0930\\u094b\\u092e\\u0947\\u091f\\u094b\\u0917\\u094d\\u0930\\u093e\\u092b\\u0940, \\u0914\\u0930 \\u0907\\u0932\\u0947\\u0915\\u094d\\u091f\\u094d\\u0930\\u094b\\u0915\\u0947\\u092e\\u093f\\u0938\\u094d\\u091f\\u094d\\u0930\\u0940 \\u091c\\u0948\\u0938\\u0947 \\u0935\\u093f\\u092d\\u093f\\u0928\\u094d\\u0928 \\u0909\\u092a\\u0915\\u0930\\u0923\\u094b\\u0902 \\u0914\\u0930 \\u0935\\u093f\\u0927\\u093f\\u092f\\u094b\\u0902 \\u0915\\u093e \\u0909\\u092a\\u092f\\u094b\\u0917 \\u0915\\u0930\\u0924\\u0947 \\u0939\\u0948\\u0902\\u0964 \\u092f\\u0939 \\u0915\\u094d\\u0937\\u0947\\u0924\\u094d\\u0930 \\u0935\\u093f\\u092d\\u093f\\u0928\\u094d\\u0928 \\u0909\\u0926\\u094d\\u092f\\u094b\\u0917\\u094b\\u0902 \\u092e\\u0947\\u0902 \\u092e\\u0939\\u0924\\u094d\\u0935\\u092a\\u0942\\u0930\\u094d\\u0923 \\u0939\\u0948, \\u091c\\u093f\\u0938\\u092e\\u0947\\u0902 \\u0926\\u0935\\u093e\\u0907\\u092f\\u094b\\u0902, \\u092a\\u0930\\u094d\\u092f\\u093e\\u0935\\u0930\\u0923 \\u092e\\u0949\\u0928\\u093f\\u091f\\u0930\\u093f\\u0902\\u0917, \\u0916\\u093e\\u0926\\u094d\\u092f \\u0914\\u0930 \\u092a\\u0947\\u092f, \\u0914\\