                'description' => '{"en":"Biochemistry is the branch of science that explores the chemical processes and substances that occur within living organisms. It focuses on understanding the structure, function, and interactions of biological molecules such as proteins, nucleic acids, carbohydrates, and lipids. Biochemists study how these molecules contribute to the processes of metabolism, growth, reproduction, and disease. They investigate cellular pathways, enzyme kinetics, genetic expression, and signal transduction to unravel the molecular mechanisms underlying various biological phenomena. Biochemistry plays a crucial role in fields such as medicine, agriculture, biotechnology, and pharmacology, contributing to advancements in healthcare, food production, and environmental conservation.","hi":"\\u091c\\u0948\\u0935 \\u0930\\u0938\\u093e\\u092f\\u0928 \\u090f\\u0915 \\u0935\\u093f\\u091c\\u094d\\u091e\\u093e\\u0928 \\u0915\\u0940 \\u0936\\u093e\\u0916\\u093e \\u0939\\u0948 \\u091c\\u094b \\u091c\\u0940\\u0935\\u093f\\u0924 \\u091c\\u0940\\u0935\\u094b\\u0902 \\u092e\\u0947\\u0902 \\u0939\\u094b\\u0928\\u0947 \\u0935\\u093e\\u0932\\u0947 \\u0930\\u093e\\u0938\\u093e\\u092f\\u0928\\u093f\\u0915 \\u092a\\u094d\\u0930\\u0915\\u094d\\u0930\\u093f\\u092f\\u093e\\u0913\\u0902 \\u0914\\u0930 \\u092a\\u0926\\u093e\\u0930\\u094d\\u0925\\u094b\\u0902 \\u0915\\u093e \\u0905\\u0927\\u094d\\u092f\\u092f\\u0928 \\u0915\\u0930\\u0924\\u0940 \\u0939\\u0948\\u0964 \\u0907\\u0938\\u0915\\u093e \\u092e\\u0941\\u0916\\u094d\\u092f \\u0927\\u094d\\u092f\\u093e\\u0928 \\u091c\\u0940\\u0935\\u093e\\u0923\\u0941, \\u092a\\u094d\\u0930\\u094b\\u091f\\u0940\\u0928, \\u0928\\u094d\\u092f\\u0942\\u0915\\u094d\\u0932\\u093f\\u0915 \\u090f\\u0938\\u093f\\u0921, \\u0915\\u093e\\u0930\\u094d\\u092c\\u094b\\u0939\\u093e\\u0907\\u0921\\u094d\\u0930\\u0947\\u091f\\u094d\\u0938, \\u0914\\u0930 \\u0932\\u093f\\u092a\\u093f\\u0921\\u094d\\u0938 \\u091c\\u0948\\u0938\\u0947 \\u091c\\u0948\\u0935\\u093f\\u0915 \\u0905\\u0923\\u0941\\u0913\\u0902 \\u0915\\u0940 \\u0938\\u0902\\u0930\\u091a\\u0928\\u093e, \\u0915\\u093e\\u0930\\u094d\\u092f, \\u0914\\u0930 \\u092a\\u0930\\u0938\\u094d\\u092a\\u0930 \\u0915\\u094d\\u0930\\u093f\\u092f\\u093e\\u0913\\u0902 \\u092a\\u0930 \\u0939\\u094b\\u0924\\u093e \\u0939\\u0948\\u0964 \\u091c\\u0948\\u0935 \\u0930\\u0938\\u093e\\u092f\\u0928\\u093f\\u0915 \\u0905\\u0923\\u0941\\u0913\\u0902 \\u0915\\u094b \\u091c\\u0948\\u0938\\u0947 \\u0915\\u093f \\u092e\\u0947\\u091f\\u093e\\u092c\\u094b\\u0932\\u093f\\u091c\\u094d\\u092e, \\u0935\\u0943\\u0926\\u094d\\u0927\\u093f, \\u092a\\u094d\\u0930\\u091c\\u0928\\u0928, \\u0914\\u0930 \\u092c\\u0940\\u092e\\u093e\\u0930\\u0940 \\u0915\\u0947 \\u092a\\u094d\\u0930\\u0915\\u094d\\u0930\\u093f\\u092f\\u093e\\u0913\\u0902 \\u092e\\u0947\\u0902 \\u0915\\u0948\\u0938\\u0947 \\u092f\\u094b\\u0917\\u0926\\u093e\\u0928 \\u0915\\u0930\\u0924\\u0947 \\u0939\\u0948\\u0902 \\u0907\\u0938\\u0947 \\u0905\\u0927\\u094d\\u092f\\u092f\\u0928 \\u0915\\u093f\\u092f\\u093e \\u091c\\u093e\\u0924\\u093e \\u0939\\u0948\\u0964 \\u0935\\u0947 \\u0938\\u0947\\u0932 \\u092a\\u0925\\u094d\\u092f\\u094b\\u0902, \\u090f\\u0902\\u091c\\u093e\\u0907\\u092e \\u0915\\u093f\\u0928\\u0947\\u091f\\u093f\\u0915\\u094d\\u0938, \\u091c\\u0940\\u0928\\u0947\\u091f\\u093f\\u0915 \\u0905\\u092d\\u093f\\u0935\\u094d\\u092f\\u0915\\u094d\\u0924\\u093f, \\u0914\\u0930 \\u0938\\u0902\\u0915\\u0947\\u0924 \\u092a\\u0930\\u093f\\u0935\\u0939\\u0928 \\u0915\\u093e \\u0905\\u0928\\u094d\\u0935\\u0947\\u0937\\u0923 \\u0915\\u0930\\u0924\\u0947 \\u0939\\u0948\\u0902 \\u0924\\u093e\\u0915\\u093f \\u0935\\u093f\\u092d\\u093f\\u0928\\u094d\\u0928 \\u091c\\u0948\\u0935\\u093f\\u0915 \\u092a\\u094d\\u0930\\u0915\\u094d\\u0930\\u093f\\u092f\\u093e\\u0913\\u0902 \\u0915\\u0947 \\u0906\\u0927\\u093e\\u0930 \\u0915\\u0947 \\u0905\\u0923\\u0941\\u0913\\u0902 \\u0915\\u0947 \\u0938\\u0902\\u091a\\u093e\\u0930 \\u0915\\u0940 \\u0906\\u0927\\u09