                'name' => '{"en":"Molecular Biology","hi":"\\u0906\\u0923\\u0935\\u093f\\u0915 \\u091c\\u0940\\u0935\\u0935\\u093f\\u091c\\u094d\\u091e\\u093e\\u0928","ar":"\\u0639\\u0644\\u0645 \\u0627\\u0644\\u0623\\u062d\\u064a\\u0627\\u0621 \\u0627\\u0644\\u062c\\u0632\\u064a\\u0626\\u064a"}',
            'description' => '{"en":"Molecular biology is a field of biology that focuses on the study of biological processes at the molecular level, particularly the structure and function of biomolecules such as DNA, RNA, and proteins. It seeks to understand how these molecules interact within cells to carry out essential functions like replication, transcription, translation, and regulation of gene expression. Molecular biologists employ a variety of techniques and methodologies, including recombinant DNA technology, polymerase chain reaction (PCR), gel electrophoresis, and sequencing, to investigate and manipulate biological molecules. This field is fundamental to many areas of biological research, including genetics, biotechnology, medicine, and agriculture, contributing to advancements in disease treatment, genetic engineering, and crop improvement.","hi":"\\u0906\\u0923\\u0935\\u093f\\u0915 \\u091c\\u0940\\u0935\\u0935\\u093f\\u091c\\u094d\\u091e\\u093e\\u0928 \\u091c\\u0940\\u0935 \\u0935\\u093f\\u091c\\u094d\\u091e\\u093e\\u0928 \\u0915\\u093e \\u090f\\u0915 \\u0915\\u094d\\u0937\\u0947\\u0924\\u094d\\u0930 \\u0939\\u0948 \\u091c\\u094b \\u0935\\u093f\\u0936\\u0947\\u0937 \\u0930\\u0942\\u092a \\u0938\\u0947 \\u091c\\u0948\\u0935\\u093f\\u0915 \\u092a\\u094d\\u0930\\u0915\\u094d\\u0930\\u093f\\u092f\\u093e\\u0913\\u0902 \\u0915\\u093e \\u0905\\u0927\\u094d\\u092f\\u092f\\u0928 \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948 \\u0906\\u0923\\u0935\\u093f\\u0915 \\u0938\\u094d\\u0924\\u0930 \\u092a\\u0930, \\u0916\\u093e\\u0938\\u0915\\u0930 \\u0921\\u0940\\u090f\\u0928\\u090f, \\u0906\\u0930\\u090f\\u0928\\u090f, \\u0914\\u0930 \\u092a\\u094d\\u0930\\u094b\\u091f\\u0940\\u0928\\u094d\\u0938 \\u091c\\u0948\\u0938\\u0940 \\u091c\\u0940\\u0935\\u0935\\u093f\\u091c\\u094d\\u091e\\u093e\\u0928\\u093f\\u092f \\u092e\\u0938\\u093e\\u0932\\u094b\\u0902 \\u0915\\u0947 \\u0938\\u0902\\u0930\\u091a\\u0928\\u093e \\u0914\\u0930 \\u0915\\u093e\\u0930\\u094d\\u092f\\u0964 \\u