                'description' => '{"en":"Genetics is the branch of biology that studies genes, heredity, and variation in living organisms. It explores the principles governing the transmission of traits from parents to offspring and the molecular mechanisms underlying inheritance. Geneticists investigate how genes are organized, replicated, expressed, and regulated within cells, as well as how genetic information is transmitted through generations. They study genetic disorders, genetic diversity, and evolutionary processes to understand the genetic basis of traits and diseases. Genetics plays a crucial role in various fields, including medicine, agriculture, forensics, and biotechnology, contributing to advancements in personalized medicine, crop improvement, and genetic engineering.","hi":"\\u0906\\u0928\\u0941\\u0935\\u093e\\u0902\\u0936\\u093f\\u0915\\u0940 \\u091c\\u0940\\u0935\\u094b\\u0902 \\u092e\\u0947\\u0902 \\u091c\\u0940\\u0928, \\u0935\\u0902\\u0936\\u093e\\u0928\\u0941\\u0935\\u0902\\u0936\\u093f\\u0915\\u0940, \\u0914\\u0930 \\u092a\\u0930\\u093f\\u0935\\u0930\\u094d\\u0924\\u0928 \\u0915\\u093e \\u0905\\u0927\\u094d\\u092f\\u092f\\u0928 \\u0915\\u0930\\u0928\\u0947 \\u0935\\u093e\\u0932\\u0940 \\u091c\\u0940\\u0935\\u0935\\u093f\\u091c\\u094d\\u091e\\u093e\\u0928 \\u0915\\u0940 \\u0936\\u093e\\u0916\\u093e \\u0939\\u0948\\u0964 \\u0907\\u0938\\u092e\\u0947\\u0902 \\u092e\\u093e\\u0924\\u093e-\\u092a\\u093f\\u0924\\u093e \\u0938\\u0947 \\u0938\\u0902\\u0924\\u093e\\u0928\\u094b\\u0902 \\u092e\\u0947\\u0902 \\u0917\\u0941\\u0923\\u094b\\u0902 \\u0915\\u0947 \\u092a\\u094d\\u0930\\u0938\\u093e\\u0930 \\u0915\\u094b \\u0936\\u093e\\u0938\\u094d\\u0924\\u094d\\u0930\\u094b\\u0902 \\u0915\\u093e \\u0905\\u0927\\u094d\\u092f\\u092f\\u0928 \\u0915\\u093f\\u092f\\u093e \\u091c\\u093e\\u0924\\u093e \\u0939\\u0948 \\u0914\\u0930 \\u0935\\u093f\\u0930\\u093e\\u0938\\u0924 \\u0915\\u0947 \\u0928\\u0940\\u091a\\u0947 \\u0906\\u0928\\u0941\\u0935\\u093e\\u0902\\u09