                'description' => '{"en":"Physiology is the branch of biology that focuses on the study of the functions and mechanisms of living organisms and their parts. It investigates how biological systems work, from the molecular and cellular levels to the whole organism. Physiology encompasses various sub-disciplines, including neurophysiology, cardiovascular physiology, respiratory physiology, and endocrinology, among others. It explores processes such as metabolism, growth, reproduction, and response to stimuli. Physiologists employ a wide range of techniques and approaches, including experimentation, observation, and modeling, to understand the intricate workings of biological systems. Understanding physiology is essential for comprehending normal bodily functions, as well as the mechanisms underlying diseases and disorders, and is crucial in fields such as medicine, sports science, and pharmacology.","hi":"\\u0936\\u093e\\u0930\\u0940\\u0930\\u093f\\u0915\\u0940 \\u091c\\u0940\\u0935\\u093f\\u0915\\u093e \\u0915\\u0947 \\u0915\\u093e\\u0930\\u094d\\u092f\\u094b\\u0902 \\u0914\\u0930 \\u0924\\u0902\\u0924\\u094d\\u0930\\u094b\\u0902 \\u0915\\u0947 \\u0905\\u0927\\u094d\\u092f\\u092f\\u0928 \\u092a\\u0930 \\u0927\\u094d\\u092f\\u093e\\u0928 \\u0915\\u0947\\u0902\\u0926\\u094d\\u0930\\u093f\\u0924 \\u0915\\u0930\\u0928\\u0947 \\u0935\\u093e\\u0932\\u0940 \\u091c\\u0940\\u0935\\u0935\\u093f\\u091c\\u094d\\u091e\\u093e\\u0928 \\u0915\\u0940 \\u0936\\u093e\\u0916\\u093e \\u0939\\u0948\\u0964 \\u092f\\u0939 \\u091c\\u093e\\u0902\\u091a\\u0924\\u093e \\u0939\\u0948 \\u0915\\u093f \\u091c\\u0940\\u0935\\u093f\\u0915\\u093e \\u0915\\u0947 \\u091c\\u0940\\u0935\\u093f\\u0915\\u093e \\u0924\\u0902\\u0924\\u094d\\u0930 \\u0915\\u0948\\u0938\\u0947 \\u0915\\u093e\\u092e \\u0915\\u0930\\u0924\\u0947 \\u0939\\u0948\\u0902, \\u092a\\u0942\\u0930\\u0940 \\u0909\\u0924\\u094d\\u092a\\u093e\\u0926 \\u092e\\u0947\\u0902 \\u0938\\u0947 \\u0906\\u0923\\u0935\\u093f\\u0915 \\u09