            array (
                'id' => 136,
                'name' => '{"en":"Managerial Accounting","hi":"\\u092a\\u094d\\u0930\\u092c\\u0902\\u0927\\u0928\\u0940\\u092f \\u0932\\u0947\\u0916\\u093e\\u0902\\u0915\\u0928","ar":"\\u0627\\u0644\\u0645\\u062d\\u0627\\u0633\\u0628\\u0629 \\u0627\\u0644\\u0625\\u062f\\u0627\\u0631\\u064a\\u0629"}',
                'description' => '{"en":"Managerial accounting, also known as cost accounting, is the process of generating financial information and reports for internal use by management to make informed business decisions. Unlike financial accounting, which primarily focuses on providing information to external stakeholders, managerial accounting emphasizes providing information to internal users, such as managers, executives, and employees. It involves analyzing costs, revenues, profits, and other financial metrics to support planning, controlling, and decision-making within the organization. Managerial accountants use techniques such as cost-volume-profit analysis, budgeting, variance analysis, and performance measurement to assist management in optimizing operations and achieving strategic objectives.","hi":"\\u092a\\u094d\\u0930\\u092c\\u0902\\u0927\\u0928\\u0940\\u092f \\u0932\\u0947\\u0916\\u093e\\u0902\\u0915\\u0928, \\u091c\\u093f\\u0938\\u0947 \\u0932\\u093e\\u0917\\u0924 \\u0932\\u0947\\u0916\\u093e\\u0902\\u0915\\u0928 \\u0915\\u0947 \\u0930\\u0942\\u092a \\u092e\\u0947\\u0902 \\u092d\\u0940 \\u091c\\u093e\\u0928\\u093e \\u091c\\u093e\\u0924\\u093e \\u0939\\u0948, \\u092a\\u094d\\u0930\\u092c\\u0902\\u0927\\u0928 \\u0926\\u094d\\u0935\\u093e\\u0930\\u093e \\u0938\\u0942\\u091a\\u093f\\u0924 \\u0935\\u094d\\u092f\\u0935\\u0938\\u093e\\u092f\\u093f\\u0915 \\u0928\\u093f\\u0930\\u094d\\u0923\\u092f \\u0932\\u0947\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0906\\u0902\\u0924\\u0930\\u093f\\u0915 \\u0909\\u092a\\u092f\\u094b\\u0917 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0935\\u093f\\u0924\\u094d\\u0924\\u0940\\u092f \\u091c\\u093e\\u0928\\u0915\\u093e\\u0930\\u0940 \\u0914\\u0930 \\u0930\\u093f\\u092a\\u094b\\u0930\\u094d\\u091f \\u092a\\u0948\\u0926\\u093e \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0940 \\u092a\\u094d\\u0930\\u0915\\u094d\\u0930\\u093f\\u092f\\u093e \\u0939\\u0948\\u0964 \\u0935\\u093f\\u0924\\u094d\\u0924\\u0940\\u092f \\u0932\\u0947\\u0916\\u093e\\u0902\\u0915\\u0928 \\u0915\\u0940 \\u0905\\u092a\\u0947\\u0915\\u094d\\u0937\\u093e, \\u091c\\u094b \\u092e\\u0941\\u0916\\u094d\\u092f \\u0930\\u0942\\u092a \\u0938\\u0947 \\u092c\\u093e\\u0939\\u094d\\u092f \\u0939\\u093f\\u0924\\u0927\\u093e\\u0930\\u0915\\u094b\\u0902 \\u0915\\u094b \\u091c\\u093e\\u0928\\u0915\\u093e\\u0930\\u0940 \\u092a\\u094d\\u0930\\u0926\\u093e\\u0928 \\u0915\\u0930\\u0928\\u0947 \\u092a\\u0930 \\u0927\\u094d\\u092f\\u093e\\u0928 \\u0915\\u0947\\u0902\\u0926\\u094d\\u0930\\u093f\\u0924 \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948, \\u092a\\u094d\\u0930\\u092c\\u0902\\u0927\\u0928\\u0940\\u092f \\u0932\\u0947\\u0916\\u093e\\u0902\\u0915\\u0928 \\u0915\\u094b \\u0906\\u0902\\u0924\\u0930\\u093f\\u0915 \\u0909\\u092a\\u092f\\u094b\\u0917\\u0915\\u0930\\u094d\\u0924\\u093e\\u0913\\u0902, \\u091c\\u0948\\u0938\\u0947 \\u0915\\u093f \\u092a\\u094d\\u0930\\u092c\\u0902\\u0927\\u0915\\u094b\\u0902, \\u0915\\u093e\\u0930\\u094d\\u092f\\u0915\\u093e\\u0930\\u093f\\u092f\\u094b\\u0902, \\u0914\\u0930 \\u0915\\u0930\\u094d\\u092e\\u091a\\u093e\\u0930\\u093f\\u092f\\u094b\\u0902 \\u0915\\u094b \\u091c\\u093e\\u0928\\u0915\\u093e\\u0930\\u0940 \\u092a\\u094d\\u0930\\u0926\\u093e\\u0928 \\u0915\\u0930\\u0928\\u0947 \\u092a\\u0930 \\u091c\\u094b\\u0930 \\u0926\\u093f\\u092f\\u093e \\u091c\\u093e\\u0924\\u093e \\u0939\\u0948\\u0964 \\u092f\\u0939 \\u0938\\u0902\\u0917\\u0920\\u0928 \\u092e\\u0947\\u0902 \\u092f\\u094b\\u091c\\u0928\\u093e, \\u0928\\u093f\\u092f\\u0902\\u0924\\u094d\\u0930\\u0923 \\u0914\\u0930 \\u0928\\u093f\\u0930\\u094d\\u0923\\u092f \\u0932\\u0947\\u0928\\u0947 \\u0915\\u0940 \\u0938\\u092e\\u0930\\u094d\\u0925\\u0928 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0932\\u093e\\u0917\\u0924\\u094b\\u0902, \\u0906\\u092f\\u094b\\u0902, \\u0932\\u093e\\u092d\\u094b\\u0902, \\u0914\\u0930 \\u0905\\u0928\\u094d\\u092f \\u0935\\u093f\\u0924\\u094d\\u0924\\u0940\\u092f \\u092e\\u0948\\u091f\\u094d\\u0930\\u093f\\u0915\\u094d\\u0938