            36 => 
            array (
                'id' => 137,
                'name' => '{"en":"Tax Accounting","hi":"\\u0915\\u0930 \\u0932\\u0947\\u0916\\u093e","ar":"\\u0627\\u0644\\u0645\\u062d\\u0627\\u0633\\u0628\\u0629 \\u0627\\u0644\\u0636\\u0631\\u064a\\u0628\\u064a\\u0629"}',
                'description' => '{"en":"Tax accounting involves the preparation, analysis, and submission of financial information related to taxes. It focuses on ensuring compliance with tax laws and regulations while optimizing the tax obligations of individuals and businesses. Tax accountants work to accurately calculate taxable income, deductions, credits, and liabilities, and to prepare tax returns for submission to the relevant tax authorities. They also provide advice on tax planning strategies to minimize tax liabilities and maximize tax benefits. Tax accounting encompasses various aspects of taxation, including income tax, corporate tax, sales tax, property tax, and other taxes imposed by governmental authorities.","hi":"\\u0915\\u0930 \\u0932\\u0947\\u0916\\u093e \\u092e\\u0947\\u0902 \\u0915\\u0930\\u094b\\u0902 \\u0938\\u0947 \\u0938\\u0902\\u092c\\u0902\\u0927\\u093f\\u0924 \\u0935\\u093f\\u0924\\u094d\\u0924\\u0940\\u092f \\u091c\\u093e\\u0928\\u0915\\u093e\\u0930\\u0940 \\u0915\\u0940 \\u0924\\u0948\\u092f\\u093e\\u0930\\u0940, \\u0935\\u093f\\u0936\\u094d\\u0932\\u0947\\u0937\\u0923, \\u0914\\u0930 \\u0938\\u092c\\u092e\\u093f\\u0936\\u0928 \\u0915\\u0940 \\u092a\\u094d\\u0930\\u0915\\u094d\\u0930\\u093f\\u092f\\u093e \\u0939\\u094b\\u0924\\u0940 \\u0939\\u0948\\u0964 \\u0907\\u0938\\u0915\\u093e \\u092e\\u0941\\u0916\\u094d\\u092f \\u0909\\u0926\\u094d\\u0926\\u0947\\u0936\\u094d\\u092f \\u0915\\u0930\\u094b\\u0902 \\u0915\\u0947 \\u0935\\u093f\\u0927\\u093f \\u0914\\u0930 \\u0935\\u093f\\u0928\\u093f\\u092f\\u092e\\u094b\\u0902 \\u0915\\u093e \\u092a\\u093e\\u0932\\u0928 \\u0938\\u0941\\u0928\\u093f\\u0936\\u094d\\u091a\\u093f\\u0924 \\u0915\\u0930\\u0928\\u093e \\u0939\\u094b\\u0924\\u093e \\u0939\\u0948 \\u091c\\u092c\\u0915\\u093f \\u0935\\u094d\\u092f\\u0915\\u094d\\u0924\\u093f\\u092f\\u094b\\u0902 \\u0914\\u0930 \\u0935\\u094d\\u092f\\u093e\\u092a\\u093e\\u0930\\u094b\\u0902 \\u0915\\u0947 \\u0915\\u0930 \\u0926\\u093e\\u092f\\u093f\\u0924\\u094d\\u0935\\u094b\\u0902 \\u0915\\u094b \\u0905\\u0927\\u093f\\u0915\\u0924\\u092e \\u0915\\u093f\\u092f\\u093e \\u091c\\u093e\\u0924\\u093e \\u0939\\u0948\\u0964 \\u0915\\u0930 \\u0932\\u0947\\u0916\\u093e \\u0935\\u093f\\u0924\\u094d\\u0924\\u0940\\u092f \\u0906\\u092f, \\u091b\\u0942\\u091f, \\u0915\\u094d\\u0930\\u0947\\u0921\\u093f\\u091f, \\u0914\\u0930 \\u0926\\u093e\\u092f\\u093f\\u0924\\u094d\\u0935\\u094b\\u0902 \\u0915\\u093e \\u0938\\u0939\\u0940 \\u0917\\u0923\\u0928\\u093e \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0915\\u093e\\u092e \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948, \\u0914\\u0930 \\u092a\\u094d\\u0930\\u093e\\u0938\\u0902\\u0917\\u093f\\u0915 \\u0915\\u0930 \\u0905\\u0927\\u093f\\u0915\\u093e\\u0930\\u093f\\u092f\\u094b\\u0902 \\u0915\\u094b \\u0915\\u0930 \\u0930\\u093f\\u091f\\u0930\\u094d\\u0928 \\u092a\\u094d\\u0930\\u0938\\u094d\\u0924\\u0941\\u0924 \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0915\\u0930 \\u0932\\u0947\\u0916\\u093e \\u0924\\u0948\\u092f\\u093e\\u0930 \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948\\u0964 \\u0935\\u0947 \\u0905\\u0927\\u093f\\u0915\\u0924\\u092e \\u0915\\u0930 \\u0926\\u093e\\u092f\\u093f\\u0924\\u094d\\u0935\\u094b\\u0902 \\u0915\\u094b \\u0915\\u092e \\u0915\\u0930\\u0928\\u0947 \\u0914\\u0930 \\u0915\\u0930 \\u0932\\u093e\\u092d\\u094b\\u0902 \\u0915\\u094b \\u0905\\u0927\\u093f\\u0915 \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0915\\u0930 \\u092f\\u094b\\u091c\\u0928\\u093e \\u0915\\u0947 \\u0930\\u0923\\u0928\\u0940\\u0924\\u093f\\u0915 \\u0938\\u0941\\u091d\\u093e\\u0935 \\u092d\\u0940 \\u092a\\u094d\\u0930\\u0926\\u093e\\u0928 \\u0915\\u0930\\u0924\\u0947 \\u0939\\u0948\\u0902\\u0964 \\u0915\\u0930 \\u0932\\u0947\\u0916\\u093e \\u0935\\u093f\\u092d\\u093f\\u0928\\u094d\\u0928 \\u092a\\u094d\\u0930\\u0915\\u093e\\u0930 \\u0915\\u0947 \\u0915\\u0930\\u094b\\u0902 \\u0915\\u094b \\u0936\\u093e\\u092e\\u093f\\u0932 \\u0915\\