                'name' => '{"en":"Auditing","hi":"\\u0932\\u0947\\u0916\\u093e\\u0902\\u0915\\u0928","ar":"\\u0627\\u0644\\u062a\\u062f\\u0642\\u064a\\u0642"}',
                'description' => '{"en":"Auditing is the systematic examination and evaluation of financial records, transactions, and processes to ensure accuracy, compliance with laws and regulations, and integrity. It is performed by independent professionals known as auditors, who review financial statements, internal controls, and accounting systems to provide an objective opinion on the fairness and reliability of the information presented. Auditing helps to enhance transparency, accountability, and trust in financial reporting, both for internal management and external stakeholders, such as investors, creditors, and regulatory authorities. Types of audits include financial audits, operational audits, compliance audits, and forensic audits, each serving specific purposes in assessing an organization\'s financial health and performance.","hi":"\\u0932\\u0947\\u0916\\u093e\\u0902\\u0915\\u0928 \\u0935\\u093f\\u0924\\u094d\\u0924\\u0940\\u092f \\u0930\\u093f\\u0915\\u0949\\u0930\\u094d\\u0921, \\u0932\\u0947\\u0928-\\u0926\\u0947\\u0928, \\u0914\\u0930 \\u092a\\u094d\\u0930\\u0915\\u094d\\u0930\\u093f\\u092f\\u093e\\u0913\\u0902 \\u0915\\u093e \\u0935\\u094d\\u092f\\u0935\\u0938\\u094d\\u0925\\u093f\\u0924 \\u091c\\u093e\\u0902\\u091a \\u0914\\u0930 \\u092e\\u0942\\u0932\\u094d\\u092f\\u093e\\u0902\\u0915\\u0928 \\u0939\\u0948 \\u091c\\u094b \\u0938\\u091f\\u0940\\u0915\\u0924\\u093e, \\u0935\\u093f\\u0927\\u093f\\u092f\\u094b\\u0902 \\u0914\\u0930 \\u0935\\u093f\\u0928\\u093f\\u092f\\u092e\\u094b\\u0902 \\u0915\\u0947 \\u0938\\u093e\\u0925 \\u0938\\u0902\\u0918\\u0928\\u0928 \\u0915\\u094b \\u0938\\u0941\\u0928\\u093f\\u0936\\u094d\\u091a\\u093f\\u0924 \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948, \\u0914\\u0930 \\u0905\\u0916\\u0902\\u0921\\u0924\\u093e\\u0964 \\u092f\\u0939 \\u0928\\u093f\\u0937\\u094d\\u092a\\u0915\\u094d\\u0937 \\u092a\\u0947\\u0936\\u0947\\u0935\\u0930\\u094b\\u0902 \\u0926\\u094d\\u0935\\u093e\\u0930\\u093e \\u0915\\u093f\\u092f\\u093e \\u091c\\u093e\\u0924\\u093e \\u0939\\u0948 \\u091c\\u093f\\u0928\\u094d\\u0939\\u0947\\u0902 \\u0932\\u0947\\u0916\\u093e\\u092a\\u0930\\u0940\\u0915\\u094d\\u0937\\u0915 \\u0915\\u0947 \\u0930\\u0942\\u092a \\u092e\\u0947\\u0902 \\u091c\\u093e\\u0928\\u093e \\u091c\\u093e\\u0924\\u093e \\u0939\\u0948, \\u091c\\u094b \\u0935\\u093f\\u0924\\u094d\\u0924\\u0940\\u092f \\u0935\\u093f\\u0935\\u0930\\u0923, \\u0906\\u0902\\u0924\\u0930\\u093f\\u0915 \\u0928\\u093f\\u092f\\u0902\\u0924\\u094d\\u0930\\u0923, \\u0914\\u0930 \\u0932\\u0947\\u0916\\u093e\\u0902\\u0915\\u0928 \\u092a\\u094d\\u0930\\u0923\\u093e\\u0932\\u093f\\u092f\\u094b\\u0902 \\u0915\\u0940 \\u0938\\u092e\\u0940\\u0915\\u094d\\u0937\\u093e \\u0915\\u0930\\u0924\\u0947 \\u0939\\u0948\\u0902 \\u0924\\u093e\\u0915\\u093f \\u092a\\u094d\\u0930\\u0938\\u094d\\u0924\\u0941\\u0924 \\u0915\\u0940 \\u0917\\u0908 \\u091c\\u093e\\u0928\\u0915\\u093e\\u0930\\u0940 \\u0915\\u0947 \\u0928\\u093f\\u0937\\u094d\\u092a\\u0915\\u094d\\u0937\\u0924\\u093e \\u0914\\u0930 \\u0935\\u093f\\u0936\\u094d\\u0935\\u0938\\u0928\\u0940\\u092f\\u0924\\u093e \\u092a\\u0930 \\u090f\\u0915 \\u0935\\u093f\\u0937\\u092f\\u093e\\u0924\\u094d\\u092e\\u0915 \\u092e\\u0924 \\u092a\\u094d\\u0930\\u0926\\u093e\\u0928 \\u0915\\u093f\\u092f\\u093e \\u091c\\u093e \\u0938\\u0915\\u0947\\u0964 \\u0932\\u0947\\u0916\\u093e\\u0902\\u0915\\u0928 \\u0935\\u093f\\u0924\\u094d\\u0924\\u0940\\u092f \\u0930\\u093f\\u092a\\u094b\\u0930\\u094d\\u091f\\u093f\\u0902\\u0917 \\u092e\\u0947\\u0902 \\u092a\\u093e\\u0930\\u0926\\u0930\\u094d\\u0936\\u093f\\u0924\\u093e, \\u091c\\u0935\\u093e\\u092c\\u0926\\u0947\\u0939\\u0940, \\u0914\\u0930 \\u0935\\u093f\\u0936\\u094d\\u0935\\u093e\\u0938 \\u0915\\u094b \\u092c\\u0922\\u093c\\u093e\\u0935\\u093e \\u0926\\u0947\\u0928\\u0947 \\u092e\\u0947\\u0902 \\u092e\\u0926\\u0926 \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948, \\u0938\\u093e\\u0925 \\u0939\\u0940, \\u0907\\u0938\\u0915\\u093e \\u0909\\u092a\\u092f\\u094b\\u0917 \\u0906