            'description' => '{"en":"Financial reporting refers to the process of presenting financial information and performance of a company to external stakeholders, including investors, creditors, regulators, and the public. It involves the preparation and dissemination of financial statements such as balance sheets, income statements, cash flow statements, and statements of retained earnings. These reports provide a comprehensive overview of the financial health, performance, and position of the organization, helping stakeholders make informed decisions about investing, lending, or regulating the company. Financial reporting follows generally accepted accounting principles (GAAP) or international financial reporting standards (IFRS) to ensure consistency, transparency, and comparability of financial information across different companies and industries.","hi":"\\u0935\\u093f\\u0924\\u094d\\u0924\\u0940\\u092f \\u0930\\u093f\\u092a\\u094b\\u0930\\u094d\\u091f\\u093f\\u0902\\u0917 \\u0909\\u0938 \\u092a\\u094d\\u0930\\u0915\\u094d\\u0930\\u093f\\u092f\\u093e \\u0915\\u094b \\u0938\\u0902\\u0926\\u0930\\u094d\\u092d\\u093f\\u0924 \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948 \\u091c\\u093f\\u0938\\u092e\\u0947\\u0902 \\u0915\\u093f\\u0938\\u0940 \\u0915\\u0902\\u092a\\u0928\\u0940 \\u0915\\u0940 \\u0935\\u093f\\u0924\\u094d\\u0924\\u0940\\u092f \\u091c\\u093e\\u0928\\u0915\\u093e\\u0930\\u0940 \\u0914\\u0930 \\u092a\\u094d\\u0930\\u0926\\u0930\\u094d\\u0936\\u0928 \\u0915\\u094b \\u092c\\u093e\\u0939\\u094d\\u092f \\u0939\\u093f\\u0924\\u0927\\u093e\\u0930\\u0915\\u094b\\u0902, \\u091c\\u0948\\u0938\\u0947 \\u0915\\u093f \\u0928\\u093f\\u0935\\u0947\\u0936\\u0915, \\u090b\\u0923\\u0926\\u093e\\u0924\\u093e, \\u0928\\u093f\\u092f\\u093e\\u092e\\u0915, \\u0914\\u0930 \\u0938\\u093e\\u0930\\u094d\\u0935\\u091c\\u0928\\u093f\\u0915, \\u0915\\u0947 \\u0938\\u093e\\u092e\\u0928\\u0947 \\u092a\\u094d\\u0930\\u0938\\u094d\\u0924\\u0941\\u0924 \\u0915\\u093f\\u092f\\u093e \